INSERT INTO `indikator` VALUES ('1', '1', '<p>Kondisi Eksternal</p><p>Konsistensi dengan hasil analisis SWOT dan/atau analisis lain serta rencana pengembangan ke depan.</p>', '2023-03-08 09:48:32', '2023-03-08 09:48:32', null, '1', null, null);
INSERT INTO `indikator` VALUES ('2', '2', '<p>Profil Unit Pengelola Program Studi</p><p>Keserbacakupan informasi dalam profil dan konsistensi antara profil dengan data dan informasi yang disampaikan pada masing-masing kriteria, serta menunjukkan iklim yang kondusif untuk pengembangan dan reputasi sebagai rujukan di bidang keilmuannya.</p>', '2023-03-08 09:48:52', '2023-03-08 09:48:52', null, '1', null, null);
INSERT INTO `indikator` VALUES ('3', '3', '<p>Kesesuaian Visi, Misi, Tujuan dan Strategi (VMTS) Unit Pengelola Program Studi (UPPS) terhadap VMTS Perguruan Tinggi (PT) dan visi keilmuan Program Studi (PS) yang dikelolanya.<br></p>', '2023-03-08 09:49:19', '2023-03-08 09:49:19', null, '0.51', null, null);
INSERT INTO `indikator` VALUES ('4', '3', '<p>Mekanisme dan keterlibatan pemangku kepentingan dalam penyusunan VMTS UPPS.<br></p>', '2023-03-08 09:49:41', '2023-03-08 09:49:41', null, '1.02', null, null);
INSERT INTO `indikator` VALUES ('5', '3', '<p>Strategi pencapaian tujuan disusun berdasarkan analisis yang sistematis, serta pada pelaksanaannya dilakukan pemantauan dan evaluasi yang ditindaklanjuti.&nbsp;<br></p>', '2023-03-08 09:49:59', '2023-03-08 09:49:59', null, '1.53', null, null);
INSERT INTO `indikator` VALUES ('6', '4', '<p>A. Kelengkapan struktur organisasi dan keefektifan penyelenggaraan organisasi.<br></p>', '2023-03-08 09:50:28', '2023-03-08 09:50:28', null, '0.34', null, null);
INSERT INTO `indikator` VALUES ('7', '4', '<p>B. Perwujudan good governance dan pemenuhan lima pilar sistem tata pamong, yang mencakup: 1) Kredibel, 2) Transparan, 3) Akuntabel, 4) Bertanggung jawab, 5) Adil.<br></p>', '2023-03-08 09:50:52', '2023-03-08 09:50:52', null, '0.34', null, null);
INSERT INTO `indikator` VALUES ('8', '5', '<p>A. Komitmen pimpinan UPPS.<br></p>', '2023-03-08 09:52:03', '2023-03-08 09:52:03', null, '0.34', null, null);
INSERT INTO `indikator` VALUES ('9', '5', '<p>B. Kapabilitas pimpinan UPPS, mencakup aspek: 1) perencanaan, 2) pengorganisasian, 3) penempatan personel, 4) pelaksanaan, 5) pengendalian dan pengawasan, dan 6) pelaporan yang menjadi dasar tindak lanjut.&nbsp;<br></p>', '2023-03-09 04:53:15', '2023-03-09 09:53:14', null, '0.34', null, null);
INSERT INTO `indikator` VALUES ('10', '6', '<p>Mutu, manfaat, kepuasan dan keberlanjutan kerjasama pendidikan, penelitian dan PkM yang relevan dengan program studi. UPPS memiliki bukti yang sahih terkait kerjasama yang ada telah memenuhi 3 aspek berikut: 1) memberikan manfaat bagi program studi dalam pemenuhan proses pembelajaran, penelitian, PkM. 2) memberikan peningkatan kinerja tridharma dan fasilitas pendukung program studi. 3) memberikan kepuasan kepada mitra industri dan mitra kerjasama lainnya, serta menjamin keberlanjutan kerjasama dan hasilnya.<br></p>', '2023-03-09 09:50:38', '2023-03-09 09:50:38', null, '0.68', null, null);
INSERT INTO `indikator` VALUES ('11', '6', '<p>A. Kerjasama perguruan tinggi di bidang pendidikan, penelitian dan PkM dalam 3 tahun terakhir.</p><p>Tabel 1 LKPS</p>', '2023-03-09 04:53:53', '2023-03-09 09:53:53', null, '0.34', null, null);
INSERT INTO `indikator` VALUES ('12', '6', '<p>B. Kerjasama tingkat internasional, nasional, wilayah/lokal yang relevan dengan program studi dan dikelola oleh UPPS dalam 3 tahun terakhir.</p><p>Tabel 1 LKPS</p>', '2023-03-09 04:53:59', '2023-03-09 09:53:58', null, '0.34', null, null);
INSERT INTO `indikator` VALUES ('13', '7', '<p>Pelampauan SN-DIKTI (indikator kinerja tambahan) yang ditetapkan oleh UPPS pada tiap kriteria.<br></p>', '2023-03-09 09:52:55', '2023-03-09 09:52:55', null, '0.68', null, null);
INSERT INTO `indikator` VALUES ('14', '8', '<p>Analisis keberhasilan dan/atau ketidakberhasilan pencapaian kinerja yang telah ditetapkan institusi yang memenuhi 2 aspek sebagai berikut:&nbsp;</p><p>1) capaian kinerja harus diukur dengan metoda yang tepat, dan hasilnya dianalisis serta dievaluasi, dan</p><p>2) analisis terhadap capaian kinerja mencakup identifikasi akar masalah, faktor pendukung keberhasilan dan faktor penghambat ketercapaian standar, dan deskripsi singkat tindak lanjut yang akan dilakukan.</p>', '2023-03-09 09:55:38', '2023-03-09 09:55:38', null, '1.02', null, null);
INSERT INTO `indikator` VALUES ('15', '9', '<p>Keterlaksanaan Sistem Penjaminan Mutu Internal (akademik dan nonakademik) yang dibuktikan dengan keberadaan 5 aspek:</p><p>1) dokumen legal pembentukan unsur pelaksana penjaminan mutu.</p><p>2) ketersediaan dokumen mutu: kebijakan SPMI, manual SPMI, standar SPMI, dan formulir SPMI.</p><p>3) terlaksananya siklus penjaminan mutu (siklus PPEPP).</p><p>4) bukti sahih efektivitas pelaksanaan penjaminan mutu.</p><p>5) memiliki external benchmarking dalam peningkatan mutu.</p>', '2023-03-29 03:49:53', '2023-03-29 03:49:53', null, '1.36', '2', null);
INSERT INTO `indikator` VALUES ('16', '10', '<p>Pengukuran kepuasan layanan manajemen terhadap para pemangku kepentingan: mahasiswa, dosen, tenaga kependidikan, lulusan, pengguna dan mitra yang memenuhi aspek-aspek berikut:</p><p>1) menggunakan instrumen kepuasan yang sahih, andal, mudah digunakan,</p><p>2) dilaksanakan secara berkala, serta datanya terekam secara komprehensif,&nbsp;</p><p>3) dianalisis dengan metode yang tepat serta bermanfaat untuk pengambilan keputusan,</p><p>4) tingkat kepuasan dan umpan balik ditindaklanjuti untuk perbaikan dan peningkatan mutu luaran secara berkala dan tersistem,</p><p>5) dilakukan review terhadap pelaksanaan pengukuran kepuasan dosen dan mahasiswa, serta</p><p>6) hasilnya dipublikasikan dan mudah diakses oleh dosen dan mahasiswa.</p>', '2023-03-09 09:58:09', '2023-03-09 09:58:09', null, '1.36', null, null);
INSERT INTO `indikator` VALUES ('17', '11', '<p>Metoda rekrutmen dan keketatan seleksi.</p><p>Tabel 2.a LKPS</p>', '2023-03-10 02:07:33', '2023-03-10 02:07:33', null, '4.60', null, null);
INSERT INTO `indikator` VALUES ('18', '12', '<p>A. Peningkatan animo calon mahasiswa.</p><p>Tabel 2.a LKPS</p>', '2023-03-10 02:14:59', '2023-03-10 02:14:59', null, '3.07', null, null);
INSERT INTO `indikator` VALUES ('19', '12', '<p>B. Mahasiswa asing.</p><p>Tabel 2.b LKPS</p>', '2023-03-10 02:15:16', '2023-03-10 02:15:16', null, '3.07', null, null);
INSERT INTO `indikator` VALUES ('20', '13', '<p>A. Ketersediaan layanan kemahasiswaan di bidang:&nbsp;</p><p>1) penalaran, minat dan bakat,</p><p>2) kesejahteraan (bimbingan dan konseling, layanan beasiswa, dan layanan kesehatan), dan</p><p>3) bimbingan karir dan kewirausahaan.</p>', '2023-03-10 02:18:15', '2023-03-10 02:18:15', null, '1.53', null, null);
INSERT INTO `indikator` VALUES ('21', '13', '<p>B. Akses dan mutu layanan kemahasiswaan.<br></p>', '2023-03-10 02:22:24', '2023-03-10 02:22:24', null, '1.53', null, null);
INSERT INTO `indikator` VALUES ('22', '14', '<p>Kecukupan jumlah DTPS.</p><p>Tabel 3.a.1) LKPS</p>', '2023-03-10 02:24:45', '2023-03-10 02:24:45', null, '0.74', '2', null);
INSERT INTO `indikator` VALUES ('23', '14', '<p>Kualifikasi akademik DTPS.</p><p>Tabel 3.a.1) LKPS</p>', '2023-03-29 03:48:29', '2023-03-29 03:48:29', null, '0.99', '3.5', '3');
INSERT INTO `indikator` VALUES ('24', '14', '<p>Jabatan akademik DTPS.</p><p>Tabel 3.a.1) LKPS</p>', '2023-03-29 03:48:31', '2023-03-29 03:48:31', null, '0.50', '3.5', '3');
INSERT INTO `indikator` VALUES ('25', '14', '<p>Rasio jumlah mahasiswa program studi terhadap jumlah DTPS.</p><p>Tabel 2.a LKPS dan Tabel 3.a.1) LKPS</p>', '2023-03-10 02:35:35', '2023-03-10 07:35:35', null, '0.50', null, null);
INSERT INTO `indikator` VALUES ('26', '14', '<p>Penugasan DTPS sebagai pembimbing utama tugas akhir mahasiswa.</p><p>Tabel 3.a.2) LKPS&nbsp;</p>', '2023-03-10 07:36:23', '2023-03-10 07:36:23', null, '0.99', null, null);
INSERT INTO `indikator` VALUES ('27', '14', '<p>Ekuivalensi Waktu Mengajar Penuh DTPS.</p><p>Tabel 3.a.3) LKPS</p>', '2023-03-10 07:36:58', '2023-03-10 07:36:58', null, '0.25', null, null);
INSERT INTO `indikator` VALUES ('28', '14', '<p>Dosen tidak tetap.</p><p>Tabel 3.a.4) LKPS</p>', '2023-03-10 07:37:41', '2023-03-10 07:37:41', null, '0.50', null, null);
INSERT INTO `indikator` VALUES ('29', '15', '<p>Pengakuan/rekognisi atas kepakaran/prestasi/kinerja DTPS.</p><p>Pengakuan/rekognisi atas kepakaran/prestasi/kinerja DTPS dapat berupa:</p><p>a) menjadi visiting lecturer atau visiting scholar di program studi/perguruan tinggi terakreditasi A/Unggul atau program studi/perguruan tinggi internasional bereputasi.</p><p>b) menjadi keynote speaker/invited speaker pada pertemuan ilmiah tingkat nasional/ internasional.</p><p>c) menjadi editor atau mitra bestari pada jurnal nasional terakreditasi/jurnal internasional bereputasi di bidang yang sesuai dengan bidang program studi.</p><p>d) menjadi staf ahli/narasumber di lembaga tingkat wilayah/nasional/internasional pada bidang yang sesuai dengan bidang program studi (untuk pengusul dari program studi pada program Sarjana/Magister/Doktor), atau menjadi tenaga ahli/konsultan di lembaga/industri tingkat wilayah/nasional/ internasional pada bidang yang sesuai dengan bidang program studi (untuk pengusul dari program studi pada program Diploma Tiga/Sarjana Terapan/Magister Terapan/Doktor Terapan).</p><p>e) mendapat penghargaan atas prestasi dan kinerja di tingkat wilayah/nasional/internasional.</p><p>Tabel 3.b.1) LKPS</p>', '2023-03-10 07:47:39', '2023-03-10 07:47:39', null, '0.81', null, null);
INSERT INTO `indikator` VALUES ('30', '15', '<p>Kegiatan penelitian DTPS yang relevan dengan bidang program studi dalam 3 tahun terakhir.</p><p>Tabel 3.b.2) LKPS</p>', '2023-03-10 07:48:03', '2023-03-10 07:48:03', null, '0.81', null, null);
INSERT INTO `indikator` VALUES ('31', '15', '<p>Kegiatan PkM DTPS yang relevan dengan bidang program studi dalam 3 tahun terakhir.</p><p>Tabel 3.b.3) LKPS</p>', '2023-03-10 07:48:19', '2023-03-10 07:48:19', null, '0.41', null, null);
INSERT INTO `indikator` VALUES ('32', '15', '<p>Publikasi ilmiah dengan tema yang relevan dengan bidang program studi yang dihasilkan DTPS dalam 3 tahun terakhir.</p><p>Tabel 3.b.4) LKPS</p>', '2023-03-10 07:48:44', '2023-03-10 07:48:44', null, '0.81', null, null);
INSERT INTO `indikator` VALUES ('33', '15', '<p>Artikel karya ilmiah DTPS yang disitasi dalam 3 tahun terakhir.</p><p>Tabel 3.b.5) LKPS</p>', '2023-03-10 07:49:25', '2023-03-10 07:49:25', null, '0.81', null, null);
INSERT INTO `indikator` VALUES ('34', '15', '<p>Luaran penelitian dan PkM yang dihasilkan DTPS dalam 3 tahun terakhir.</p><p>Tabel 3.b.7) LKPS</p>', '2023-03-10 07:49:38', '2023-03-10 07:49:38', null, '0.81', null, null);
INSERT INTO `indikator` VALUES ('35', '16', '<p>Upaya pengembangan dosen.</p><p>Catatan: Jika Skor rata-rata butir Profil Dosen ? 3,5 , maka Skor = 4.</p>', '2023-03-10 07:57:23', '2023-03-10 07:57:23', null, '2.23', null, null);
INSERT INTO `indikator` VALUES ('36', '17', '<p>A. Kualifikasi dan kecukupan tenaga kependidikan berdasarkan jenis pekerjaannya (administrasi, pustakawan, teknisi, dll.)</p><p>Catatan: Penilaian kecukupan tidak hanya ditentukan oleh jumlah tenaga kependidikan, namun keberadaan dan pemanfaatan teknologi informasi dan komputer dalam proses administrasi dapat dijadikan pertimbangan untuk menilai efektifitas pekerjaan dan kebutuhan akan tenaga kependidikan.</p>', '2023-03-10 07:58:47', '2023-03-10 07:58:47', null, '1.12', null, null);
INSERT INTO `indikator` VALUES ('37', '17', '<p>B. Kualifikasi dan kecukupan laboran untuk mendukung proses pembelajaran sesuai dengan kebutuhan program studi.<br></p>', '2023-03-10 07:59:06', '2023-03-10 07:59:06', null, '1.12', null, null);
INSERT INTO `indikator` VALUES ('38', '18', '<p>Biaya operasional pendidikan.</p><p>Tabel 4 LKPS</p>', '2023-03-10 08:16:48', '2023-03-10 08:16:48', null, '0.77', null, null);
INSERT INTO `indikator` VALUES ('39', '18', '<p>Dana penelitian DTPS.</p><p>Tabel 4 LKPS</p>', '2023-03-10 08:17:04', '2023-03-10 08:17:04', null, '0.77', null, null);
INSERT INTO `indikator` VALUES ('40', '18', '<p>Dana pengabdian kepada masyarakat DTPS.</p><p>Tabel 4 LKPS</p>', '2023-03-10 08:17:23', '2023-03-10 08:17:23', null, '0.38', null, null);
INSERT INTO `indikator` VALUES ('41', '18', '<p>Realisasi investasi (SDM, sarana dan prasarana) yang mendukung penyelenggaraan tridharma.</p><p>Catatan: Jika Skor rata-rata butir tentang Profil Dosen, Sarana, dan Prasarana ? 3,5 , maka Skor butir ini = 4.</p>', '2023-03-10 08:17:46', '2023-03-10 08:17:46', null, '0.38', null, null);
INSERT INTO `indikator` VALUES ('42', '18', '<p>Kecukupan dana untuk menjamin pencapaian capaian pembelajaran.<br></p>', '2023-03-10 08:18:09', '2023-03-10 08:18:09', null, '0.77', null, null);
INSERT INTO `indikator` VALUES ('43', '19', '<p>Kecukupan, aksesibilitas dan mutu sarana dan prasarana untuk menjamin pencapaian capaian pembelajaran dan meningkatkan suasana akademik.<br></p>', '2023-03-10 08:21:48', '2023-03-10 08:21:48', null, '3.07', null, null);
INSERT INTO `indikator` VALUES ('44', '20', '<p>A. Keterlibatan pemangku kepentingan dalam proses evaluasi dan pemutakhiran kurikulum.<br></p>', '2023-03-10 08:22:53', '2023-03-10 08:22:53', null, '2.51', '2', null);
INSERT INTO `indikator` VALUES ('45', '20', '<p>B. Kesesuaian capaian pembelajaran dengan profil lulusan dan jenjang KKNI/SKKNI.<br></p>', '2023-03-10 08:23:07', '2023-03-10 08:23:07', null, '2.51', '2', null);
INSERT INTO `indikator` VALUES ('46', '20', '<p>C. Ketepatan struktur kurikulum dalam pembentukan capaian pembelajaran.<br></p>', '2023-03-10 08:23:16', '2023-03-10 08:23:16', null, '2.51', '2', null);
INSERT INTO `indikator` VALUES ('47', '21', '<p>Pemenuhan karakteristik proses pembelajaran, yang terdiri atas sifat: 1) interaktif, 2) holistik, 3) integratif, 4) saintifik, 5) kontekstual, 6) tematik, 7) efektif, 8) kolaboratif, dan 9) berpusat pada mahasiswa.<br></p>', '2023-03-10 08:26:02', '2023-03-10 08:26:02', null, '0.84', null, null);
INSERT INTO `indikator` VALUES ('48', '22', '<p>A. Ketersediaan dan kelengkapan dokumen rencana pembelajaran semester (RPS)&nbsp;<br></p>', '2023-03-10 08:27:07', '2023-03-10 08:27:07', null, '1.67', null, null);
INSERT INTO `indikator` VALUES ('49', '22', '<p>B. Kedalaman dan keluasan RPS sesuai dengan capaian pembelajaran lulusan.<br></p>', '2023-03-10 08:27:18', '2023-03-10 08:27:18', null, '1.67', null, null);
INSERT INTO `indikator` VALUES ('50', '23', '<p>A. Bentuk interaksi antara dosen, mahasiswa dan sumber belajar<br></p>', '2023-03-10 08:29:35', '2023-03-10 08:29:35', null, '1.12', null, null);
INSERT INTO `indikator` VALUES ('51', '23', '<p>B. Pemantauan kesesuaian proses terhadap rencana pembelajaran<br></p>', '2023-03-10 08:29:46', '2023-03-10 08:29:46', null, '1.12', null, null);
INSERT INTO `indikator` VALUES ('52', '23', '<p>C. Proses pembelajaran yang terkait dengan penelitian harus mengacu SN Dikti Penelitian: 1) hasil penelitian: harus memenuhi pengembangan IPTEKS, meningkatkan kesejahteraan masyarakat, dan daya saing bangsa. 2) isi penelitian: memenuhi kedalaman dan keluasan materi penelitian sesuai capaian pembelajaran. 3) proses penelitian: mencakup perencanaan, pelaksanaan, dan pelaporan. 4) penilaian penelitian memenuhi unsur edukatif, obyektif, akuntabel, dan transparan.<br></p>', '2023-03-10 08:29:54', '2023-03-10 08:29:54', null, '1.12', null, null);
INSERT INTO `indikator` VALUES ('53', '23', '<p>D. Proses pembelajaran yang terkait dengan PkM harus mengacu SN Dikti PkM: 1) hasil PkM: harus memenuhi pengembangan IPTEKS, meningkatkan kesejahteraan masyarakat, dan daya saing bangsa. 2) isi PkM: memenuhi kedalaman dan keluasan materi PkM sesuai capaian pembelajaran. 3) proses PkM:&nbsp; mencakup perencanaan, pelaksanaan, dan pelaporan. 4) penilaian PkM memenuhi unsur edukatif, obyektif, akuntabel, dan transparan.<br></p>', '2023-03-10 08:30:28', '2023-03-10 08:30:28', null, '1.12', null, null);
INSERT INTO `indikator` VALUES ('54', '23', '<p>E. Kesesuaian metode pembelajaran dengan capaian pembelajaran. Contoh: RBE (research based education), IBE (industry based education), teaching factory/teaching industry, dll.<br></p>', '2023-03-10 08:30:40', '2023-03-10 08:30:40', null, '1.12', null, null);
INSERT INTO `indikator` VALUES ('55', '23', '<p>Pembelajaran yang dilaksanakan dalam bentuk praktikum, praktik studio, praktik bengkel, atau praktik lapangan.</p><p>Tabel 5.a LKPS</p>', '2023-03-10 08:30:55', '2023-03-10 08:30:55', null, '0.56', null, null);
INSERT INTO `indikator` VALUES ('56', '24', '<p>Monitoring dan evaluasi pelaksanaan proses pembelajaran mencakup karakteristik, perencanaan, pelaksanaan, proses pembelajaran dan beban belajar mahasiswa untuk memperoleh capaian pembelajaran lulusan.<br></p>', '2023-03-13 06:05:38', '2023-03-13 06:05:38', null, '2.51', null, null);
INSERT INTO `indikator` VALUES ('58', '25', '<p>A. Mutu pelaksanaan penilaian pembelajaran (proses dan hasil belajar mahasiswa) untuk mengukur ketercapaian capaian pembelajaran berdasarkan prinsip penilaian yang mencakup: 1) edukatif, 2) otentik, 3) objektif, 4) akuntabel, dan 5) transparan, yang dilakukan secara terintegrasi.<br></p>', '2023-03-13 06:09:07', '2023-03-13 06:09:07', null, '1.67', null, null);
INSERT INTO `indikator` VALUES ('59', '25', '<p>B. Pelaksanaan penilaian terdiri atas teknik dan instrumen penilaian.&nbsp;</p><p>Teknik penilaian terdiri dari: 1) observasi, 2) partisipasi, 3) unjuk kerja, 4) test tertulis, 5) test lisan, dan 6) angket.</p><p>Instrumen penilaian terdiri dari: 1) penilaian proses dalam bentuk rubrik, dan/ atau; 2) penilaian hasil dalam bentuk portofolio, atau 3) karya disain.</p>', '2023-03-13 06:09:38', '2023-03-13 06:09:38', null, '1.67', null, null);
INSERT INTO `indikator` VALUES ('60', '25', '<p>C. Pelaksanaan penilaian memuat unsur-unsur sebagai berikut: 1) mempunyai kontrak rencana penilaian, 2) melaksanakan penilaian sesuai kontrak atau kesepakatan, 3) memberikan umpan balik dan memberi kesempatan untuk mempertanyakan hasil kepada mahasiswa, 4) mempunyai dokumentasi penilaian proses dan hasil belajar mahasiswa, 5) mempunyai prosedur yang mencakup tahap perencanaan, kegiatan pemberian tugas atau soal, observasi kinerja, pengembalian hasil observasi, dan pemberian nilai akhir, 6) pelaporan penilaian berupa kualifikasi keberhasilan mahasiswa dalam menempuh suatu mata kuliah dalam bentuk huruf dan angka, 7) mempunyai bukti-bukti rencana dan telah melakukan proses perbaikan berdasar hasil monev penilaian.<br></p>', '2023-03-13 06:09:50', '2023-03-13 06:09:50', null, '1.67', null, null);
INSERT INTO `indikator` VALUES ('61', '26', '<p>Integrasi kegiatan penelitian dan PkM dalam pembelajaran oleh DTPS dalam 3 tahun terakhir.</p><p>Tabel 5.b LKPS</p>', '2023-03-13 06:20:14', '2023-03-13 06:20:14', null, '1.67', null, null);
INSERT INTO `indikator` VALUES ('62', '27', '<p>Keterlaksanaan dan keberkalaan program dan kegiatan diluar kegiatan pembelajaran terstruktur untuk meningkatkan suasana akademik.</p><p>Contoh: kegiatan himpunan mahasiswa, kuliah umum/studium generale, seminar ilmiah, bedah buku.</p>', '2023-03-13 06:21:30', '2023-03-13 06:21:30', null, '2.51', null, null);
INSERT INTO `indikator` VALUES ('63', '28', '<p>A. Tingkat kepuasan mahasiswa terhadap proses pendidikan.</p><p>Tabel 5.c LKPS</p><p>Aspek yang diukur: 1) Keandalan (reliability): kemampuan dosen, tenaga kependidikan, dan pengelola dalam memberikan pelayanan; 2) Daya tanggap (responsiveness): kemauan dari dosen, tenaga kependidikan, dan pengelola dalam membantu mahasiswa dan memberikan jasa dengan cepat; 3) Kepastian (assurance): kemampuan dosen, tenaga kependidikan, dan pengelola untuk memberi keyakinan kepada mahasiswa bahwa pelayanan yang diberikan telah sesuai dengan ketentuan; 4) Empati (empathy): kesediaan/kepedulian dosen, tenaga kependidikan, dan pengelola untuk memberi perhatian kepada mahasiswa; dan 5) Tangible: penilaian mahasiswa terhadap kecukupan, aksesibitas, kualitas sarana dan prasarana.</p>', '2023-03-13 06:26:18', '2023-03-13 06:26:18', null, '3.35', null, null);
INSERT INTO `indikator` VALUES ('64', '28', '<p>B. Analisis dan tindak lanjut dari hasil pengukuran kepuasan mahasiswa.<br></p>', '2023-03-13 06:26:44', '2023-03-13 06:26:44', null, '3.35', null, null);
INSERT INTO `indikator` VALUES ('65', '29', '<p>Relevansi penelitian pada UPPS mencakup unsur-unsur sebagai berikut:&nbsp;</p><p>1) memiliki peta jalan yang memayungi tema penelitian dosen dan mahasiswa,</p><p>2) dosen dan mahasiswa melaksanakan penelitian sesuai dengan agenda penelitian dosen yang merujuk kepada peta jalan penelitian.&nbsp;</p><p>3) melakukan evaluasi kesesuaian penelitian dosen dan mahasiswa dengan peta jalan, dan&nbsp;</p><p>4) menggunakan hasil evaluasi untuk perbaikan relevansi penelitian dan pengembangan keilmuan program studi.</p>', '2023-03-13 06:33:44', '2023-03-13 06:33:44', null, '1.53', null, null);
INSERT INTO `indikator` VALUES ('66', '30', '<p>Penelitian DTPS yang dalam pelaksanaannya melibatkan mahasiswa program studi dalam 3 tahun terakhir.</p><p>Tabel 6.a LKPS</p>', '2023-03-13 06:36:22', '2023-03-13 06:36:22', null, '3.07', null, null);
INSERT INTO `indikator` VALUES ('67', '31', '<p>Relevansi PkM pada UPPS mencakup unsur-unsur sebagai berikut:&nbsp;</p><p>1) memiliki peta jalan yang memayungi tema PkM dosen dan mahasiswa serta hilirisasi/penerapan keilmuan program studi,&nbsp;</p><p>2) dosen dan mahasiswa melaksanakan PkM sesuai dengan peta jalan PkM.&nbsp;</p><p>3) melakukan evaluasi kesesuaian PkM dosen dan mahasiswa dengan peta jalan, dan&nbsp;</p><p>4) menggunakan hasil evaluasi untuk perbaikan relevansi PkM dan pengembangan keilmuan program studi.</p>', '2023-03-13 06:38:16', '2023-03-13 06:38:16', null, '0.51', null, null);
INSERT INTO `indikator` VALUES ('68', '32', '<p>PkM DTPS yang dalam pelaksanaannya melibatkan mahasiswa program studi dalam 3 tahun terakhir.</p><p>Tabel 7 LKPS</p>', '2023-03-13 06:40:24', '2023-03-13 06:40:24', null, '1.02', null, null);
INSERT INTO `indikator` VALUES ('69', '33', '<p>Analisis pemenuhan capaian pembelajaran lulusan (CPL) yang diukur dengan metoda yang sahih dan relevan, mencakup aspek:</p><p>1) keserbacakupan,&nbsp;</p><p>2) kedalaman, dan&nbsp;</p><p>3) kebermanfaatan analisis yang ditunjukkan dengan peningkatan CPL dari waktu ke waktu dalam 3 tahun terakhir.</p>', '2023-03-13 06:41:58', '2023-03-13 06:41:58', null, '1.92', null, null);
INSERT INTO `indikator` VALUES ('70', '33', '<p>IPK lulusan.</p><p>Tabel 8.a LKPS</p>', '2023-03-13 06:50:34', '2023-03-13 06:50:34', null, '1.92', null, null);
INSERT INTO `indikator` VALUES ('71', '33', '<p>Prestasi mahasiswa di bidang akademik dalam 3 tahun terakhir.</p><p>Tabel 8.b.1) LKPS</p>', '2023-03-13 06:51:11', '2023-03-13 06:51:11', null, '2.88', null, null);
INSERT INTO `indikator` VALUES ('72', '33', '<p>Prestasi mahasiswa di bidang nonakademik dalam 3 tahun terakhir.</p><p>Tabel 8.b.2) LKPS</p>', '2023-03-13 06:51:45', '2023-03-13 06:51:45', null, '0.96', null, null);
INSERT INTO `indikator` VALUES ('73', '33', '<p>Masa studi.</p><p>Tabel 8.c LKPS</p>', '2023-03-13 06:52:08', '2023-03-13 06:52:08', null, '1.92', null, null);
INSERT INTO `indikator` VALUES ('74', '33', '<p>Kelulusan tepat waktu.</p><p>Tabel 8.c LKPS</p>', '2023-03-13 06:52:33', '2023-03-13 06:52:33', null, '1.92', null, null);
INSERT INTO `indikator` VALUES ('75', '33', '<p>Keberhasilan studi.</p><p>Tabel 8.c LKPS</p>', '2023-03-13 06:52:59', '2023-03-13 06:52:59', null, '1.92', null, null);
INSERT INTO `indikator` VALUES ('76', '33', '<p>Pelaksanaan tracer study yang mencakup 5 aspek sebagai berikut:&nbsp;</p><p>1) pelaksanaan tracer study terkoordinasi di tingkat PT,</p><p>2) kegiatan tracer study dilakukan secara reguler setiap tahun dan terdokumentasi,</p><p>3) isi kuesioner mencakup seluruh pertanyaan inti tracer study DIKTI.</p><p>4) ditargetkan pada seluruh populasi (lulusan TS-4 s.d. TS-2),</p><p>5) hasilnya disosialisasikan dan digunakan untuk pengembangan kurikulum dan pembelajaran.&nbsp;</p>', '2023-03-13 06:53:32', '2023-03-13 06:53:32', null, '2.88', null, null);
INSERT INTO `indikator` VALUES ('77', '33', '<p>Waktu tunggu lulusan untuk mendapatkan pekerjaan pertama dalam 3 tahun, mulai TS-4 s.d. TS-2.</p><p>Tabel 8.d.1) LKPS</p>', '2023-03-29 03:47:52', '2023-03-29 03:47:52', null, '2.88', '3.5', '3');
INSERT INTO `indikator` VALUES ('78', '33', '<p>Kesesuaian bidang kerja.&nbsp;</p><p>Tabel 8.d.2) LKPS</p>', '2023-03-29 03:47:53', '2023-03-29 03:47:53', null, '1.92', '3.5', '3');
INSERT INTO `indikator` VALUES ('79', '33', '<p>Tingkat dan ukuran tempat kerja lulusan.</p><p>Tabel 8.e.1) LKPS</p>', '2023-03-13 07:06:55', '2023-03-13 07:06:55', null, '1.92', null, null);
INSERT INTO `indikator` VALUES ('80', '33', '<p>Tingkat kepuasan pengguna lulusan.</p><p>Tabel 8.e.2) LKPS</p>', '2023-03-13 07:07:26', '2023-03-13 07:07:26', null, '3.83', null, null);
INSERT INTO `indikator` VALUES ('81', '34', '<p>Publikasi ilmiah mahasiswa, yang dihasilkan secara mandiri atau bersama DTPS, dengan judul yang relevan dengan bidang program studi dalam 3 tahun terakhir.</p><p>Tabel 8.f.1) LKPS</p>', '2023-03-13 08:11:58', '2023-03-13 08:11:58', null, '2.88', null, null);
INSERT INTO `indikator` VALUES ('82', '34', '<p>Luaran penelitian dan PkM yang dihasilkan mahasiswa, baik secara mandiri atau bersama DTPS dalam 3 tahun terakhir.</p><p>Tabel 8.f.4) LKPS</p>', '2023-03-13 04:12:20', '2023-03-13 08:12:20', null, '0.96', null, null);
INSERT INTO `indikator` VALUES ('83', '35', '<p>Keserbacakupan (kelengkapan, keluasan, dan kedalaman), ketepatan, ketajaman, dan kesesuaian analisis capaian kinerja serta konsistensi dengan setiap kriteria.<br></p>', '2023-03-13 08:20:40', '2023-03-13 08:20:40', null, '1.50', null, null);
INSERT INTO `indikator` VALUES ('84', '36', '<p>Ketepatan analisis SWOT atau analisis yang relevan di dalam mengembangkan strategi.<br></p>', '2023-03-13 08:22:39', '2023-03-13 08:22:39', null, '2', null, null);
INSERT INTO `indikator` VALUES ('85', '37', '<p>Ketepatan di dalam menetapkan prioritas program pengembangan.<br></p>', '2023-03-13 08:24:21', '2023-03-13 08:24:21', null, '1.50', null, null);
INSERT INTO `indikator` VALUES ('86', '38', '<p>UPPS memiliki kebijakan, ketersediaan sumberdaya, kemampuan melaksanakan, dan kerealistikan program.<br></p>', '2023-03-13 08:26:35', '2023-03-13 08:26:35', null, '1', null, null);
INSERT INTO `indikator` VALUES ('87', '40', '<p>Kondisi Eksternal</p><p>Konsistensi dengan hasil analisis SWOT dan/atau analisis lain serta rencana pengembangan ke depan.</p>', '2023-04-06 09:14:24', '2023-04-06 09:14:24', null, '1.00', null, null);
INSERT INTO `indikator` VALUES ('89', '43', '<p>B. Profil Unit Pengelola Program Studi</p><p>Keserbacakupan informasi dalam profil dan konsistensi antara profil dengan data dan informasi yang disampaikan pada masing-masing kriteria, serta menunjukkan iklim yang kondusif untuk pengembangan dan reputasi sebagai rujukan di bidang keilmuannya.</p>', '2023-04-06 09:20:56', '2023-04-06 09:20:56', null, '1', null, null);
INSERT INTO `indikator` VALUES ('90', '44', '<p>Kesesuaian Visi, Misi, Tujuan dan Strategi (VMTS) Unit Pengelola Program Studi (UPPS) terhadap VMTS Perguruan Tinggi (PT) dan visi keilmuan Program Studi (PS) yang dikelolanya.<br></p>', '2023-04-06 09:23:52', '2023-04-06 09:23:52', null, '0.51', null, null);
INSERT INTO `indikator` VALUES ('91', '44', '<p>Mekanisme dan keterlibatan pemangku kepentingan dalam penyusunan VMTS UPPS.<br></p>', '2023-04-06 09:25:35', '2023-04-06 09:25:35', null, '1.02', null, null);
INSERT INTO `indikator` VALUES ('92', '44', '<p>Strategi pencapaian tujuan disusun berdasarkan analisis yang sistematis, serta pada pelaksanaannya dilakukan pemantauan dan evaluasi yang ditindaklanjuti.&nbsp;<br></p>', '2023-04-06 09:25:55', '2023-04-06 09:25:55', null, '1.53', null, null);
INSERT INTO `indikator` VALUES ('93', '44', '<p>Pemahaman visi, misi,tujuan, dan sasaran Program Studi oleh seluruh pemangku kepentingan internal (internal stakeholders): sivitas akademika (dosen dan mahasiswa) dan tenaga kependidikan<br></p>', '2023-04-06 09:35:12', '2023-04-06 09:35:12', null, '1.00', null, null);
INSERT INTO `indikator` VALUES ('94', '45', '<p>A. Kelengkapan struktur organisasi dan keefektifan penyelenggaraan organisasi.<br></p>', '2023-04-06 09:42:20', '2023-04-06 09:42:20', null, '0.34', null, null);
INSERT INTO `indikator` VALUES ('95', '45', '<p>B.<span style=\"font-size: 1rem;\">Perwujudan good governance dan pemenuhan lima pilar sistem tata pamong, yang mencakup: 1) Kredibel, 2) Transparan, 3) Akuntabel, 4) Bertanggung jawab, 5) Adil.</span></p>', '2023-04-06 05:44:53', '2023-04-06 09:44:55', null, '0.34', null, null);
INSERT INTO `indikator` VALUES ('96', '47', '<p>A. Komitmen pimpinan UPPS.<br></p>', '2023-04-06 09:47:59', '2023-04-06 09:47:59', null, '0.34', null, null);
INSERT INTO `indikator` VALUES ('97', '47', '<p>B. Kapabilitas pimpinan UPPS, mencakup aspek: 1) perencanaan, 2) pengorganisasian, 3) penempatan personel, 4) pelaksanaan, 5) pengendalian dan pengawasan, dan 6) pelaporan yang menjadi dasar tindak lanjut.&nbsp;<br></p>', '2023-04-06 09:48:13', '2023-04-06 09:48:13', null, '0.34', null, null);
INSERT INTO `indikator` VALUES ('98', '48', '<p>Mutu, manfaat, kepuasan dan keberlanjutan kerjasama pendidikan, penelitian dan PkM yang relevan dengan program studi. UPPS memiliki bukti yang sahih terkait kerjasama yang ada telah memenuhi 3 aspek berikut: 1) memberikan manfaat bagi program studi dalam pemenuhan proses pembelajaran, penelitian, PkM. 2) memberikan peningkatan kinerja tridharma dan fasilitas pendukung program studi. 3) memberikan kepuasan kepada mitra industri dan mitra kerjasama lainnya, serta menjamin keberlanjutan kerjasama dan hasilnya.<br></p>', '2023-04-06 09:55:12', '2023-04-06 09:55:12', null, '0.68', null, null);
INSERT INTO `indikator` VALUES ('99', '48', '<p>A. Kerjasama perguruan tinggi di bidang pendidikan, penelitian dan PkM dalam 3 tahun terakhir.</p><p>Tabel 1 LKPS</p>', '2023-04-06 09:55:55', '2023-04-06 09:55:55', null, '0.34', null, null);
INSERT INTO `indikator` VALUES ('100', '48', '<p>B. Kerjasama tingkat internasional, nasional, wilayah/lokal yang relevan dengan program studi dan dikelola oleh UPPS dalam 3 tahun terakhir.</p><p>Tabel 1 LKPS</p><p><br></p><p>A=NI/a; B=NN/b; C=NW/c.</p><p>Faktor: a = 2 , b = 6 , c = 8&nbsp;</p>', '2023-04-06 09:56:30', '2023-04-06 09:56:30', null, '0.34', null, null);
INSERT INTO `indikator` VALUES ('101', '49', '<p>Pelampauan SN DIKTI yang ditetapkan dengan indikator kinerja tambahan yang berlaku di UPPS berdasarkan standar pendidikan tinggi yang ditetapkan perguruan tinggi pada tiap kriteria.<br></p>', '2023-04-06 10:23:51', '2023-04-06 10:23:51', null, '0.68', null, null);
INSERT INTO `indikator` VALUES ('102', '50', '<p>Analisis keberhasilan dan/atau ketidakberhasilan pencapaian kinerja yang telah ditetapkan institusi yang memenuhi 2 aspek sebagai berikut:&nbsp;</p><p>1) capaian kinerja harus diukur dengan metoda yang tepat, dan hasilnya dianalisis serta dievaluasi, dan</p><p>2) analisis terhadap capaian kinerja mencakup identifikasi akar masalah, faktor pendukung keberhasilan dan faktor penghambat ketercapaian standar, dan deskripsi singkat tindak lanjut yang akan dilakukan.</p>', '2023-04-06 10:26:49', '2023-04-06 10:26:49', null, '1.02', null, null);
INSERT INTO `indikator` VALUES ('106', '51', '<p>Metoda rekrutmen dan keketatan seleksi.</p><p>Tabel 2.a 1) LKPS</p>', '2023-04-09 15:48:39', '2023-04-09 15:48:39', null, '4.60', null, null);
INSERT INTO `indikator` VALUES ('107', '52', '<p>A. Peningkatan animo calon mahasiswa.</p><p>Tabel 2.a 1) LKPS</p>', '2023-04-09 15:59:17', '2023-04-09 15:59:17', null, '3.067', null, null);
INSERT INTO `indikator` VALUES ('108', '52', '<p>B. Mahasiswa asing.</p><p>Tabel 2.b LKPS</p>', '2023-04-09 15:59:37', '2023-04-09 15:59:37', null, '3.067', null, null);
INSERT INTO `indikator` VALUES ('109', '53', '<p>A. Ketersediaan layanan kemahasiswaan di bidang:&nbsp;</p><p>1) penalaran, minat dan bakat,</p><p>2) kesejahteraan (bimbingan dan konseling, layanan beasiswa, dan layanan kesehatan), dan</p><p>3) bimbingan karir dan kewirausahaan.</p>', '2023-04-09 16:29:29', '2023-04-09 16:29:29', null, '1.53', null, null);
INSERT INTO `indikator` VALUES ('110', '53', '<p>B. Akses dan mutu layanan kemahasiswaan.<br></p>', '2023-04-09 16:30:11', '2023-04-09 16:30:11', null, '1.53', null, null);
INSERT INTO `indikator` VALUES ('111', '54', '<p>Kecukupan jumlah DTPS.</p><p>Tabel 3.a.1) LKPS</p><p>Tabel 3. a. 4) LKPS</p>', '2023-04-09 16:37:36', '2023-04-09 16:37:36', null, '0.74', '2', null);
INSERT INTO `indikator` VALUES ('112', '54', '<div>Kualifikasi akademik DTPS.</div><div>Tabel 3.a.1) LKPS</div>', '2023-04-17 23:07:18', '2023-04-17 23:07:18', null, '0.99', '3.5', '3');
INSERT INTO `indikator` VALUES ('113', '54', '<p>Jabatan akademik DTPS.</p><p>Tabel 3.a.1) LKPS</p>', '2023-04-17 23:07:20', '2023-04-17 23:07:20', null, '0.50', '3.5', '3');
INSERT INTO `indikator` VALUES ('114', '54', '<p>Rasio jumlah mahasiswa program studi terhadap jumlah DTPS.</p><p>Tabel 2.a LKPS</p><p>Tabel 3.a.1) LKPS</p>', '2023-04-17 23:53:42', '2023-04-17 23:53:42', null, '0.50', '', null);
INSERT INTO `indikator` VALUES ('115', '54', '<p>Penugasan DTPS sebagai pembimbing utama tugas akhir mahasiswa.</p><p>Tabel 3.a.2) LKPS&nbsp;</p>', '2023-04-09 16:45:04', '2023-04-09 16:45:04', null, '0.99', null, null);
INSERT INTO `indikator` VALUES ('116', '54', '<p>Ekuivalensi Waktu Mengajar Penuh DTPS.</p><p>Tabel 3.a.3) LKPS</p>', '2023-04-09 16:45:21', '2023-04-09 16:45:21', null, '0.25', null, null);
INSERT INTO `indikator` VALUES ('117', '54', '<p>Dosen tidak tetap.</p><p>Tabel 3.a.4) LKPS</p>', '2023-04-09 16:45:39', '2023-04-09 16:45:39', null, '0.50', null, null);
INSERT INTO `indikator` VALUES ('118', '55', '<p>Pengakuan/rekognisi atas kepakaran/prestasi/kinerja DTPS.</p><p>Pengakuan/rekognisi atas kepakaran/prestasi/kinerja DTPS dapat berupa:</p><p>a) menjadi visiting lecturer atau visiting scholar di program studi/perguruan tinggi terakreditasi A/Unggul atau program studi/perguruan tinggi internasional bereputasi.</p><p>b) menjadi keynote speaker/invited speaker pada pertemuan ilmiah tingkat nasional/ internasional.</p><p>c) menjadi editor atau mitra bestari pada jurnal nasional terakreditasi/jurnal internasional bereputasi di bidang yang sesuai dengan bidang program studi.</p><p>d) menjadi staf ahli/narasumber di lembaga tingkat wilayah/nasional/internasional pada bidang yang sesuai dengan bidang program studi (untuk pengusul dari program studi pada program Sarjana/Magister/Doktor), atau menjadi tenaga ahli/konsultan di lembaga/industri tingkat wilayah/nasional/ internasional pada bidang yang sesuai dengan bidang program studi (untuk pengusul dari program studi pada program Diploma Tiga/Sarjana Terapan/Magister Terapan/Doktor Terapan).</p><p>e) mendapat penghargaan atas prestasi dan kinerja di tingkat wilayah/nasional/internasional.</p><p>Tabel 3.b.1) LKPS</p>', '2023-04-09 17:02:11', '2023-04-09 17:02:11', null, '0.81', null, null);
INSERT INTO `indikator` VALUES ('119', '55', '<p>Kegiatan penelitian DTPS yang relevan dengan bidang program studi dalam 3 tahun terakhir.</p><p>Tabel 3.b.2) LKPS</p>', '2023-04-09 17:02:39', '2023-04-09 17:02:39', null, '0.81', null, null);
INSERT INTO `indikator` VALUES ('120', '55', '<p>Kegiatan PkM DTPS yang relevan dengan bidang program studi dalam 3 tahun terakhir.</p><p>Tabel 3.b.3) LKPS</p>', '2023-04-09 17:03:02', '2023-04-09 17:03:02', null, '0.41', null, null);
INSERT INTO `indikator` VALUES ('121', '55', '<p>Publikasi ilmiah dengan tema yang relevan dengan bidang program studi yang dihasilkan DTPS dalam 3 tahun terakhir.</p><p>Tabel 3.b.4) LKPS</p>', '2023-04-09 17:03:20', '2023-04-09 17:03:20', null, '0.81', null, null);
INSERT INTO `indikator` VALUES ('122', '55', '<p>Artikel karya ilmiah DTPS yang disitasi dalam 3 tahun terakhir.</p><p>Tabel 3.b.5) LKPS</p>', '2023-04-09 17:03:36', '2023-04-09 17:03:36', null, '0.81', null, null);
INSERT INTO `indikator` VALUES ('123', '55', '<p>Luaran penelitian dan PkM yang dihasilkan DTPS dalam 3 tahun terakhir.</p><p>Tabel 3.b.7) LKPS</p>', '2023-04-09 17:05:19', '2023-04-09 17:05:19', null, '0.81', null, null);
INSERT INTO `indikator` VALUES ('124', '56', '<p>Upaya pengembangan dosen.</p><p>Catatan: Jika Skor rata-rata butir Profil Dosen ? 3,5 , maka Skor = 4.</p>', '2023-04-09 17:38:45', '2023-04-09 17:38:45', null, '2.23', null, null);
INSERT INTO `indikator` VALUES ('125', '57', '<p>A. Kualifikasi dan kecukupan tenaga kependidikan berdasarkan jenis pekerjaannya (administrasi, pustakawan, teknisi, dll.)</p><p>Catatan: Penilaian kecukupan tidak hanya ditentukan oleh jumlah tenaga kependidikan, namun keberadaan dan pemanfaatan teknologi informasi dan komputer dalam proses administrasi dapat dijadikan pertimbangan untuk menilai efektifitas pekerjaan dan kebutuhan akan tenaga kependidikan.</p><p><br></p><p>Tabel 3.c LKPS</p>', '2023-04-09 17:41:05', '2023-04-09 17:41:05', null, '1.12', null, null);
INSERT INTO `indikator` VALUES ('126', '57', '<p>B. Kualifikasi dan kecukupan laboran untuk mendukung proses pembelajaran sesuai dengan kebutuhan program studi.</p><p>Tabel 3.c LKPS</p>', '2023-04-09 17:41:26', '2023-04-09 17:41:26', null, '1.12', null, null);
INSERT INTO `indikator` VALUES ('127', '58', '<p>Biaya operasional pendidikan.</p><p>Tabel 4 LKPS</p>', '2023-04-09 17:44:18', '2023-04-09 17:44:18', null, '0.77', null, null);
INSERT INTO `indikator` VALUES ('128', '58', '<p>Dana penelitian DTPS.</p><p>Tabel 4 LKPS</p>', '2023-04-09 17:44:33', '2023-04-09 17:44:33', null, '0.77', null, null);
INSERT INTO `indikator` VALUES ('129', '58', '<p>Dana pengabdian kepada masyarakat DTPS.</p><p>Tabel 4 LKPS</p>', '2023-04-09 17:44:50', '2023-04-09 17:44:50', null, '0.38', null, null);
INSERT INTO `indikator` VALUES ('130', '58', '<p>Realisasi investasi (SDM, sarana dan prasarana) yang mendukung penyelenggaraan tridharma.<br></p>', '2023-04-09 17:45:04', '2023-04-09 17:45:04', null, '0.38', null, null);
INSERT INTO `indikator` VALUES ('131', '58', '<p>Kecukupan dana untuk menjamin pencapaian capaian pembelajaran.<br></p>', '2023-04-09 17:45:16', '2023-04-09 17:45:16', null, '0.77', null, null);
INSERT INTO `indikator` VALUES ('132', '59', '<p>Kecukupan, aksesibilitas dan mutu sarana dan prasarana untuk menjamin pencapaian capaian pembelajaran dan meningkatkan suasana akademik.</p><p>Tabel 4.b LKPS</p><p>Tabel 4.c LKPS</p>', '2023-04-09 17:50:09', '2023-04-09 17:50:09', null, '3.07', null, null);
INSERT INTO `indikator` VALUES ('133', '60', '<p>A. Keterlibatan pemangku kepentingan dalam proses evaluasi dan pemutakhiran kurikulum.<br></p>', '2023-04-17 23:06:47', '2023-04-17 23:06:47', null, '2.51', '2', null);
INSERT INTO `indikator` VALUES ('134', '60', '<p>B. Kesesuaian capaian pembelajaran dengan profil lulusan dan jenjang KKNI/SKKNI.<br></p>', '2023-04-17 23:06:50', '2023-04-17 23:06:50', null, '2.51', '2', null);
INSERT INTO `indikator` VALUES ('135', '60', '<p>C. Ketepatan struktur kurikulum dalam pembentukan capaian pembelajaran.<br></p>', '2023-04-17 23:06:52', '2023-04-17 23:06:52', null, '2.51', '2', null);
INSERT INTO `indikator` VALUES ('136', '61', '<p>Pemenuhan karakteristik proses pembelajaran, yang terdiri atas sifat: 1) interaktif, 2) holistik, 3) integratif, 4) saintifik, 5) kontekstual, 6) tematik, 7) efektif, 8) kolaboratif, dan 9) berpusat pada mahasiswa.<br></p>', '2023-04-09 17:56:42', '2023-04-09 17:56:42', null, '0.84', null, null);
INSERT INTO `indikator` VALUES ('137', '62', '<p>A. Ketersediaan dan kelengkapan dokumen rencana pembelajaran semester (RPS)&nbsp;<br></p>', '2023-04-09 17:58:34', '2023-04-09 17:58:34', null, '1.67', null, null);
INSERT INTO `indikator` VALUES ('138', '62', '<p>B. Kedalaman dan keluasan RPS sesuai dengan capaian pembelajaran lulusan.<br></p>', '2023-04-09 17:58:46', '2023-04-09 17:58:46', null, '1.67', null, null);
INSERT INTO `indikator` VALUES ('139', '63', '<p>A. Bentuk interaksi antara dosen, mahasiswa dan sumber belajar<br></p>', '2023-04-09 18:02:21', '2023-04-09 18:02:21', null, '1.12', null, null);
INSERT INTO `indikator` VALUES ('140', '63', '<p>B. Pemantauan kesesuaian proses terhadap rencana pembelajaran<br></p>', '2023-04-09 18:02:48', '2023-04-09 18:02:48', null, '1.12', null, null);
INSERT INTO `indikator` VALUES ('141', '63', '<p>C. Proses pembelajaran yang terkait dengan penelitian harus mengacu SN Dikti Penelitian: 1) hasil penelitian: harus memenuhi pengembangan IPTEKS, meningkatkan kesejahteraan masyarakat, dan daya saing bangsa. 2) isi penelitian: memenuhi kedalaman dan keluasan materi penelitian sesuai capaian pembelajaran. 3) proses penelitian: mencakup perencanaan, pelaksanaan, dan pelaporan. 4) penilaian penelitian memenuhi unsur edukatif, obyektif, akuntabel, dan transparan.<br></p>', '2023-04-09 18:03:01', '2023-04-09 18:03:01', null, '1.12', null, null);
INSERT INTO `indikator` VALUES ('142', '63', '<p>D. Proses pembelajaran yang terkait dengan PkM harus mengacu SN Dikti PkM: 1) hasil PkM: harus memenuhi pengembangan IPTEKS, meningkatkan kesejahteraan masyarakat, dan daya saing bangsa. 2) isi PkM: memenuhi kedalaman dan keluasan materi PkM sesuai capaian pembelajaran. 3) proses PkM:&nbsp; mencakup perencanaan, pelaksanaan, dan pelaporan. 4) penilaian PkM memenuhi unsur edukatif, obyektif, akuntabel, dan transparan.<br></p>', '2023-04-09 18:03:10', '2023-04-09 18:03:10', null, '1.12', null, null);
INSERT INTO `indikator` VALUES ('143', '63', '<p>E. Kesesuaian metode pembelajaran dengan capaian pembelajaran. Contoh: RBE (research based education), IBE (industry based education), teaching factory/teaching industry, dll.<br></p>', '2023-04-09 18:03:21', '2023-04-09 18:03:21', null, '1.12', null, null);
INSERT INTO `indikator` VALUES ('144', '63', '<p>Pembelajaran yang dilaksanakan dalam bentuk praktikum, praktik studio, praktik bengkel, atau praktik lapangan.</p><p>Tabel 5.a 1) LKPS</p>', '2023-04-09 18:09:09', '2023-04-09 18:09:09', null, '0.56', null, null);
INSERT INTO `indikator` VALUES ('145', '64', 'Monitoring dan evaluasi pelaksanaan proses pembelajaran mencakup karakteristik, perencanaan, pelaksanaan, proses pembelajaran dan beban belajar mahasiswa untuk memperoleh capaian pembelajaran lulusan.', '2023-04-09 18:10:35', '2023-04-09 18:10:35', null, '2.51', null, null);
INSERT INTO `indikator` VALUES ('146', '65', '<p>A. Mutu pelaksanaan penilaian pembelajaran (proses dan hasil belajar mahasiswa) untuk mengukur ketercapaian capaian pembelajaran berdasarkan prinsip penilaian yang mencakup: 1) edukatif, 2) otentik, 3) objektif, 4) akuntabel, dan 5) transparan, yang dilakukan secara terintegrasi.<br></p>', '2023-04-09 18:12:54', '2023-04-09 18:12:54', null, '1.67', null, null);
INSERT INTO `indikator` VALUES ('147', '65', '<p>B. Pelaksanaan penilaian terdiri atas teknik dan instrumen penilaian.&nbsp;</p><p>Teknik penilaian terdiri dari: 1) observasi, 2) partisipasi, 3) unjuk kerja, 4) test tertulis, 5) test lisan, dan 6) angket.</p><p>Instrumen penilaian terdiri dari: 1) penilaian proses dalam bentuk rubrik, dan/ atau; 2) penilaian hasil dalam bentuk portofolio, atau 3) karya disain.</p>', '2023-04-09 18:13:05', '2023-04-09 18:13:05', null, '1.67', null, null);
INSERT INTO `indikator` VALUES ('148', '65', '<p>C. Pelaksanaan penilaian memuat unsur-unsur sebagai berikut: 1) mempunyai kontrak rencana penilaian, 2) melaksanakan penilaian sesuai kontrak atau kesepakatan, 3) memberikan umpan balik dan memberi kesempatan untuk mempertanyakan hasil kepada mahasiswa, 4) mempunyai dokumentasi penilaian proses dan hasil belajar mahasiswa, 5) mempunyai prosedur yang mencakup tahap perencanaan, kegiatan pemberian tugas atau soal, observasi kinerja, pengembalian hasil observasi, dan pemberian nilai akhir, 6) pelaporan penilaian berupa kualifikasi keberhasilan mahasiswa dalam menempuh suatu mata kuliah dalam bentuk huruf dan angka, 7) mempunyai bukti-bukti rencana dan telah melakukan proses perbaikan berdasar hasil monev penilaian.<br></p>', '2023-04-09 18:13:27', '2023-04-09 18:13:27', null, '1.67', null, null);
INSERT INTO `indikator` VALUES ('149', '66', '<p>Ketersediaan mata kuliah basic sciences dan matematika</p><p>Tabel 5.a.3) LKPS</p>', '2023-04-09 18:23:43', '2023-04-09 18:23:43', null, '0', null, null);
INSERT INTO `indikator` VALUES ('150', '67', '<p>Terselenggaranya capstone design yang memiliki:</p><p>1.Panduan pelaksanaan</p><p>2.Memiliki rumusan capaian pembelajaran mata kuliah</p><p>3.Menggunakan standar-standar keteknikan dan batasan-batasan realistis berdasarkan pada pengetahuan dan ketrampilan yang telah diperoleh di perkuliahan sebelumnya.</p><p>4. Mempunyai bukti sahih pelaksanaan&nbsp;</p><p>Tabel 5.a.4) LKPS</p>', '2023-04-10 05:36:19', '2023-04-10 05:36:19', null, '0', null, null);
INSERT INTO `indikator` VALUES ('151', '68', '<p>Pelaksanaan dan jumlah SKS MBKM yang disediakan oleh UPPS dan PS</p><p>Tabel 5.b.1); 5.b.2);</p><p>5.b.3) LKPS</p>', '2023-04-10 05:38:16', '2023-04-10 05:38:16', null, '0', null, null);
INSERT INTO `indikator` VALUES ('152', '69', '<p>Integrasi kegiatan penelitian dan PkM dalam pembelajaran oleh DTPS dalam 3 tahun terakhir.</p><p>Tabel 5.b LKPS</p>', '2023-04-10 05:40:52', '2023-04-10 05:40:52', null, '1.67', null, null);
INSERT INTO `indikator` VALUES ('153', '70', '<p>Keterlaksanaan dan keberkalaan program dan kegiatan diluar kegiatan pembelajaran terstruktur untuk meningkatkan suasana akademik.</p><p>Contoh: kegiatan himpunan mahasiswa, kuliah umum/studium generale, seminar ilmiah, bedah buku.</p>', '2023-04-10 05:42:53', '2023-04-10 05:42:53', null, '2.51', null, null);
INSERT INTO `indikator` VALUES ('154', '71', '<p>A. Tingkat kepuasan mahasiswa terhadap proses pendidikan.</p><p>Tabel 5.d LKPS</p><p>Tingkat kepuasan pengguna pada aspek:</p><p>TKM1: Reliability; TKM2: Responsiveness; TKM3: Assurance; TKM4: Empathy; TKM5: Tangible.</p><p><br></p><p>Tingkat kepuasan mahasiswa pada aspek ke-i dihitung dengan rumus sebagai berikut:</p><p>TKMi = (4 x ai) + (3 x bi) + (2 x ci) + di i = 1, 2, ..., 7</p><p>dimana : ai = persentase “Sangat Baik”; bi = persentase “Baik”; ci = persentase “Cukup”; di = persentase “Kurang”.</p><p><br></p><p>TKM = TKMi / 5</p>', '2023-04-10 01:54:59', '2023-04-10 05:55:03', null, '3.35', null, null);
INSERT INTO `indikator` VALUES ('155', '71', '<p>B. Analisis dan tindak lanjut dari hasil pengukuran kepuasan mahasiswa.<br></p>', '2023-04-10 05:45:13', '2023-04-10 05:45:13', null, '3.35', null, null);
INSERT INTO `indikator` VALUES ('156', '72', '<p>Relevansi penelitian pada UPPS mencakup unsur-unsur sebagai berikut:&nbsp;</p><p>1) memiliki peta jalan yang memayungi tema penelitian dosen dan mahasiswa,</p><p>2) dosen dan mahasiswa melaksanakan penelitian sesuai dengan agenda penelitian dosen yang merujuk kepada peta jalan penelitian.&nbsp;</p><p>3) melakukan evaluasi kesesuaian penelitian dosen dan mahasiswa dengan peta jalan, dan&nbsp;</p><p>4) menggunakan hasil evaluasi untuk perbaikan relevansi penelitian dan pengembangan keilmuan program studi.</p>', '2023-04-10 06:08:35', '2023-04-10 06:08:35', null, '1.53', null, null);
INSERT INTO `indikator` VALUES ('157', '73', '<p>Penelitian DTPS yang dalam pelaksanaannya melibatkan mahasiswa program studi dalam 3 tahun terakhir.</p><p>Tabel 6.a LKPS</p>', '2023-04-10 06:11:08', '2023-04-10 06:11:08', null, '3.07', null, null);
INSERT INTO `indikator` VALUES ('158', '74', '<p>Relevansi PkM pada UPPS mencakup unsur-unsur sebagai berikut:&nbsp;</p><p>1) memiliki peta jalan yang memayungi tema PkM dosen dan mahasiswa serta hilirisasi/penerapan keilmuan program studi,&nbsp;</p><p>2) dosen dan mahasiswa melaksanakan PkM sesuai dengan peta jalan PkM.&nbsp;</p><p>3) melakukan evaluasi kesesuaian PkM dosen dan mahasiswa dengan peta jalan, dan&nbsp;</p><p>4) menggunakan hasil evaluasi untuk perbaikan relevansi PkM dan pengembangan keilmuan program studi.</p>', '2023-04-10 06:12:41', '2023-04-10 06:12:41', null, '0.51', null, null);
INSERT INTO `indikator` VALUES ('159', '75', '<p>PkM DTPS yang dalam pelaksanaannya melibatkan mahasiswa program studi dalam 3 tahun terakhir.</p><p>Tabel 7 LKPS</p>', '2023-04-10 06:14:35', '2023-04-10 06:14:35', null, '1.02', null, null);
INSERT INTO `indikator` VALUES ('160', '76', '<p>Analisis pemenuhan capaian pembelajaran lulusan (CPL) yang diukur dengan metoda yang sahih dan relevan, mencakup aspek:</p><p>1) keserbacakupan,&nbsp;</p><p>2) kedalaman, dan&nbsp;</p><p>3) kebermanfaatan analisis yang ditunjukkan dengan peningkatan CPL dari waktu ke waktu dalam 3 tahun terakhir.</p>', '2023-04-10 06:16:05', '2023-04-10 06:16:05', null, '1.92', null, null);
INSERT INTO `indikator` VALUES ('161', '76', '<p>IPK lulusan.</p><p>RIPK = Rata-rata IPK lulusan dalam 3 tahun terakhir.</p><p>Tabel 8.a LKPS</p>', '2023-04-10 06:17:50', '2023-04-10 06:17:50', null, '1.92', null, null);
INSERT INTO `indikator` VALUES ('162', '76', '<p>Prestasi mahasiswa di bidang akademik dalam 3 tahun terakhir.</p><p>Tabel 8.b.1) LKPS</p>', '2023-04-10 06:18:14', '2023-04-10 06:18:14', null, '2.88', null, null);
INSERT INTO `indikator` VALUES ('163', '76', '<p>Prestasi mahasiswa di bidang nonakademik dalam 3 tahun terakhir.</p><p>Tabel 8.b.2) LKPS</p>', '2023-04-10 06:18:37', '2023-04-10 06:18:37', null, '0.96', null, null);
INSERT INTO `indikator` VALUES ('164', '76', '<p>Masa studi.</p><p>Tabel 8.c LKPS</p>', '2023-04-10 06:18:57', '2023-04-10 06:18:57', null, '1.92', null, null);
INSERT INTO `indikator` VALUES ('165', '76', '<p>Persentase kelulusan tepat waktu (PTW)</p><p>Tabel 8.c LKPS</p>', '2023-04-10 06:19:14', '2023-04-10 06:19:14', null, '1.92', null, null);
INSERT INTO `indikator` VALUES ('166', '76', '<p>Persentase mahasiswa yang DO atau mengundurkan diri (MDO).</p><p>Tabel 8.c LKPS</p>', '2023-04-10 06:19:26', '2023-04-10 06:19:26', null, '1.92', null, null);
INSERT INTO `indikator` VALUES ('167', '76', '<p>Pelaksanaan tracer study yang mencakup 5 aspek sebagai berikut:&nbsp;</p><p>1) pelaksanaan tracer study terkoordinasi di tingkat PT,</p><p>2) kegiatan tracer study dilakukan secara reguler setiap tahun dan terdokumentasi,</p><p>3) isi kuesioner mencakup seluruh pertanyaan inti tracer study DIKTI.</p><p>4) ditargetkan pada seluruh populasi (lulusan TS-4 s.d. TS-2),</p><p>5) hasilnya disosialisasikan dan digunakan untuk pengembangan kurikulum dan pembelajaran.&nbsp;</p>', '2023-04-10 06:20:49', '2023-04-10 06:20:49', null, '2.88', null, null);
INSERT INTO `indikator` VALUES ('168', '76', '<p>Waktu tunggu lulusan untuk mendapatkan pekerjaan pertama dalam 3 tahun, mulai TS-4 s.d. TS-2.</p><p>Tabel 8.d.1) LKPS</p>', '2023-04-17 23:10:03', '2023-04-17 23:10:03', null, '2.88', '3.5', '3');
INSERT INTO `indikator` VALUES ('169', '76', '<p>Kesesuaian bidang kerja.&nbsp;</p><p>Tabel 8.d.2) LKPS</p>', '2023-04-17 23:10:05', '2023-04-17 23:10:05', null, '1.92', '3.5', '3');
INSERT INTO `indikator` VALUES ('170', '76', '<p>Tingkat dan ukuran tempat kerja lulusan.</p><p>Tabel 8.e.1) LKPS</p>', '2023-04-10 06:45:09', '2023-04-10 06:45:09', null, '1.92', null, null);
INSERT INTO `indikator` VALUES ('171', '76', '<p>Tingkat kepuasan pengguna lulusan.</p><p>Tabel 8.e.2) LKPS</p>', '2023-04-10 06:45:22', '2023-04-10 06:45:22', null, '3.83', null, null);
INSERT INTO `indikator` VALUES ('172', '77', '<p>Publikasi ilmiah mahasiswa, yang dihasilkan secara mandiri atau bersama DTPS, dengan judul yang relevan dengan bidang program studi dalam 3 tahun terakhir.</p><p>Tabel 8.f.1) LKPS</p>', '2023-04-10 07:01:30', '2023-04-10 07:01:30', null, '2.88', null, null);
INSERT INTO `indikator` VALUES ('173', '77', '<p>Luaran penelitian dan PkM yang dihasilkan mahasiswa, baik secara mandiri atau bersama DTPS dalam 3 tahun terakhir.</p><p>Tabel 8.f.5) LKPS</p>', '2023-04-10 07:01:57', '2023-04-10 07:01:57', null, '0.96', null, null);
INSERT INTO `indikator` VALUES ('174', '78', '<p>Keberadaan unit penjaminan mutu UPPS dan komitmen pimpinan dengan keberadaan 4 aspek.</p><p>1)<span style=\"white-space:pre\">	</span>dokumen legal pembentukan unsur pelaksana penjaminan mutu.</p><p>2)<span style=\"white-space:pre\">	</span>dokumen legal bahwa auditor bersifat independen.</p><p>3)<span style=\"white-space:pre\">	</span>Dokumen pelaksanaan audit mutu internal</p><p>4)<span style=\"white-space:pre\">	</span>Dokumen Rapat Tinjauan Manajemen (RTM)</p>', '2023-04-10 07:07:59', '2023-04-10 07:07:59', null, '0', null, null);
INSERT INTO `indikator` VALUES ('175', '79', '<p>Ketersediaan dokumen sistem penjaminan mutu (Kebijakan SPMI, Manual SPMI, Standar SPMI dan Formulir SPMI) dan memiliki pengakuan mutu dari lembaga audit eksternal, lembaga akreditasi, dan lembaga sertifikasi</p><p><br></p><p>Tabel 9.b LKPS</p>', '2023-04-10 07:09:28', '2023-04-10 07:09:28', null, '0', null, null);
INSERT INTO `indikator` VALUES ('176', '80', '<p>Keterlaksanaan Sistem Penjaminan Mutu Internal (SPMI) yang memenuhi aspek berikut:</p><p>1)<span style=\"white-space:pre\">	</span>Tersedianya dokumen IKU dan IKT yang terdiri dari:</p><p>(1)<span style=\"white-space:pre\">	</span>Tata Pamong, Tata Kelola dan Kerja sama; (2) Mahasiswa; (3) Sumber Daya Manusia; (4) Keuangan, Sarana dan Prasarana; (5) Pendidikan; (6) Penelitian; (7) Pengabdian kepada Masyarakat; (8) Luaran dan Capaian Tridharma Perguruan Tinggi.</p><p>2)<span style=\"white-space:pre\">	</span>Terlaksananya siklus penjaminan mutu (siklus PPEPP)</p><p>3)<span style=\"white-space:pre\">	</span>Bukti sahih efektivitas pelaksanaan penjaminan mutu.</p><p>4)<span style=\"white-space:pre\">	</span>Tersedianya bukti peningkatan standar.</p><p><br></p><p>Tabel 9.a LKPS</p>', '2023-04-10 07:10:54', '2023-04-10 07:10:54', null, '0', null, null);
INSERT INTO `indikator` VALUES ('177', '81', '<p>Pengukuran kepuasan para pemangku kepentingan (mahasiswa, dosen, tenaga kependidikan, lulusan, pengguna, mitra industri, dan mitra lainnya) terhadap layanan manajemen, yang memenuhi aspek- aspek berikut:</p><p>1)<span style=\"white-space:pre\">	</span>Menggunakan instrumen kepuasan yang sahih, andal, mudah digunakan,</p><p>2)<span style=\"white-space:pre\">	</span>dilaksanakan secara berkala, serta datanya terekam secara komprehensif,</p><p>3)<span style=\"white-space:pre\">	</span>dianalisis dengan metode yang tepat serta bermanfaat untuk pengambilan keputusan,</p><p>4)<span style=\"white-space:pre\">	</span>tingkat kepuasan dan umpan balik ditindaklanjuti untuk perbaikan dan peningkatan mutu luaran secara berkala dan tersistem.</p><p>5)<span style=\"white-space:pre\">	</span>dilakukan review terhadap pelaksanaan pengukuran kepuasan dosen dan mahasiswa, serta</p><p>6)<span style=\"white-space:pre\">	</span>hasilnya dipublikasikan dan mudah diakses oleh dosen dan mahasiswa.</p>', '2023-04-10 07:13:12', '2023-04-10 07:13:12', null, '0', null, null);
INSERT INTO `indikator` VALUES ('178', '82', '<p>Ketepatan analisis SWOT<br></p>', '2023-04-10 07:16:04', '2023-04-10 07:16:04', null, '2.00', null, null);
INSERT INTO `indikator` VALUES ('179', '83', '<p>Ketepatan di dalam menetapkan tujuan strategis pengembangan.<br></p>', '2023-04-10 07:18:16', '2023-04-10 07:18:16', null, '1.50', null, null);
INSERT INTO `indikator` VALUES ('180', '84', '<p>UPPS memiliki kebijakan, ketersediaan sumber daya, kemampuan melaksanakan, dan kerealistikan program pengembangan berkelanjutan.<br></p>', '2023-04-10 07:19:44', '2023-04-10 07:19:44', null, '1.00', null, null);
INSERT INTO `indikator` VALUES ('181', '41', '<p>Konsistensi dengan hasil\r\nanalisis SWOT dan/atau\r\nanalisis lain serta rencana\r\npengembangan ke\r\ndepan.<br></p>', '2023-04-12 09:32:01', '2023-04-12 09:32:01', null, '6', null, null);
INSERT INTO `indikator` VALUES ('182', '85', '<p>&nbsp;Profil Unit\r\nPengelola\r\nProgram\r\nStudi<br></p>', '2023-04-12 09:35:34', '2023-04-12 09:35:34', null, '6', null, null);
INSERT INTO `indikator` VALUES ('183', '86', '<p>1.1&nbsp;Visi, misi, \r\ntujuan, dan \r\nstrategi \r\nUPPS yang \r\ndirumuskan \r\ndan \r\ndidokumentasikan</p>', '2023-04-12 09:38:55', '2023-04-12 09:38:55', null, '2', null, null);
INSERT INTO `indikator` VALUES ('184', '86', '<p>1.2 Strategi Pencapaian&nbsp;visi, misi \r\ndan tujuan \r\nUPPS </p>', '2023-04-12 09:39:24', '2023-04-12 09:39:24', null, '2', null, null);
INSERT INTO `indikator` VALUES ('185', '86', '<p>1.3&nbsp;Siklus \r\nPenjaminan \r\nMutu \r\n(PPEPP) \r\nberjalan \r\ndengan \r\nefektif</p>', '2023-04-12 09:39:47', '2023-04-12 09:39:47', null, '2', null, null);
INSERT INTO `indikator` VALUES ('186', '42', '<p>Kesesuaian Visi, Misi, Tujuan dan Strategi (VMTS) Unit Pengelola Program Studi (UPPS) terhadap VMTS Perguruan Tinggi (PT) dan visi keilmuan Program Studi (PS) yang dikelolanya.<br></p>', '2023-04-18 04:06:10', '2023-04-18 04:06:10', null, '2', null, null);
INSERT INTO `indikator` VALUES ('187', '42', '<p>Kesesuaian Visi, Misi, Tujuan dan Strategi (VMTS) Unit Pengelola Program Studi (UPPS) terhadap VMTS Perguruan Tinggi (PT) dan visi keilmuan Program Studi (PS) yang dikelolanya.<br></p>', '2023-04-18 00:09:25', '2023-04-18 00:09:25', null, '1', null, null);
INSERT INTO `indikator` VALUES ('188', '87', '<p>Mutu, manfaat,kepuasan dan keberlanjutan kerjasama pendidikan, penelitian dan pengabdian kepada masyarakat yang relevan dengan program studi. UPPS memiliki bukti yang sahih terkait kerjasama yang ada telah memenuhi 3 aspek berikut:</p><p>1) memberikan manfaat bagi program studi dalam pemenuhan proses pembelajaran, penelitian, pengabdian kepada masyarakat serta pemenuhan Merdeka Belajar dan Kampus&nbsp; Merdeka (MBKM)</p><p>2) memberikan peningkatan kinerja tridarma dan fasilitas pendukung program studi.&nbsp;</p><p>3) memberikan kepuasan kepada mitra industri dan mitra kerjasama lainnya, serta menjamin keberlanjutan kerjasama dan hasilnya.</p>', '2023-04-18 04:09:13', '2023-04-18 04:09:13', null, '2', null, null);
INSERT INTO `indikator` VALUES ('189', '87', '<p>A. Kerjasama pendidikan, penelitian, dan pengabdian kepada masyarakat yang relevan dengan program studi dan dikelola oleh UPPS dalam 3 tahun terakhir.</p><p>Tabel 2 LKPS</p>', '2023-04-18 04:11:02', '2023-04-18 04:11:02', null, '2', null, null);
INSERT INTO `indikator` VALUES ('190', '87', '<p>B. Kerjasama tingkat internasional, nasional,wilayah/lokal yang relevan dengan program studi dan dikelola oleh UPPS dalam 3 tahun terakhir.</p><p>Tabel 2 LKPS</p><p>Skor = ((2 x A) + B) / 3</p>', '2023-04-18 04:11:20', '2023-04-18 04:11:20', null, '2', null, null);
INSERT INTO `indikator` VALUES ('191', '88', '<p>Keterlaksanaan Sistem Penjaminan Mutu Internal (akademik dan non akademik) yang dibuktikan dengan keberadaan 5 aspek:</p><p>1) dokumen legal pembentukan unsur pelaksana penjaminan mutu.</p><p>2) ketersediaan dokumen mutu: kebijakan SPMI, manual SPMI, standar SPMI, dan formulir SPMI.</p><p>3) terlaksananya siklus penjaminan mutu (siklus PPEPP).</p><p>4) bukti sahih efektivitas pelaksanaan penjaminan mutu.</p><p>5) memiliki external benchmarking dalam peningkatan mutu.</p>', '2023-04-18 04:13:23', '2023-04-18 04:13:23', null, '2', '3.5', null);
INSERT INTO `indikator` VALUES ('192', '89', '<p>Pengukuran kepuasan para pemangku kepentingan(mahasiswa, dosen, tenaga kependidikan,lulusan, pengguna, mitra industri, dan mitra lainnya) terhadap layanan manajemen dan&nbsp; sumber daya manusia,</p><p>yang memenuhi aspek - aspek berikut:</p><p>1) menggunakan instrumen kepuasan yang sahih, andal, mudah digunakan,</p><p>2) dilaksanakan secara berkala, serta datanya terekam secara komprehensif,</p><p>3) dianalisis dengan metode yang tepat serta bermanfaat untuk pengambilan keputusan,</p><p>4) tingkat kepuasan dan umpan balik ditindaklanjuti untuk perbaikan dan peningkatan mutu luaran secara berkala dan tersistem,</p><p>5) dilakukan review terhadap pelaksanaan pengukuran kepuasan dosen dan mahasiswa, serta</p><p>6) hasilnya dipublikasikan dan mudah diakses oleh dosen dan mahasiswa.</p>', '2023-04-18 04:14:37', '2023-04-18 04:14:37', null, '2', null, null);
INSERT INTO `indikator` VALUES ('193', '90', '<p>Metoda seleksi mahasiswa baru dan keketatan seleksi.</p><p>Tabel 3 LKPS</p><p>Untuk program studi dengan jumlah kebutuhan lulusan tinggi berlaku perhitungan Skor sebagai berikut:<br></p>', '2023-04-18 00:17:06', '2023-04-18 04:17:06', null, '1', null, null);
INSERT INTO `indikator` VALUES ('194', '90', '<p>Metoda seleksi mahasiswa baru dan keketatan seleksi.</p><p>Tabel 3 LKPS</p><p>Untuk program studi dengan jumlah kebutuhan lulusan rendah berlaku pemberian Skor sesuai kondisi berikut:<br></p>', '2023-04-18 04:17:38', '2023-04-18 04:17:38', null, '1', null, null);
INSERT INTO `indikator` VALUES ('195', '91', '<p>A. Ketersediaan layanan kemahasiswaan di bidang:</p><p>1) penalaran, minat dan bakat,</p><p>2) kesejahteraan(bimbingan dan konseling, layanan beasiswa, dan layanan kesehatan), dan</p><p>3) bimbingan karir dan kewirausahaan.</p>', '2023-04-18 04:19:32', '2023-04-18 04:19:32', null, '1', null, null);
INSERT INTO `indikator` VALUES ('196', '91', '<p>B. Akses dan mutu layanan kemahasiswaan.<br></p>', '2023-04-18 04:19:45', '2023-04-18 04:19:45', null, '1', null, null);
INSERT INTO `indikator` VALUES ('197', '92', '<p>Kecukupan jumlah DTPS.</p><p>Tabel 4.a.1 LKPS</p>', '2023-04-18 04:22:57', '2023-04-18 04:22:57', null, '1', null, null);
INSERT INTO `indikator` VALUES ('198', '93', '<p>Kualifikasi akademik DTPS.</p><p>Tabel 3.a.1) LKPS</p>', '2023-04-18 04:24:40', '2023-04-18 04:24:40', null, '1', '3.5', null);
INSERT INTO `indikator` VALUES ('199', '93', '<p>Jabatan akademik DTPS.</p><p>Tabel 4.a.1) LKPS</p>', '2023-04-18 04:25:11', '2023-04-18 04:25:11', null, '0.70', null, null);
INSERT INTO `indikator` VALUES ('200', '93', '<p>Rasio jumlah mahasiswa program studi terhadap jumlah DTPS.</p><p>Tabel 3 LKPS dan Tabel 4.a.1) LKPS</p><p><br></p><p>A =((NDTPS-3)/9)</p><p>B = RMD/15 jika RMD &lt; 15</p><p>B = ((RMD-15)/10) jika 15 ? RMD ? 25&nbsp;</p><p>B= (35-RMD)/10 jika 25 &lt; RMD1 ? 35.</p>', '2023-04-18 04:25:35', '2023-04-18 04:25:35', null, '1', null, null);
INSERT INTO `indikator` VALUES ('201', '93', '<p>Pengakuan Karya Ilmiah Dosen&nbsp;</p><p>a.Pengindeks Hirsch (H) indeks Scopus atau Impact Factor WOS</p><p>b.Sinta Score</p><p>Tabel 4.a.1 LKPS</p>', '2023-04-18 04:26:01', '2023-04-18 04:26:01', null, '0.20', null, null);
INSERT INTO `indikator` VALUES ('202', '93', '<p>Penugasan DTPS sebagai pembimbing utama tugas akhir mahasiswa.</p><p>Tabel 4.a.2) LKPS&nbsp;</p>', '2023-04-18 04:26:20', '2023-04-18 04:26:20', null, '0.70', null, null);
INSERT INTO `indikator` VALUES ('203', '93', '<p>Ekuivalensi Waktu Mengajar Penuh DTPS.</p><p>Tabel 4.a.3) LKPS</p>', '2023-04-18 04:26:37', '2023-04-18 04:26:37', null, '0.70', null, null);
INSERT INTO `indikator` VALUES ('204', '93', '<p>Dosen tidak tetap.</p><p>Tabel 4.a.4) LKPS</p>', '2023-04-18 04:26:56', '2023-04-18 04:26:56', null, '0.30', null, null);
INSERT INTO `indikator` VALUES ('205', '93', '<p>Dosen Industri/Praktisi.</p><p>Tabel 4.a.5 LKPS</p>', '2023-04-18 04:27:15', '2023-04-18 04:27:15', null, '0.20', null, null);
INSERT INTO `indikator` VALUES ('206', '94', '<p>Publikasi ilmiah dengan tema yang relevan dengan bidang program studi yang dihasilkan DTPS dalam 3 tahun terakhir.</p><p>Tabel 4.b.1) LKPS</p>', '2023-04-18 04:33:39', '2023-04-18 04:33:39', null, '0.90', null, null);
INSERT INTO `indikator` VALUES ('207', '94', '<p>Artikel karya ilmiah DTPS yang disitasi dalam 3 tahun terakhir.</p><p>Tabel 4.b.2) LKPS</p>', '2023-04-18 04:33:58', '2023-04-18 04:33:58', null, '0.50', null, null);
INSERT INTO `indikator` VALUES ('208', '94', '<p>Luaran penelitian dan pengabdian kepada masyarakat yang dihasilkan DTPS selain publikasi ilmiah dalam 3 tahun terakhir.</p><p>Tabel 4.b.3 LKPS&nbsp;</p>', '2023-04-18 04:34:13', '2023-04-18 04:34:13', null, '0.80', null, null);
INSERT INTO `indikator` VALUES ('209', '95', '<p>Upaya pengembangan dosen.</p>', '2023-04-18 04:37:13', '2023-04-18 04:37:13', null, '0.50', null, null);
INSERT INTO `indikator` VALUES ('210', '96', '<p>A. Kualifikasi dan kecukupan tenaga kependidikan berdasarkan jenis pekerjaannya (administrasi, pustakawan, teknisi, dll.)</p><p>Catatan: Penilaian kecukupan tidak hanya ditentukan oleh jumlah tenaga kependidikan, namun keberadaan dan pemanfaatan teknologi informasi dan komputer dalam proses administrasi dapat dijadikan pertimbangan untuk menilai efektifitas pekerjaan dan kebutuhan akan tenaga kependidikan.</p><p><br></p><p>Tabel 3.c LKPS</p>', '2023-04-18 04:38:28', '2023-04-18 04:38:28', null, '0.50', null, null);
INSERT INTO `indikator` VALUES ('211', '96', '<p>B. Kualifikasi dan kecukupan laboran untuk mendukung proses pembelajaran sesuai dengan kebutuhan program studi.</p>', '2023-04-18 00:38:51', '2023-04-18 04:38:50', null, '0.50', null, null);
INSERT INTO `indikator` VALUES ('212', '97', '<p>Biaya operasional pendidikan.</p><p>Tabel 4 LKPS</p>', '2023-04-18 04:41:56', '2023-04-18 04:41:56', null, '1', null, null);
INSERT INTO `indikator` VALUES ('213', '97', '<p>Dana penelitian DTPS.</p><p>Tabel 5.a LKPS</p>', '2023-04-18 04:42:15', '2023-04-18 04:42:15', null, '0.50', null, null);
INSERT INTO `indikator` VALUES ('214', '97', '<p>Dana pengabdian kepada masyarakat DTPS.</p><p>Tabel 5.a LKPS</p>', '2023-04-18 04:42:29', '2023-04-18 04:42:29', null, '0.50', null, null);
INSERT INTO `indikator` VALUES ('215', '97', '<p>Realisasi investasi (SDM, sarana dan prasarana) yang mendukung penyelenggaraan tridharma.</p><p>Catatan: Jika Skor rata-rata butir tentang Profil Dosen, Sarana, dan Prasarana ? 3,5 , maka Skor butir ini = 4.</p>', '2023-04-18 04:42:44', '2023-04-18 04:42:44', null, '1', null, null);
INSERT INTO `indikator` VALUES ('216', '97', '<p>Kecukupan dana untuk menjamin pencapaian capaian pembelajaran.<br></p>', '2023-04-18 04:43:06', '2023-04-18 04:43:06', null, '1', null, null);
INSERT INTO `indikator` VALUES ('217', '98', '<p>Ketersediaan, aksesibilitas dan mutu sarana laboratorium untuk menjamin pencapaian capaian pembelajaran dan meningkatkan suasana akademik.</p><p>Tabel 5.b.1 LKPS&nbsp;</p><p>Tabel 5.b.2 LKPS</p>', '2023-05-12 02:36:31', '2023-05-12 02:36:31', null, '1', '3.5', '2.5');
INSERT INTO `indikator` VALUES ('218', '99', '<p>A. Keterlibatan pemangku kepentingan dalam proses evaluasi dan pemutakhiran kurikulum.<br></p>', '2023-04-18 06:06:06', '2023-04-18 06:06:06', null, '1', null, null);
INSERT INTO `indikator` VALUES ('219', '99', '<p>B. Kesesuaian capaian pembelajaran dengan profil lulusan dan jenjang KKNI/SKKNI.<br></p>', '2023-04-18 06:06:25', '2023-04-18 06:06:25', null, '1', null, null);
INSERT INTO `indikator` VALUES ('220', '99', '<p>C. Ketepatan struktur kurikulum dalam pembentukan capaian pembelajaran.<br></p>', '2023-04-18 06:06:32', '2023-04-18 06:06:32', null, '1', null, null);
INSERT INTO `indikator` VALUES ('221', '100', '<p>Pemenuhan karakteristik proses pembelajaran yang menggunakan pendekatan PBL (Project Based Learning) dan CBL (Case Based Learning) serta berpusat pada mahasiswa. Program studi harus menjelaskan penerapan proses pembelajaran berdasarkan sifat-sifat tersebut untuk menghasilkan profil lulusan yang sesuai dengan capaian pembelajaran yang direncanakan dalam dokumen kurikulum.<br></p>', '2023-04-18 06:09:12', '2023-04-18 06:09:12', null, '1', null, null);
INSERT INTO `indikator` VALUES ('222', '101', '<p>A. Ketersediaan dan kelengkapan dokumen rencana pembelajaran semester (RPS)&nbsp;<br></p>', '2023-04-18 06:10:18', '2023-04-18 06:10:18', null, '1', null, null);
INSERT INTO `indikator` VALUES ('223', '101', '<p>B. Kedalaman dan keluasan RPS sesuai dengan capaian pembelajaran lulusan.<br></p>', '2023-04-18 06:10:28', '2023-04-18 06:10:28', null, '1', null, null);
INSERT INTO `indikator` VALUES ('224', '102', '<p>A. Bentuk interaksi antara dosen, mahasiswa dan sumber belajar<br></p>', '2023-04-18 06:12:15', '2023-04-18 06:12:15', null, '1', null, null);
INSERT INTO `indikator` VALUES ('225', '102', '<p>B. Pemantauan kesesuaian proses terhadap rencana pembelajaran<br></p>', '2023-04-18 06:12:26', '2023-04-18 06:12:26', null, '1', null, null);
INSERT INTO `indikator` VALUES ('226', '102', '<p>C. Kesesuaian metode pembelajaran dengan capaian pembelajaran. Contoh: RBE (research based education), IBE (industry based education), teaching factory/teaching industry, dll.<br></p>', '2023-04-18 06:12:34', '2023-04-18 06:12:34', null, '1', null, null);
INSERT INTO `indikator` VALUES ('227', '102', '<p>Pembelajaran yang dilaksanakan dalam bentuk praktikum, praktik bengkel, atau praktik lapangan. (Konversi bobot kredit mata kuliah ke jam praktikum/ praktik/ praktik lapangan)</p><p>Tabel 6.a LKPS</p>', '2023-04-18 06:12:48', '2023-04-18 06:12:48', null, '1', null, null);
INSERT INTO `indikator` VALUES ('228', '103', '<p>Monitoring dan evaluasi pelaksanaan proses pembelajaran mencakup karakteristik, perencanaan, pelaksanaan, proses pembelajaran dan beban belajar mahasiswa, dan sumber daya.<br></p>', '2023-04-18 06:15:38', '2023-04-18 06:15:38', null, '2', null, null);
INSERT INTO `indikator` VALUES ('229', '104', '<p>A. Mutu pelaksanaan penilaian pembelajaran (proses dan hasil belajar mahasiswa) untuk mengukur ketercapaian capaian pembelajaran berdasarkan prinsip penilaian yang mencakup: 1) edukatif, 2) otentik, 3) objektif, 4) akuntabel, dan 5) transparan, yang dilakukan secara terintegrasi.<br></p>', '2023-04-18 06:16:42', '2023-04-18 06:16:42', null, '1', null, null);
INSERT INTO `indikator` VALUES ('230', '104', '<p>B. Pelaksanaan penilaian terdiri atas teknik dan instrumen penilaian.&nbsp;</p><p>Teknik penilaian terdiri dari: 1) observasi, 2) partisipasi, 3) unjuk kerja, 4) test tertulis, 5) test lisan.</p><p>Instrumen penilaian terdiri dari: 1) penilaian proses dalam bentuk rubrik, dan/ atau; 2) penilaian hasil dalam bentuk portofolio, atau 3) karya disain.</p>', '2023-04-18 06:16:53', '2023-04-18 06:16:53', null, '1', null, null);
INSERT INTO `indikator` VALUES ('231', '104', '<p>C. Pelaksanaan penilaian memuat unsur-unsur sebagai berikut: 1) mempunyai kontrak rencana penilaian, 2) melaksanakan penilaian sesuai kontrak atau kesepakatan, 3) memberikan umpan balik dan memberi kesempatan untuk mempertanyakan hasil kepada mahasiswa, 4) mempunyai dokumentasi penilaian proses dan hasil belajar mahasiswa, 5) mempunyai prosedur yang mencakup tahap perencanaan, kegiatan pemberian tugas atau soal, observasi kinerja, pengembalian hasil observasi, dan pemberian nilai akhir, 6) pelaporan penilaian berupa kualifikasi keberhasilan mahasiswa dalam menempuh suatu mata kuliah dalam bentuk huruf dan angka, 7) mempunyai bukti-bukti rencana dan telah melakukan proses perbaikan berdasar hasil monev penilaian.<br></p>', '2023-04-18 06:17:00', '2023-04-18 06:17:00', null, '1', null, null);
INSERT INTO `indikator` VALUES ('232', '104', '<p>D. Mutu soal ujian (lihat folder Soal Ujian).<br></p>', '2023-04-18 06:17:29', '2023-04-18 06:17:29', null, '1', null, null);
INSERT INTO `indikator` VALUES ('233', '104', '<p>E. Mutu tugas-tugas mahasiswa (lihat folder Tugas Mahasiswa).<br></p>', '2023-04-18 06:17:35', '2023-04-18 06:17:35', null, '1', null, null);
INSERT INTO `indikator` VALUES ('234', '104', '<p>F. Mutu tugas akhir (lihat folder Tugas Akhir).<br></p>', '2023-04-18 06:17:41', '2023-04-18 06:17:41', null, '1', null, null);
INSERT INTO `indikator` VALUES ('235', '104', '<p>G. Skill yang diberikan kepada mahasiswa (lihat Suplemen Prodi).&nbsp;<br></p>', '2023-04-18 06:17:48', '2023-04-18 06:17:48', null, '1', null, null);
INSERT INTO `indikator` VALUES ('236', '105', '<p>Integrasi kegiatan penelitian dan PkM dalam pembelajaran oleh DTPS dalam 3 tahun terakhir.</p><p>Tabel 6.b LKPS</p>', '2023-04-18 06:23:29', '2023-04-18 06:23:29', null, '1', null, null);
INSERT INTO `indikator` VALUES ('237', '106', '<p>A. Kebijakan dan pedoman pelaksanaan kegiatan belajar berbasis Merdeka Belajar dan Kampus Merdeka (MBKM).<br></p>', '2023-04-18 06:24:10', '2023-04-18 06:24:10', null, '1', null, null);
INSERT INTO `indikator` VALUES ('238', '106', '<p>B. Sumber daya yang tersedia mendukung terlaksananya MBKM dengan baik.<br></p>', '2023-04-18 06:24:22', '2023-04-18 06:24:22', null, '0.50', null, null);
INSERT INTO `indikator` VALUES ('239', '106', '<p>C. Rancangan Bentuk&nbsp;</p><p>Kegiatan Konversi&nbsp;</p><p>Program MBKM:</p><p>1. magang di indutri,&nbsp;</p><p>2. keterlibatan dalam proyek pedesaan,</p><p>3. mengajar di sekolah,&nbsp;</p><p>4. terlibat dalam riset,&nbsp;</p><p>5. kegiatan berwirausahaan,&nbsp;</p><p>6. pertukaran mahasiswa,</p><p>7. studi proyek independent,&nbsp;</p><p>8. proyek kemanusiaan ke dalam sks matakuliah.</p>', '2023-04-18 06:24:35', '2023-04-18 06:24:35', null, '1', null, null);
INSERT INTO `indikator` VALUES ('240', '106', '<p>D. Strategi penilaian capaian pembelajaran berbasis MBKM.&nbsp;<br></p>', '2023-04-18 06:24:46', '2023-04-18 06:24:46', null, '1', null, null);
INSERT INTO `indikator` VALUES ('241', '106', '<p>E. Organisasi MBKM.<br></p>', '2023-04-18 06:24:59', '2023-04-18 06:24:59', null, '1', null, null);
INSERT INTO `indikator` VALUES ('242', '106', '<p>F. Evaluasi terhadap perencanaan, pelaksanaan, dan tindak lanjut MBKM.<br></p>', '2023-04-18 06:25:04', '2023-04-18 06:25:04', null, '1', null, null);
INSERT INTO `indikator` VALUES ('243', '107', '<p>Keterlaksanaan dan keberkalaan program dan kegiatan di luar kegiatan pembelajaran terstruktur untuk meningkatkan suasana akademik.</p><p>Contoh: kuliah umum, studium generale, seminarilmiah, bedah buku, membahas paper ilmiah.</p>', '2023-04-18 06:29:41', '2023-04-18 06:29:41', null, '1', null, null);
INSERT INTO `indikator` VALUES ('244', '108', '<p>A. Tingkat kepuasan mahasiswa terhadap proses pendidikan.</p><p>Tabel 6.c LKPS</p><p>Tingkat kepuasan pengguna pada aspek:</p><p>TKM1: Reliability; TKM2: Responsiveness; TKM3: Assurance; TKM4: Empathy; TKM5: Tangible.</p><p><br></p><p>Tingkat kepuasan mahasiswa pada aspek ke-i dihitung dengan rumus sebagai berikut:</p><p>TKMi = (4 x ai) + (3 x bi) + (2 x ci) + di i = 1, 2, ..., 7</p><p>dimana : ai = persentase “Sangat Baik”; bi = persentase “Baik”; ci = persentase “Cukup”; di = persentase “Kurang”.</p><p><br></p><p>TKM = ?TKMi / 5</p>', '2023-04-18 06:30:51', '2023-04-18 06:30:51', null, '1', null, null);
INSERT INTO `indikator` VALUES ('245', '108', '<p>B. Analisis dan tindak lanjut dari hasil pengukuran kepuasan mahasiswa.<br></p>', '2023-04-18 06:31:04', '2023-04-18 06:31:04', null, '1', null, null);
INSERT INTO `indikator` VALUES ('246', '109', '<p>Relevansi penelitian pada UPPS mencakup unsur-unsur sebagai berikut:&nbsp;</p><p>1) memiliki peta jalan yang memayungi tema penelitian dosen dan mahasiswa,</p><p>2) dosen dan mahasiswa melaksanakan penelitian sesuai dengan agenda penelitian dosen yang merujuk kepada peta jalan penelitian.&nbsp;</p><p>3) melakukan evaluasi kesesuaian penelitian dosen dan mahasiswa dengan peta jalan, dan&nbsp;</p><p>4) menggunakan hasil evaluasi untuk perbaikan relevansi penelitian dan pengembangan keilmuan program studi.</p>', '2023-04-18 06:35:18', '2023-04-18 06:35:18', null, '2', null, null);
INSERT INTO `indikator` VALUES ('247', '110', '<p>Penelitian DTPS yang dalam pelaksanaannya melibatkan mahasiswa program studi dalam 3 tahun terakhir.</p><p>Tabel 7.a LKPS</p>', '2023-04-18 06:36:51', '2023-04-18 06:36:51', null, '2', null, null);
INSERT INTO `indikator` VALUES ('248', '111', '<p>Relevansi PkM pada UPPS mencakup unsur-unsur sebagai berikut:&nbsp;</p><p>1) memiliki peta jalan yang memayungi tema PkM dosen dan mahasiswa serta hilirisasi/penerapan keilmuan program studi,&nbsp;</p><p>2) dosen dan mahasiswa melaksanakan PkM sesuai dengan peta jalan PkM.&nbsp;</p><p>3) melakukan evaluasi kesesuaian PkM dosen dan mahasiswa dengan peta jalan, dan&nbsp;</p><p>4) menggunakan hasil evaluasi untuk perbaikan relevansi PkM dan pengembangan keilmuan program studi.</p>', '2023-04-18 06:37:51', '2023-04-18 06:37:51', null, '1', null, null);
INSERT INTO `indikator` VALUES ('249', '112', '<p>PkM DTPS yang dalam pelaksanaannya melibatkan mahasiswa program studi dalam 3 tahun terakhir.</p><p>Tabel 8 LKPS</p>', '2023-04-18 06:42:11', '2023-04-18 06:42:11', null, '1', null, null);
INSERT INTO `indikator` VALUES ('250', '113', '<p>Analisis pemenuhan capaian pembelajaran lulusan (CPL) yang diukur dengan metoda yang sahih dan relevan, mencakup aspek:</p><p>1) keserbacakupan,&nbsp;</p><p>2) kedalaman, dan&nbsp;</p><p>3) kebermanfaatan analisis yang ditunjukkan dengan peningkatan CPL dari waktu ke waktu dalam 3 tahun terakhir.</p>', '2023-04-18 06:42:58', '2023-04-18 06:42:58', null, '3', null, null);
INSERT INTO `indikator` VALUES ('251', '113', '<p>IPK lulusan.</p><p>RIPK = Rata-rata IPK lulusan dalam 3 tahun terakhir.</p><p>Tabel 9.a LKPS</p>', '2023-04-18 06:43:14', '2023-04-18 06:43:14', null, '3', null, null);
INSERT INTO `indikator` VALUES ('252', '113', '<p>Prestasi mahasiswa di bidang akademik dalam 3 tahun terakhir.</p><p>Tabel 9.b.1) LKPS</p>', '2023-04-18 06:43:26', '2023-04-18 06:43:26', null, '3', null, null);
INSERT INTO `indikator` VALUES ('253', '113', '<p>Prestasi mahasiswa di bidang nonakademik dalam 3 tahun terakhir.</p><p>Tabel 9.b.2) LKPS</p>', '2023-04-18 06:43:38', '2023-04-18 06:43:38', null, '3', null, null);
INSERT INTO `indikator` VALUES ('254', '113', '<p>Masa studi.</p><p>Tabel 9.c LKPS</p>', '2023-04-18 06:43:52', '2023-04-18 06:43:52', null, '3', null, null);
INSERT INTO `indikator` VALUES ('255', '113', '<p>Persentase kelulusan tepat waktu (PTW)</p><p>Tabel 9.c LKPS</p>', '2023-04-18 06:44:03', '2023-04-18 06:44:03', null, '3', null, null);
INSERT INTO `indikator` VALUES ('256', '113', '<p>Keberhasilan studi&nbsp;</p><p>PPS = Persentase keberhasilan studi (pass rate) Tabel 9.c LKPS</p>', '2023-04-18 06:44:09', '2023-04-18 06:44:09', null, '3', null, null);
INSERT INTO `indikator` VALUES ('257', '113', '<p>Pelaksanaan tracer study yang mencakup 5 aspek sebagai berikut:&nbsp;</p><p>1) pelaksanaan tracer study terkoordinasi di tingkat PT,</p><p>2) kegiatan tracer study dilakukan secara reguler setiap tahun dan terdokumentasi,</p><p>3) isi kuesioner mencakup seluruh pertanyaan inti tracer study DIKTI.</p><p>4) ditargetkan pada seluruh populasi (lulusan TS-4 s.d. TS-2),</p><p>5) hasilnya disosialisasikan dan digunakan untuk pengembangan kurikulum dan pembelajaran.&nbsp;</p>', '2023-04-18 06:44:26', '2023-04-18 06:44:26', null, '3', null, null);
INSERT INTO `indikator` VALUES ('258', '113', '<p>Waktu tunggu lulusan untuk mendapatkan pekerjaan pertama dalam 3 tahun, mulai TS-4 s.d. TS-2.</p><p>Tabel 9.d.) LKPS</p>', '2023-05-12 02:37:13', '2023-05-12 02:37:13', null, '3', '3.5', '2');
INSERT INTO `indikator` VALUES ('259', '113', '<p>Tingkat dan ukuran tempat kerja lulusan.</p><p>Tabel 9.e.1) LKPS</p>', '2023-04-18 06:45:06', '2023-04-18 06:45:06', null, '3', null, null);
INSERT INTO `indikator` VALUES ('260', '113', '<p>Pendapatan atau Penghasilan rata-rata per bulan pada tahun pertama bekerja<br></p>', '2023-04-18 06:45:21', '2023-04-18 06:45:21', null, '3', null, null);
INSERT INTO `indikator` VALUES ('261', '113', '<p>Tingkat kepuasan pengguna lulusan.</p><p>Tabel 9.e.3) LKPS</p>', '2023-04-18 06:45:29', '2023-04-18 06:45:29', null, '3', null, null);
INSERT INTO `indikator` VALUES ('262', '114', '<p>Publikasi ilmiah mahasiswa, yang dihasilkan secara mandiri atau bersama DTPS, dengan judul yang relevan dengan bidang program studi dalam 3 tahun terakhir.</p><p>Tabel 9.f.1) LKPS</p>', '2023-04-18 07:14:52', '2023-04-18 07:14:52', null, '2', null, null);
INSERT INTO `indikator` VALUES ('263', '114', '<p>Luaran penelitian dan PkM yang dihasilkan mahasiswa, baik secara mandiri atau bersama DTPS dalam 3 tahun terakhir.</p><p>Tabel 9.f.3) LKPS</p>', '2023-04-18 07:15:17', '2023-04-18 07:15:17', null, '2', null, null);
INSERT INTO `indikator` VALUES ('264', '115', '<p>Keserbacakupan (kelengkapan, keluasan, dan kedalaman), ketepatan, ketajaman, dan kesesuaian analisis capaian kinerja serta konsistensi dengan setiap kriteria.<br></p>', '2023-04-18 07:17:43', '2023-04-18 07:17:43', null, '1.50', null, null);
INSERT INTO `indikator` VALUES ('265', '116', '<p>Ketepatan analisis SWOT<br></p>', '2023-04-18 07:19:34', '2023-04-18 07:19:34', null, '1.50', null, null);
INSERT INTO `indikator` VALUES ('266', '117', '<p>Kemampuan UPPS dalam menetapkan strategi dan program pengembangan dan keberlanjutan berdasarkan prioritas sesuai dengan kapasitas, kebutuhan, dan VMT UPPS secara keseluruhan, terutama pengembangan program studi yang diakreditasi.<br></p>', '2023-04-18 07:20:40', '2023-04-18 07:20:40', null, '1.50', null, null);
INSERT INTO `indikator` VALUES ('267', '118', '<p>1.1</p><p> Kesesuaian VMTS \r\nUPPS terhadap VMTS \r\nPT dan visi keilmuan PS \r\nyang dikelolanya.<br></p>', '2023-05-10 06:28:21', '2023-05-10 10:28:21', null, '0.74', null, null);
INSERT INTO `indikator` VALUES ('268', '118', '<p>1.2 </p><p>Mekanisme \r\npenyusunan VMTS \r\nUPPS melibatkan para \r\npemangku kepentingan.\r\n1) Pemangku \r\nkepentingan internal:\r\nmahasiswa, dosen, \r\ntendik, pengelola.\r\n2) Pemangku \r\nkepentingan eksternal: \r\nlulusan, pengguna \r\nlulusan, mitra, pakar, \r\norganisasi profesi, dan \r\npemerintah<br></p>', '2023-05-10 06:28:27', '2023-05-10 10:28:27', null, '1.48', null, null);
INSERT INTO `indikator` VALUES ('269', '118', '<p>1.3 Strategi pencapaian \r\ntujuan disusun \r\nberdasarkan analisis \r\nyang sistematis, pada \r\npelaksanaannya \r\ndilakukan pemantauan\r\ndan evaluasi yang \r\nditindaklanjuti oleh \r\nUPPS<br></p>', '2023-05-10 10:20:47', '2023-05-10 10:20:47', null, '1.4', null, null);
INSERT INTO `indikator` VALUES ('270', '118', '<p>1.3 </p><p><span style=\"font-size: 1rem;\">Strategi pencapaian \r\ntujuan disusun \r\nberdasarkan analisis \r\nyang sistematis, pada \r\npelaksanaannya \r\ndilakukan pemantauan\r\ndan evaluasi yang \r\nditindaklanjuti oleh \r\nUPPS</span><br></p>', '2023-05-10 06:28:13', '2023-05-10 10:28:13', null, '1.48', null, null);
INSERT INTO `indikator` VALUES ('271', '118', '<p>1.4</p><p> Audit internal \r\nterhadap \r\npencapaian sasaran \r\nsesuai dengan \r\nrencana operasional \r\nsetiap tahun pada \r\nUnit Pengelola \r\nProgram Studi&nbsp;</p>', '2023-05-10 06:28:03', '2023-05-10 10:28:03', null, '0.74', null, null);
INSERT INTO `indikator` VALUES ('272', '119', '<p>2.1.1 Pelaksanaan \r\npenjaminan mutu internal \r\npada Unit Pengelola \r\nProgram Studi, serta \r\nkelengkapan dokumennya.</p><p>&nbsp;a. Bobot Audit Internal\r\nBobot Penjaminan \r\nMutu sampai dengan \r\nTindak Lanjut Audit\r\nMutu Internal = 4\r\n</p><p>b. Bobot Penjaminan \r\nMutu sampai dengan \r\nUmpan Balik Audit \r\nMutu Internal = 3\r\n</p><p>c. Bobot Penjaminan \r\nMutu sampai \r\nMonitoring, Evaluasi, \r\ndan Audit Mutu \r\nInternal = 2\r\n</p><p>d. Bobot jika baru \r\nmemiliki Pedoman \r\npenjaminan mutu \r\ninternal (Kebijakan \r\nMutu, Standar Mutu, \r\nManual Mutu, \r\nFormulir) = 1\r\n</p><p>e. Bobot jika tidak \r\nmemiliki Pedoman \r\npenjaminan mutu \r\ninternal (Kebijakan&nbsp;<br></p>', '2023-05-10 06:40:03', '2023-05-10 10:40:03', null, '0.91', null, null);
INSERT INTO `indikator` VALUES ('273', '119', '<p>2.1.2 Hasil pelaksanaan \r\npenjaminan mutu eksternal\r\npada Unit Pengelola \r\nProgram Studi, serta \r\nkelengkapan dokumennya.<br></p>', '2023-05-10 10:41:13', '2023-05-10 10:41:13', null, '0.61', null, null);
INSERT INTO `indikator` VALUES ('274', '120', '<p>2.2 Kegiatan kerja sama\r\ndengan instansi dalam&nbsp;dan luar negeri yang \r\ndilakukan oleh Perguruan \r\nTinggi/Unit Pengelola\r\nProgram Studi, dan \r\nProgram Studi dalam tiga \r\ntahun terakhir.\r\nKriteria\r\n1. Mendukung \r\npelaksanaan \r\nTridarma PT \r\nsecara lengkap.\r\n2. Kerja sama\r\ndengan wahana \r\ndan praktik klinik.\r\n3. Ketersediaan \r\ndokumen\r\nperjanjian kerja \r\nsama (MoU)\r\n4. Ketersediaan\r\nlaporan \r\npelaksanaan \r\nkegiatan kerja \r\nsama<br></p>', '2023-05-10 10:46:31', '2023-05-10 10:46:31', null, '0.61', null, null);
INSERT INTO `indikator` VALUES ('275', '121', '<p>2.3 </p><p>Kelengkapan struktur \r\norganisasi dan keefektifan \r\npenyelenggaraan \r\norganisasi pada UPPS.<br></p>', '2023-05-10 06:49:07', '2023-05-10 10:49:07', null, '0.61', null, null);
INSERT INTO `indikator` VALUES ('276', '121', '<p>2.4 </p><p>Pemenuhan lima pilar \r\nsistem tata pamong pada\r\nUPPS<br></p>', '2023-05-10 10:49:30', '2023-05-10 10:49:30', null, '0.61', null, null);
INSERT INTO `indikator` VALUES ('277', '121', '<p>2.5 </p><p>Keterlaksanaan Sistem \r\nPenjaminan Mutu Internal \r\n(akademik dan non \r\nakademik) pada UPPS \r\nyang dibuktikan dengan \r\nkeberadaan 4 aspek&nbsp;</p>', '2023-05-10 07:02:00', '2023-05-10 11:02:00', null, '0.91', null, null);
INSERT INTO `indikator` VALUES ('278', '121', '<p>2.6</p><p> Komitmen pimpinan \r\nUPPS<br></p>', '2023-05-10 10:50:50', '2023-05-10 10:50:50', null, '0.61', null, null);
INSERT INTO `indikator` VALUES ('279', '121', '<p>2.7 </p><p>Pengukuran kepuasan \r\nlayanan manajemen&nbsp;terhadap para pemangku \r\nkepentingan:</p><p>\r\n1.Mahasiswa\r\n(manajemen, \r\npelayanan, dan\r\npembelajaran),\r\n</p><p>2.Dosen (manajemen, \r\npenelitian, dan PkM),</p><p>\r\n3.Tenaga kependidikan\r\n(manajemen),\r\n</p><p>4.Lulusan / alumni \r\n(manajemen, \r\npembelajaran, \r\nkompetensi),\r\n</p><p>5.Pengguna lulusan\r\n(manajemen dan \r\nkompetensi),\r\n</p><p>6.Mitra kerja sama\r\n(manajemen, \r\npembelajaran, \r\npenelitian, PkM)\r\n</p><p>pada UPPS yang\r\nmemenuhi aspek-aspek \r\nberikut:</p><p>\r\n1) instrumen sahih, andal, \r\nmudah digunakan,</p><p>\r\n2) dilaksanakan secara \r\nberkala dan komprehensif, </p><p>\r\n3) dilakukan analisis untuk \r\npengambilan keputusan, \r\ndan\r\n</p><p>4) monitoring dan evaluasi\r\nterhadap pelaksanaan.</p><p>\r\n5) terdapat umpan balik.\r\n</p><p>6) tindak lanjut terhadap \r\numpan balik.<br></p>', '2023-05-10 10:52:29', '2023-05-10 10:52:29', null, '0.91', null, null);
INSERT INTO `indikator` VALUES ('280', '121', '<p>2.7 </p><p>Pengukuran kepuasan \r\nlayanan manajemen&nbsp;terhadap para pemangku \r\nkepentingan:</p><p>\r\n1.Mahasiswa\r\n(manajemen, \r\npelayanan, dan\r\npembelajaran),\r\n</p><p>2.Dosen (manajemen, \r\npenelitian, dan PkM),</p><p>\r\n3.Tenaga kependidikan\r\n(manajemen),\r\n</p><p>4.Lulusan / alumni \r\n(manajemen, \r\npembelajaran, \r\nkompetensi),\r\n</p><p>5.Pengguna lulusan\r\n(manajemen dan \r\nkompetensi),\r\n</p><p>6.Mitra kerja sama\r\n(manajemen, \r\npembelajaran, \r\npenelitian, PkM)\r\n</p><p>pada UPPS yang\r\nmemenuhi aspek-aspek \r\nberikut:</p><p>\r\n1) instrumen sahih, andal, \r\nmudah digunakan,</p><p>\r\n2) dilaksanakan secara \r\nberkala dan komprehensif, </p><p>\r\n3) dilakukan analisis untuk \r\npengambilan keputusan, \r\ndan\r\n</p><p>4) monitoring dan evaluasi\r\nterhadap pelaksanaan.</p><p>\r\n5) terdapat umpan balik.\r\n</p><p>6) tindak lanjut terhadap \r\numpan balik.<br></p>', '2023-05-10 06:53:58', '2023-05-10 10:53:58', '2023-05-10 10:53:58', '0.91', null, null);
INSERT INTO `indikator` VALUES ('281', '121', '<p>2.8 </p><p>Mutu, manfaat, \r\nkepuasan dan \r\nkeberlanjutan kerja sama\r\npendidikan, penelitian dan \r\nPkM yang relevan dengan \r\nprogram studi pada UPPS. \r\nUnit pengelola memiliki\r\nbukti yang sahih terkait \r\nkerja sama yang ada telah \r\nmemenuhi 4 aspek berikut: </p><p>\r\n1) memberikan manfaat \r\nbagi PS dalam pemenuhan \r\nproses pembelajaran, \r\npenelitian, PkM.\r\n</p><p>2) memberikan \r\npeningkatan kinerja\r\ntridarma dan fasilitas \r\npendukung PS.&nbsp;</p><p>3) memberikan kepuasan\r\nkepada mitra. </p><p>\r\n4) menjamin keberlanjutan\r\nkerja sama dan hasilnya<br></p>', '2023-05-10 10:54:59', '2023-05-10 10:54:59', null, '0.91', null, null);
INSERT INTO `indikator` VALUES ('282', '122', '<p>3.1.2.1 </p><p>Data seluruh \r\nmahasiswa pada Program \r\nStudi.\r\nRasio calon mahasiswa \r\nyang ikut seleksi terhadap \r\ndaya tampung dalam lima\r\ntahun terakhir<br></p>', '2023-05-10 11:07:47', '2023-05-10 11:07:47', null, '0.42', null, null);
INSERT INTO `indikator` VALUES ('283', '41', '<p>Profil Unit\r\nPengelola\r\nProgram\r\nStudi&nbsp;<br></p>', '2023-05-10 12:18:15', '2023-05-10 12:18:15', null, '6', null, null);
INSERT INTO `indikator` VALUES ('284', '123', '<p>2.1&nbsp;Keberadaan\r\nsistem tata\r\npamong\r\nyang\r\nmenjamin\r\npenyelengg\r\naraan UPPS\r\nyang baik. </p>', '2023-05-10 08:20:47', '2023-05-10 12:20:47', null, '3', null, null);
INSERT INTO `indikator` VALUES ('285', '123', '<p>2.2&nbsp;Peran UPPS\r\ndalam\r\nkepemimpinan yang\r\nefektif.\r\n</p>', '2023-05-10 08:20:52', '2023-05-10 12:20:52', null, '2', null, null);
INSERT INTO `indikator` VALUES ('286', '123', '<p>2.3&nbsp;Sistem\r\npengelolaan\r\nfungsional\r\ndan\r\noperasional\r\nUPPS\r\nmencakup:\r\nplanning,\r\norganizing,\r\nstaffing,\r\nleading,\r\ncontrolling\r\nyang efektif\r\ndilaksanaka\r\nn.\r\n</p>', '2023-05-10 12:20:41', '2023-05-10 12:20:41', null, '3', null, null);
INSERT INTO `indikator` VALUES ('287', '123', '<p>2.4&nbsp;Keterlaksan\r\naan Sistem\r\nPenjaminan\r\nMutu\r\nInternal\r\n(akademik\r\ndan non\r\nakademik) .</p>', '2023-05-10 12:21:25', '2023-05-10 12:21:25', null, '6', null, null);
INSERT INTO `indikator` VALUES ('288', '123', '<p>2.5&nbsp;Kerjasama\r\npendidikan,\r\npenelitian,\r\ndan PkM\r\nyang\r\nrelevan\r\ndengan\r\nprogram\r\nstudi\r\ndan dikelola\r\noleh UPPS\r\ndalam 3\r\ntahun\r\nterakhir.\r\n</p>', '2023-05-10 12:21:38', '2023-05-10 12:21:38', null, '3', null, null);
INSERT INTO `indikator` VALUES ('289', '123', '<p>2.6&nbsp;Kerjasama\r\ntingkat\r\ninternasion\r\nal, nasional,\r\nwilayah/lok\r\nal yang\r\nrelevan\r\ndengan\r\nprogram\r\nstudi dan\r\ndikelola\r\noleh\r\nUPPS dalam\r\n3 tahun\r\nterakhir</p>', '2023-05-10 12:21:58', '2023-05-10 12:21:58', null, '3', null, null);
INSERT INTO `indikator` VALUES ('290', '123', '<p>2.7&nbsp;Siklus\r\nPenjaminan\r\nMutu\r\n(PPEPP)\r\nberjalan\r\ndengan\r\nefektif</p>', '2023-05-10 12:22:08', '2023-05-10 12:22:08', null, '4', null, null);
INSERT INTO `indikator` VALUES ('291', '124', '<p>3.1&nbsp;Kebijakan\r\nyang\r\nditetapkan\r\nperguruan\r\ntinggi\r\nterkait\r\nkemahasisw\r\naan</p><p>Deskripsi dokumen formal\r\nkebijakan yang mencakup\r\naspek:\r\na) Metoda rekrutmen dan\r\nsistem seleksi\r\nb) Layanan\r\nkemahasiswaan yang\r\ndapat diberikan dalam\r\nbentuk: kegiatan\r\npengembangan\r\nkemampuan penalaran,\r\nminat dan bakat, kegiatan\r\nbimbingan karir dan\r\nkewirausahaan, serta\r\nkegiatan peningkatan\r\nkesejahteraan (bimbingan\r\ndan konseling, beasiswa,\r\ndan kesehatan)<br></p>', '2023-05-10 08:30:08', '2023-05-10 12:30:08', null, '2', null, null);
INSERT INTO `indikator` VALUES ('292', '124', '<p>3.2&nbsp;Kualitas\r\nInput\r\nMahasiswa</p><p>Efektivitas implementasi\r\nsistem rekrutmen dan\r\nseleksi calon mahasiswa.\r\nuntuk menghasilkan calon\r\nmahasiswa yang bermutu\r\nyang diukur dari keketatan\r\nseleksi.\r\nNisbah jumlah mahasiswa\r\nyang lulus seleksi dalam 5\r\ntahun terakhir dengan\r\ncalon ma<br></p>', '2023-05-10 08:30:57', '2023-05-10 12:30:57', null, '3', null, null);
INSERT INTO `indikator` VALUES ('293', '124', '<p>3.3&nbsp;Upaya\r\nPeningkata\r\nn Animo.</p>', '2023-05-10 08:33:02', '2023-05-10 12:33:02', null, '2', null, null);
INSERT INTO `indikator` VALUES ('294', '124', '<p>3.4&nbsp;Jenis\r\nLayanan\r\ndan kualitas\r\nlayanan\r\nkepada\r\nmahasiswa</p><p>Ketersediaan layanan\r\nkepada mahasiswa antara\r\nlain:\r\na) Bimbingan dan\r\nkonseling,\r\nb) Minat dan bakat (ekstra\r\nkurikuler),\r\nc) Pembinaan soft skill,\r\nd) Layanan beasiswa,\r\ne) Layanan keseha<br></p>', '2023-05-10 08:33:16', '2023-05-10 12:33:16', null, '3', null, null);
INSERT INTO `indikator` VALUES ('295', '124', '<p>3.5&nbsp;Unit\r\nKegiatan\r\nMahasiswa.</p><p>A. Jumlah UKM bidang INFOKOM yang di kelola oleh dosen sesuai bidang ilmu</p>', '2023-05-16 02:57:55', '2023-05-16 06:57:54', null, '2', null, null);
INSERT INTO `indikator` VALUES ('296', '124', '<p>3.5&nbsp;Unit\r\nKegiatan\r\nMahasiswa</p><p>B. Pelaksanaan, dan\r\nKebermanfaatan UKM\r\nbidang INFOKOM bagi\r\nmahasiswa<br></p>', '2023-05-16 02:59:49', '2023-05-16 06:59:49', null, '2', null, null);
INSERT INTO `indikator` VALUES ('297', '124', '<p>3.6&nbsp;Keaktifan mahasiswa dalam unit kegiatan<br></p>', '2023-05-16 02:59:29', '2023-05-16 06:59:29', null, '4', null, null);
INSERT INTO `indikator` VALUES ('298', '125', '<p>4.1 A. Syarat\r\nperlu dosen\r\ntetap yang\r\nditugaskan\r\ndi program\r\nstudi.</p><p>\r\nJumlah dosen tetap\r\nPerguruan Tinggi yang\r\nmengajar di program studi\r\nyang sesuai dengan bidang\r\nkeilmuan program studi<br></p>', '2023-05-10 12:39:19', '2023-05-10 12:39:19', null, '4', null, null);
INSERT INTO `indikator` VALUES ('299', '125', '<p>4.1B. Dosen\r\ntetap yang\r\nberpendidik\r\nan S3 yang\r\nbidang\r\nkeahliannya\r\nbidang\r\nINFOKOM\r\natau S3 non\r\nINFOKOM\r\ntetapi\r\nmemiliki\r\ntrack record\r\npenelitian\r\nkompetitif\r\ndi tingkat\r\nNasional\r\nselama 5\r\ntahun\r\nterakhir\r\nbidang\r\ninfokom\r\n(sebagai\r\nKetua\r\nPeneliti<br></p>', '2023-05-10 09:02:49', '2023-05-10 13:02:49', null, '4', null, null);
INSERT INTO `indikator` VALUES ('300', '125', '<p>4.2Beban DTPS\r\nSebagai\r\nPembimbin\r\ng utama&nbsp;&nbsp;Skripsi/\r\nTugas Akhir</p><p>Jumlah mahasiswa\r\nbimbingan dari DTPS\r\npembimbing utama pada\r\nseluruh Program Studi&nbsp;Jika RMB &lt;= 6, skor =4\r\nRMB = rata2 jumlah\r\nmahasiswa bimbingan dari\r\nDTPS pembimbing utama\r\npada seluruh Program\r\nStudi\r\n<br></p>', '2023-05-10 08:45:19', '2023-05-10 12:45:19', null, '2', null, null);
INSERT INTO `indikator` VALUES ('301', '125', '<p>4.3 Beban\r\nDosen\r\nTetap\r\nProgram\r\nStudi\r\n(EWMP)&nbsp;</p><p>Rata-rata beban dosen\r\ntetap PS per semester,\r\natau rata-rata EWMP\r\n(Ekuivalensi Waktu\r\nMengajar Penuh meliputi\r\ntugas tridarma dan tugas\r\nmanajemen lain)<br></p>', '2023-05-10 12:45:09', '2023-05-10 12:45:09', null, '2', null, null);
INSERT INTO `indikator` VALUES ('302', '125', '<p>4.4&nbsp;A.\r\nKesesuaian\r\nMata Kuliah\r\ndan\r\nKeahlian\r\nDosen\r\n</p>', '2023-05-10 12:57:50', '2023-05-10 12:57:50', null, '3', null, null);
INSERT INTO `indikator` VALUES ('303', '125', '<p>4.4&nbsp;B.\r\nKesesuaian\r\nkeahlian\r\n(pend.\r\nterakhir\r\npenugasan,\r\njabfung)\r\ndosen tetap\r\n(DTPS)\r\ndengan MK\r\nyang\r\ndiajarkanny\r\na.\r\n</p>', '2023-05-10 12:58:08', '2023-05-10 12:58:08', null, '3', null, null);
INSERT INTO `indikator` VALUES ('304', '125', '<p>4.5&nbsp;Profesionali\r\nsme Dosen</p>', '2023-05-10 12:58:24', '2023-05-10 12:58:24', null, '3', null, null);
INSERT INTO `indikator` VALUES ('305', '125', '<p>4.6&nbsp;Dosen tetap\r\n(DTPS)\r\nmemiliki\r\nminimal 1\r\nsertifikasi\r\nprofesi\r\ntingkat\r\nnasional/\r\nInternasion\r\nal\r\n</p>', '2023-05-10 12:58:47', '2023-05-10 12:58:47', null, '3', null, null);
INSERT INTO `indikator` VALUES ('306', '125', '<p>4.7&nbsp;Pelaksanaa\r\nn\r\nmonitoring\r\ndan\r\nevaluasi\r\nkinerja\r\ndosen di\r\nbidang\r\ntridharma.</p><p>Ada bukti tentang\r\npengukuran, evaluasi dan\r\nperbaikan kinerja dosen\r\nyang memenuhi 5 aspek\r\nberikut\r\na) ada kebijakan tentang\r\nmonitoring dan evaluasi\r\nkinerja dosen di bidang\r\ntridharma.\r\nb) ada bukti pelaksanaan\r\nmonitoring dan evaluasi\r\nkinerja bidang pendidikan.\r\nc) ada bukti pelaksanaan\r\nmonitoring dan evaluasi\r\nkinerja bidang penelitian\r\nd) ada bukti pelaksanaan\r\nmonitoring dan evaluasi\r\nkinerja bidang pelayanan/\r\npengabdian kepada\r\nmasyarakat dan\r\ne) terdokumentasi dengan\r\nbaik.&nbsp;<br></p>', '2023-05-10 12:59:33', '2023-05-10 12:59:33', null, '2', null, null);
INSERT INTO `indikator` VALUES ('307', '125', '<p>4.8&nbsp;Peningkata\r\nn\r\nkemampua\r\nn dosen\r\ntetap\r\n(DTPS)\r\nmelalui\r\nprogram\r\ntugas\r\nbelajar\r\ndalam\r\nbidang yang\r\nsesuai\r\ndengan\r\nbidang\r\nInfokom\r\natau\r\nserumpun</p>', '2023-05-10 13:00:01', '2023-05-10 13:00:01', null, '3', null, null);
INSERT INTO `indikator` VALUES ('308', '125', '<p>4.9&nbsp;A. Tenaga\r\nadministrasi\r\n, jumlah dan\r\nkualifikasiny\r\na.</p>', '2023-05-10 13:00:45', '2023-05-10 13:00:45', null, '3', null, null);
INSERT INTO `indikator` VALUES ('309', '125', '<p>4.9&nbsp;B. Tenaga\r\nteknisi,\r\njumlah dan\r\nkualifikasiny\r\na. </p>', '2023-05-10 13:00:56', '2023-05-10 13:00:56', null, '3', null, null);
INSERT INTO `indikator` VALUES ('310', '125', '<p>4.9&nbsp;C.\r\nPustakawan\r\ndan\r\nkualifikasiny\r\na.</p><p>Memiliki minimal 1 tenaga\r\nperpustakaan yang\r\nberijasah minimal Sarjana\r\nilmu perpustakaan untuk\r\nmelayani PS.&nbsp;<br></p><p> </p>', '2023-05-10 09:06:56', '2023-05-10 13:06:56', null, '3', null, null);
INSERT INTO `indikator` VALUES ('311', '125', '<p>4.10&nbsp;Upaya yang\r\ntelah\r\ndilakukan\r\nUPPS untuk\r\nmeningkatk\r\nan\r\nkualifikasi\r\ndan\r\nkompetensi\r\ntenaga\r\nkependidika\r\nn dalam 3\r\ntahun\r\nterakhir</p>', '2023-05-10 13:01:27', '2023-05-10 13:01:27', null, '2', null, null);
INSERT INTO `indikator` VALUES ('312', '125', '<p>4.11&nbsp;Siklus\r\nPenjaminan\r\nMutu\r\n(PPEPP)\r\nberjalan\r\ndengan\r\nefektif</p><p>Siklus Penjaminan Mutu\r\n(PPEPP) berjalan dengan\r\nefektif apabila semua\r\ntahapan PPEPP dijalankan\r\ndengan baik.&nbsp;<br></p>', '2023-05-10 09:08:11', '2023-05-10 13:08:11', null, '4', null, null);
INSERT INTO `indikator` VALUES ('313', '126', '<p>5.1&nbsp;Pengelolaan\r\nkeuangan\r\nUPPS dan\r\nProgram\r\nStudi</p><p>Pengelolaan keuangan\r\nUPPS mencakup aspek (a)\r\nperencanaan, (b)\r\npengalokasian, (c)\r\nrealisasi, dan (d)\r\npertanggung-jawaban&nbsp;biaya operasional\r\ntridharma serta investasi\r\n&nbsp;<br></p><p>\r\n</p>', '2023-05-10 13:55:05', '2023-05-10 13:55:05', null, '2', null, null);
INSERT INTO `indikator` VALUES ('314', '126', '<p>5.2&nbsp;Perolehan\r\ndana dari\r\nmahasiswa</p>', '2023-05-10 13:55:26', '2023-05-10 13:55:26', null, '2', null, null);
INSERT INTO `indikator` VALUES ('315', '126', '<p>5.3&nbsp;Aksesibilitas\r\ndata dalam\r\nsistem\r\ninformasi</p>', '2023-05-10 13:55:36', '2023-05-10 13:55:36', null, '2', null, null);
INSERT INTO `indikator` VALUES ('316', '126', '<p>5.4&nbsp;Penggunaan\r\ndan\r\nketersediaa\r\nn\r\nbandwidth.\r\n</p>', '2023-05-10 13:55:45', '2023-05-10 13:55:45', null, '2', null, null);
INSERT INTO `indikator` VALUES ('317', '126', '<p>5.5&nbsp;Pendayagun\r\naan sarana\r\nutama\r\nlaboratoriu\r\nm, beserta\r\nkelayakan\r\npenggunaan\r\ndengan\r\nmempertim\r\nbangkan\r\njumlah\r\nmahasiswa</p>', '2023-05-10 13:55:56', '2023-05-10 13:55:56', null, '2', null, null);
INSERT INTO `indikator` VALUES ('318', '126', '<p>5.6&nbsp;Kecukupan,\r\nAksesibilitas\r\ndan Mutu\r\nSarana,\r\nPrasarana</p><p>Ketersediaan dan\r\nkelengkapan jenis\r\nprasarana, sarana serta\r\ndana yang memungkinkan\r\nterciptanya interaksi\r\nakademik antara sivitas\r\nakademika (misalnya\r\ntempat olah raga, ruang\r\nbersama, ruang himpunan\r\nmahasiswa, poliklinik,\r\nruang dosen , kantor,\r\nruang kelas, ruang\r\nlaboratorium, ruang\r\nperpustakaan )<br></p>', '2023-05-16 03:57:48', '2023-05-16 07:57:48', null, '2', null, null);
INSERT INTO `indikator` VALUES ('319', '126', '<p>5.7&nbsp;Fasilitas\r\nLaboratoriu\r\nm untuk\r\nkeahlian\r\nInfokom.</p>', '2023-05-10 13:56:17', '2023-05-10 13:56:17', null, '2', null, null);
INSERT INTO `indikator` VALUES ('320', '126', '<p>5.8&nbsp;A. Sumber\r\npustaka\r\nberupa\r\njurnal\r\nInternasion\r\nal bidang\r\nInfokom</p>', '2023-05-10 13:56:33', '2023-05-10 13:56:33', null, '3', null, null);
INSERT INTO `indikator` VALUES ('321', '126', '<p>5.8&nbsp;B. Sumber\r\npustaka\r\nberupa\r\njurnal\r\nilmiah\r\nnasional\r\nbidang ilmu\r\ninfokom yg\r\nterakreditas\r\ni Sinta.\r\n</p>', '2023-05-10 13:56:44', '2023-05-10 13:56:44', null, '3', null, null);
INSERT INTO `indikator` VALUES ('322', '126', '<p>5.8&nbsp;C. Sumber\r\npustaka\r\nberupa\r\nbuku teks\r\ndan lain-lain\r\ndalam\r\nbidang I\r\nnfokom.\r\n</p>', '2023-05-10 13:56:56', '2023-05-10 13:56:56', null, '3', null, null);
INSERT INTO `indikator` VALUES ('323', '126', '<p>5.9&nbsp;Lisensi/\r\nOpensource\r\nsoftware</p>', '2023-05-10 13:57:06', '2023-05-10 13:57:06', null, '1', null, null);
INSERT INTO `indikator` VALUES ('324', '126', '<p>5.10&nbsp;Siklus\r\nPenjaminan\r\nMutu\r\n(PPEPP)\r\nberjalan\r\ndengan\r\nefektif</p><p>Siklus Penjaminan Mutu\r\n(PPEPP) berjalan dengan\r\nefektif apabila semua\r\ntahapan PPEPP dijalankan\r\ndengan baik.&nbsp;<br></p>', '2023-05-10 13:57:23', '2023-05-10 13:57:23', null, '4', null, null);
INSERT INTO `indikator` VALUES ('325', '127', '<p>6.1&nbsp;A. Perumusan\r\nkurikulum\r\nProgram Studi</p><p>Kelengkapan perumusan\r\nkurikulum berdasarkan\r\nKKNI/OBE/SKKNI, dan\r\ndilengkapi dengan Deskripsi\r\nmatakuliah, Silabus, RPS, CP.<br></p>', '2023-05-10 14:02:51', '2023-05-10 14:02:51', null, '5', null, null);
INSERT INTO `indikator` VALUES ('326', '127', '<p>6.1&nbsp;B. Substansi\r\nMata kuliah\r\nBidang\r\nInfokom yang\r\nmengacu pada\r\ncapaian\r\npembelajaran\r\n(CPL)\r\n</p>', '2023-05-10 14:03:10', '2023-05-10 14:03:10', null, '5', null, null);
INSERT INTO `indikator` VALUES ('327', '127', '<p>6.1&nbsp;C.\r\nKetersediaan\r\ndan\r\nkelengkapan\r\ndokumen\r\nRencana\r\nPembelajaran\r\nSemester\r\n(RPS)</p><p>RPS memuat 9 aspek berikut:\r\n</p><p>a. nama Program Studi, nama\r\ndan kode mata kuliah,\r\nsemester, sks, nama Dosen\r\npengampu;\r\n</p><p>b. capaian Pembelajaran\r\nlulusan yang dibebankan\r\npada mata kuliah;\r\n</p><p>c. kemampuan akhir yang\r\ndirencanakan pada tiap tahap\r\nPembelajaran untuk\r\nmemenuhi capaian\r\nPembelajaran lulusan;\r\n</p><p>d. bahan kajian yang terkait\r\ndengan kemampuan yang\r\nakan dicapai;\r\n</p><p>e. metode Pembelajaran;</p><p>\r\nf. waktu yang disediakan untuk\r\nmencapai\r\nkemampuan pada tiap tahap\r\nPembelajaran;\r\n</p><p>g. pengalaman belajar\r\nmahasiswa yang diwujudkan\r\ndalam deskripsi tugas yang\r\nharus dikerjakan oleh\r\nmahasiswa selama satu\r\nsemester;</p><p>h. kriteria, indikator, dan\r\nbobot penilaian; dan\r\ni. daftar referensi yang\r\ndigunakan.</p><p> </p>', '2023-05-10 14:04:07', '2023-05-10 14:04:07', null, '5', null, null);
INSERT INTO `indikator` VALUES ('328', '127', '<p>6.1&nbsp;D. Penyusunan\r\nmateri kuliah.</p><p>Materi kuliah disusun dengan\r\nmemperhatikan aspek\r\nberikut:\r\na) capaian pembelajaran\r\nlulusan (CPL),\r\nb) disusun oleh kelompok\r\ndosen\r\nc) memperhatikan keunikan\r\ndan keunggulan program\r\nstudi.\r\nd) masukan dari pemangku\r\nkepentingan eksternal<br></p><p> </p>', '2023-05-10 14:04:26', '2023-05-10 14:04:26', null, '5', null, null);
INSERT INTO `indikator` VALUES ('329', '127', '<p>6.1&nbsp;E. Peninjauan\r\nKurikulum</p><p>Pelaksanaan peninjauan\r\nkurikulum sudah memasukkan\r\n5 aspek berikut :\r\na) keterlibatan pihak external\r\ndan internal,\r\nb) kesesuaian dengan visi\r\nkeilmuan program studi,\r\nc) memperhitungkan CP,\r\nd) kesesuaian dengan\r\nkemajuan Iptek Bidang\r\nInfokom,\r\ne) kesesuaian dengan\r\nkebutuhan DU/DI.&nbsp;<br></p>', '2023-05-10 14:04:42', '2023-05-10 14:04:42', null, '5', null, null);
INSERT INTO `indikator` VALUES ('330', '127', '<p>6.2&nbsp;A. Pelaksanaan\r\npengambilan\r\nmata kuliah\r\ndalam bentuk\r\nkegiatan\r\nmerdeka\r\nbelajar\r\nkampus\r\nmerdeka</p>', '2023-05-10 14:04:55', '2023-05-10 14:04:55', null, '3', null, null);
INSERT INTO `indikator` VALUES ('331', '127', '<p>B. Jumlah\r\nmahasiswa\r\nyang\r\nmengikuti\r\nkegiatan\r\nmerdeka\r\nbelajar\r\nkampus\r\nmerdeka<br></p>', '2023-05-10 14:05:06', '2023-05-10 14:05:06', null, '3', null, null);
INSERT INTO `indikator` VALUES ('332', '127', '<p>6.3&nbsp;Kegiatan\r\nPraktikum</p><p>Substansi mata kuliah\r\npraktikum dan pelaksanaan\r\npraktikum, beserta kualitas\r\nmodul praktikumnya sejalan\r\ndengan mata kuliahnya. masing-masing\r\ndiberi skor (0-4): <br></p>', '2023-05-16 04:05:33', '2023-05-16 08:05:32', null, '2', null, null);
INSERT INTO `indikator` VALUES ('333', '127', '<p>6.4&nbsp;A. Sistem\r\nPembelajaran\r\nmenggunakan\r\nE-learning</p><p>Pembelajaran menggunakan\r\nSistem e-learning yang\r\nmemiliki fasilitas:\r\na) upload download materi\r\nb) digital content\r\nc) forum diskusi\r\nd) evaluasi pembelajaran\r\ne) RPS&nbsp;<br></p>', '2023-05-10 14:05:31', '2023-05-10 14:05:31', null, '2', null, null);
INSERT INTO `indikator` VALUES ('334', '127', '<p>6.4&nbsp;B. Pelaksanaan\r\nMata kuliah\r\nblended\r\nlearning</p>', '2023-05-10 14:05:41', '2023-05-10 14:05:41', null, '2', null, null);
INSERT INTO `indikator` VALUES ('335', '127', '<p>6.5&nbsp;A. Evaluasi\r\nPembelajaran</p>', '2023-05-10 14:05:54', '2023-05-10 14:05:54', null, '3', null, null);
INSERT INTO `indikator` VALUES ('336', '127', '<p>6.5&nbsp;B.\r\nTransparansi\r\nevaluasi\r\npembelajaran</p><p>Transparansi hasil evaluasi\r\npembelajaran, disosialisasikan,\r\ndan dilaksanakan dengan\r\nketerbukaan penilaian\r\npembelajaran (nilai\r\ndiumumkan melalui Sistem\r\nInformasi).\r\nAda kebijakan yang memuat\r\ntransparansi hasil evaluasi\r\npembelajaran dan\r\ndisosialisasikan.&nbsp;<br></p>', '2023-05-10 14:06:14', '2023-05-10 14:06:14', null, '3', null, null);
INSERT INTO `indikator` VALUES ('337', '127', '<p>6.6&nbsp;Pembimbingan\r\nAkademik.</p><p>Pelaksanaan Pembimbingan\r\nAkademik (PA) melalui\r\npertemuan langsung dan/ atau\r\nlewat SI Akademik, dengan\r\nmempertimbangkan intensitas\r\n/ tingkat penggunaan SI\r\nAkademik di Program Studi\r\ntersebut.\r\nSkor 4 jika pembimbingan\r\nmemenuhi 5 kriteria :\r\na) dilakukan seluruhnya oleh\r\ndosen PA\r\nb)tersedia buku panduan PA,\r\nc) Pelaksanaan sesuai panduan\r\nPA,\r\nd) PA terekam secara kontinu\r\ne) PA menggunakan Sistem\r\nInformasi Akademik.&nbsp;<br></p>', '2023-05-10 14:06:41', '2023-05-10 14:06:41', null, '2', null, null);
INSERT INTO `indikator` VALUES ('338', '127', '<p>6.7&nbsp;A. Panduan\r\nSkripsi/ Tugas\r\nAkhir.</p><p>Ketersediaan panduan skripsi/\r\ntugas akhir, sosialisasi, dan\r\npelaksanaan yang\r\nmemanfaatkan Sistem\r\nInformasi.&nbsp;<br></p>', '2023-05-10 14:06:57', '2023-05-10 14:06:57', null, '2', null, null);
INSERT INTO `indikator` VALUES ('339', '127', '<p>6.7&nbsp;B. Penilaian\r\nSkripsi/ Tugas\r\nAkhir.</p>', '2023-05-10 14:07:14', '2023-05-10 14:07:14', null, '2', null, null);
INSERT INTO `indikator` VALUES ('340', '127', '<p>6.8&nbsp;Pelaksanaan\r\nmonitoring\r\ndan evaluasi\r\npembelajaran. </p>', '2023-05-10 14:07:24', '2023-05-10 14:07:24', null, '2', null, null);
INSERT INTO `indikator` VALUES ('341', '127', '<p>6.9&nbsp;Pelaksanaan\r\nperbaikan\r\nsistem\r\npembelajaran</p><p>Pelaksanaan perbaikan sistem\r\npembelajaran yang telah\r\ndilakukan selama tiga tahun\r\nterakhir berkaitan dengan\r\naspek:\r\n(a) Materi pembelajaran,\r\n(b) Metode pembelajaran,\r\n(c) Penggunaan teknologi\r\npembelajaran,\r\n(d) Cara-cara evaluasi.\r\n(e) Perolehan umpan balik dari&nbsp;Dosen dan mahasiswa\r\n(f) Perolehan umpan balik dari\r\nalumni dan pengguna lulusan&nbsp;<br></p>', '2023-05-10 14:07:49', '2023-05-10 14:07:49', null, '2', null, null);
INSERT INTO `indikator` VALUES ('342', '127', '<p>6.10&nbsp;A. Integrasi\r\nhasil\r\npenelitian\r\nuntuk proses\r\npembelajaran</p>', '2023-05-10 14:07:59', '2023-05-10 14:07:59', null, '2', null, null);
INSERT INTO `indikator` VALUES ('343', '127', '<p>6.10&nbsp;B. Integrasi\r\nhasil\r\nPengabdian\r\nkepada\r\nMasyarakat\r\n(PkM)</p>', '2023-05-10 14:08:07', '2023-05-10 14:08:07', null, '2', null, null);
INSERT INTO `indikator` VALUES ('344', '127', '<p>6.11&nbsp;Kebijakan\r\ntentang\r\nsuasana\r\nakademik</p><p>Kebijakan tertulis tentang\r\nsuasana akademik mencakup\r\ninformasi:\r\na) otonomi keilmuan,\r\nb) kebebasan akademik,\r\nc) kebebasan mimbar\r\nakademik,\r\nd) kemitraan dosen&nbsp;mahasiswa\r\ne) dilaksanakan secara\r\nkonsisten.\r\nSkor 4 jika Kebijakan tertulis\r\ntentang suasana akademik\r\nmencakup:\r\na) otonomi keilmuan,\r\nb) kebebasan akademik,\r\nc) kebebasan mimbar\r\nakademik,\r\nd) kemitraan dosenmahasiswa\r\ndan\r\ne) dilaksanakan secara\r\nkonsisten<br></p>', '2023-05-10 14:08:31', '2023-05-10 14:08:31', null, '2', null, null);
INSERT INTO `indikator` VALUES ('345', '127', '<p>6.12&nbsp;Siklus\r\nPenjaminan\r\nMutu (PPEPP)\r\nberjalan\r\ndengan efektif</p><p>Siklus Penjaminan Mutu\r\n(PPEPP) berjalan dengan\r\nefektif apabila semua tahapan\r\nPPEPP dijalankan dengan baik<br></p>', '2023-05-10 14:08:45', '2023-05-10 14:08:45', null, '5', null, null);
INSERT INTO `indikator` VALUES ('346', '128', '<p>7.1&nbsp;Keberadaan lembaga\r\npenelitian, peta jalan\r\npenelitian dan standar\r\npenelitian.\r\n</p>', '2023-05-10 14:19:18', '2023-05-10 14:19:18', null, '2', null, null);
INSERT INTO `indikator` VALUES ('347', '128', '7.2&nbsp;Perencanaan,\r\npelaksanaan,\r\npemantauan, dan\r\npelaporan penelitian', '2023-05-10 14:19:30', '2023-05-10 14:19:30', null, '2', null, null);
INSERT INTO `indikator` VALUES ('348', '128', '<p>7.3&nbsp;Monitoring dan evaluasi\r\npenelitian dosen yang\r\nmelibatkan reviewer\r\nyang kompeten pada\r\nbidang infokom</p><p>Monitoring dan evaluasi\r\nkegiatan penelitian\r\nmelibatkan reviewer yang\r\nkompeten pada bidang\r\nInfokom.&nbsp;<br></p>', '2023-05-10 14:19:45', '2023-05-10 14:19:45', null, '2', null, null);
INSERT INTO `indikator` VALUES ('349', '128', '<p>7.4&nbsp;A. Keterlibatan\r\nmahasiswa yang\r\nmelakukan tugas akhir\r\ndalam penelitian dosen</p>', '2023-05-16 04:15:33', '2023-05-16 08:15:32', null, '3', null, null);
INSERT INTO `indikator` VALUES ('350', '128', '<p>7.4 B Penelitian Dosen</p>', '2023-05-16 04:17:10', '2023-05-16 08:17:09', null, '3', null, null);
INSERT INTO `indikator` VALUES ('351', '129', '<p>Keberadaan lembaga\r\npengabdian kepada\r\nmasyarakat.<br></p>', '2023-05-10 14:22:32', '2023-05-10 14:22:32', null, '2', null, null);
INSERT INTO `indikator` VALUES ('352', '129', '<p>Perencanaan,\r\npelaksanaan,\r\npemantauan, dan\r\npelaporan PkM.<br></p>', '2023-05-10 14:22:37', '2023-05-10 14:22:37', null, '2', null, null);
INSERT INTO `indikator` VALUES ('353', '129', '<p>A. Pelaksanaan PkM\r\nDosen dan Mahasiswa</p>', '2023-05-16 04:21:35', '2023-05-16 08:21:35', null, '2', null, null);
INSERT INTO `indikator` VALUES ('354', '129', '<p>B. Pelaksanaan PkM\r\nDosen, pada TS sd TS -2<br></p>', '2023-05-16 04:23:29', '2023-05-16 08:23:28', null, '2', null, null);
INSERT INTO `indikator` VALUES ('355', '129', '<p>nisbah (%) jumlah mahasiswa yg terlibat dalam kegiatan PkM thd jumlah mahasiswa aktif pada TS.<br></p>', '2023-05-16 04:23:15', '2023-05-16 08:23:14', null, '3', null, null);
INSERT INTO `indikator` VALUES ('356', '129', '<p>Jumlah kegiatan pengabdian kepada masyarakat (PkM) berdasarkan sumber dana PkM<br></p>', '2023-05-16 04:23:02', '2023-05-16 08:23:02', null, '2', null, null);
INSERT INTO `indikator` VALUES ('357', '129', '<p>Monitoring dan evaluasi pengabdian kepada masyarakat oleh dosen melibatkan reviewer yang memenuhi syarat sebagai reviewer pengabdian kepada masyarakat bidang INFOKOM. Reviewer minimal ditetapkan oleh pimpinan institusi.<br></p>', '2023-05-16 04:22:50', '2023-05-16 08:22:50', null, '2', null, null);
INSERT INTO `indikator` VALUES ('358', '130', '<p>Pemenuhan\r\ncapaian\r\npembelajaran\r\nlulusan<br></p>', '2023-05-10 14:26:52', '2023-05-10 14:26:52', null, '8', null, null);
INSERT INTO `indikator` VALUES ('359', '130', '<p>Rata-rata\r\nIndeks Prestasi\r\nKumulatif\r\n(RIPK) selama\r\ntiga tahun\r\nterakhir.<br></p>', '2023-05-10 14:26:59', '2023-05-10 14:26:59', null, '8', null, null);
INSERT INTO `indikator` VALUES ('360', '130', '<p>Prestasi\r\nmahasiswa\r\ndalam\r\nmendapatkan\r\npenghargaan\r\nhibah\r\nkompetitif di\r\nBidang\r\nInfokom\r\ntingkat\r\nNasional (mis.\r\nProgram\r\nKreativitas\r\nMahasiswa,\r\nPIMNAS, dan\r\nlain-lain)<br></p>', '2023-05-10 14:27:07', '2023-05-10 14:27:07', null, '8', null, null);
INSERT INTO `indikator` VALUES ('361', '130', '<p>Prestasi\r\nmahasiswa\r\ndalam\r\nmendapatkan\r\npenghargaan\r\nhibah\r\nkompetitif\r\ntingkat\r\nInternasional<br></p>', '2023-05-10 14:27:14', '2023-05-10 14:27:14', null, '8', null, null);
INSERT INTO `indikator` VALUES ('362', '130', '<p>Prestasi\r\nmahasiswa\r\ndalam lomba\r\ntingkat\r\nNasional/Inter\r\nnasional\r\nUrutan bobot:\r\n- Nalar di\r\nbidang\r\nInfokom\r\n- Nalar di\r\nbidang nonInfokom\r\n- Selain Nalar\r\n(olahraga, seni,&nbsp;dsb).\r\n- kesetaraan 1\r\ninternasional =\r\n3 nasional\r\nPenilaian\r\ndidasarkan\r\natas jumlah\r\npenghargaan\r\ndibagi jumlah\r\nmhs.\r\n<br></p>', '2023-05-10 14:27:28', '2023-05-10 14:27:28', null, '8', null, null);
INSERT INTO `indikator` VALUES ('363', '130', '<p>Persentase\r\nkelulusan tepat\r\nwaktu (KTW)&nbsp;<br></p>', '2023-05-10 14:27:34', '2023-05-10 14:27:34', null, '8', null, null);
INSERT INTO `indikator` VALUES ('364', '130', '<p>Persentase\r\nmahasiswa\r\nyang tidak\r\nberhasil\r\nmenyelesaikan\r\nstudi sampai\r\nbatas akhir\r\nstudi (TBMS).<br></p>', '2023-05-10 14:27:43', '2023-05-10 14:27:43', null, '8', null, null);
INSERT INTO `indikator` VALUES ('365', '130', '<p>Pelaksanaan\r\npelacakan dan\r\nperekaman\r\ndata lulusan\r\ndengan\r\nmemanfaatkan\r\nSI dan T<br></p>', '2023-05-10 14:27:49', '2023-05-10 14:27:49', null, '8', null, null);
INSERT INTO `indikator` VALUES ('366', '130', '<p>Penggunaan\r\nhasil pelacakan\r\nuntuk\r\nperbaikan:\r\na) proses\r\npembelajaran,\r\nb)\r\npenggalangan\r\ndana, c)\r\ninformasi\r\npekerjaan, dan\r\nd) membangun\r\njejaring.<br></p>', '2023-05-10 14:27:58', '2023-05-10 14:27:58', null, '8', null, null);
INSERT INTO `indikator` VALUES ('367', '130', '<p>Kepuasaan\r\npengguna\r\nlulusan (jumlah\r\nresponden yg\r\nmemberi\r\npenilaian harus\r\nmemenuhi\r\njumlah\r\nminimal\r\ntertentu).&nbsp;<br></p>', '2023-05-10 14:28:06', '2023-05-10 14:28:06', null, '8', null, null);
INSERT INTO `indikator` VALUES ('368', '130', '<p>RMT (Rata-rata\r\nmasa tunggu\r\nlulusan untuk\r\nbekerja). Jika\r\nProgram Studi\r\nkedinasan yang\r\nlulusannya\r\nsemua sudah\r\nbekerja saat\r\nkuliah, masa&nbsp;tunggu diisi\r\nnol. <br></p>', '2023-05-10 10:28:26', '2023-05-10 14:28:26', null, '8', null, null);
INSERT INTO `indikator` VALUES ('369', '130', '<p>Persentase\r\nkesesuaian\r\nbidang kerja\r\ndengan bidang\r\nstudi (keahlian)\r\nlulusan.\r\nKisaran\r\nkesesuaian 0-\r\n100%.&nbsp;<br></p>', '2023-05-10 14:28:34', '2023-05-10 14:28:34', null, '8', null, null);
INSERT INTO `indikator` VALUES ('370', '130', '<p>Jumlah lulusan\r\nyang bekerja di\r\nbadan usaha\r\ntingkat\r\nmultinasional/\r\ninternasional,\r\nnasional/\r\nberwirausaha\r\nyang berizin/\r\nbadan usaha\r\ntingkat\r\nwilayah/ lokal/\r\nberwirausaha\r\ntidak berizin (3\r\ntahun\r\nterakhir).\r\npa =\r\npersentase\r\njumlah lulusan\r\nyg di badan\r\nusaha /\r\ninstansi tingkat\r\nmultinasional/\r\ninternasional,\r\npb =\r\npersentase\r\njumlah lulusan\r\nyg di badan\r\nusaha /\r\ninstansi tingkat\r\nnasional\r\n(dalam negeri)\r\npc =&nbsp;&nbsp;persentase\r\njumlah lulusan\r\nyg\r\nberwirausaha<br></p>', '2023-05-10 14:28:56', '2023-05-10 14:28:56', null, '8', null, null);
INSERT INTO `indikator` VALUES ('371', '130', '<p>Penjaringan\r\numpan balik\r\nuntuk\r\npeningkatan\r\nmutu program\r\nstudi. Ada\r\nsumber umpan\r\nbalik, cara\r\nmemperoleh\r\numpan balik,\r\ntindak lanjut\r\ndari umpan\r\nbalik, waktu,\r\nbukti,\r\nketerangan.\r\nAda dokumen\r\nresmi umpan\r\nbalik<br></p>', '2023-05-10 14:29:05', '2023-05-10 14:29:05', null, '7', null, null);
INSERT INTO `indikator` VALUES ('372', '130', '<p>Persentase\r\njumlah\r\npenelitian TA\r\nmahasiswa di\r\nProgram Studi\r\nyang diadopsi\r\ndan\r\ndimanfaatkan\r\nlangsung oleh\r\nmasyarakat&nbsp;<br></p>', '2023-05-10 14:29:12', '2023-05-10 14:29:12', null, '8', null, null);
INSERT INTO `indikator` VALUES ('373', '130', '<p>Hasil skripsi/\r\nTA mahasiswa\r\nyang relevan\r\ndengan\r\nCPL Program\r\nStudi.&nbsp;<br></p>', '2023-05-10 14:29:18', '2023-05-10 14:29:18', null, '8', null, null);
INSERT INTO `indikator` VALUES ('374', '130', '<p>Sertifikasi\r\nprofesi Bidang\r\nInfokom untuk\r\nlulusan.<br></p>', '2023-05-10 14:29:24', '2023-05-10 14:29:24', null, '8', null, null);
INSERT INTO `indikator` VALUES ('375', '130', '<p>Karya-karya\r\nmahasiswa\r\nmandiri atau\r\nbersama dosen\r\nyang telah\r\nmemperoleh\r\nperlindungan\r\nHak atas\r\nKekayaan\r\nIntelektual\r\n(HaKI) dalam\r\ntiga tahun\r\nterakhir.<br></p>', '2023-05-10 14:29:31', '2023-05-10 14:29:31', null, '8', null, null);
INSERT INTO `indikator` VALUES ('376', '130', '<p>Keterkaitan\r\npeta jalan\r\npenelitian\r\nlembaga\r\ndengan hasil\r\npenelitian\r\nDTPS/\r\nmahasiswa\r\nyang telah\r\ndilaksanakan.<br></p>', '2023-05-10 14:29:40', '2023-05-10 14:29:40', null, '8', null, null);
INSERT INTO `indikator` VALUES ('377', '130', '<p>Hasil\r\npengabdian\r\nkepada\r\nmasyarakat\r\nyang relevan\r\ndengan bidang\r\ninfokom.&nbsp;<br></p>', '2023-05-10 14:29:51', '2023-05-10 14:29:51', null, '8', null, null);
INSERT INTO `indikator` VALUES ('378', '130', '<p>Jumlah\r\nprestasi\r\nmahasiswa\r\ndalam\r\nmendapatkan\r\npenghargaan\r\nhibah kegiatan\r\nProgram\r\nKreativitas\r\nMahasiswa\r\n(PKM) dari\r\ntingkat lokal,\r\nnasional,\r\ninternasional.&nbsp;<br></p>', '2023-05-10 14:30:01', '2023-05-10 14:30:01', null, '8', null, null);
INSERT INTO `indikator` VALUES ('379', '130', '<p>Prestasi\r\nmahasiswa\r\ndalam\r\nmendapatkan\r\npenghargaan\r\nhibah\r\npendanaan\r\nkegiatan\r\npengabdian\r\nkepada\r\nmasyarakat\r\ndari tingkat\r\nlokal, dan\r\nnasional.&nbsp;</p><p>Catatan:&nbsp;selama tiga\r\ntahun terakhir.\r\na,b,c,d dalam\r\njutaan rupiah,\r\ndalam 3 tahun\r\nterakhir&nbsp;<br></p>', '2023-05-10 10:30:32', '2023-05-10 14:30:32', null, '8', null, null);
INSERT INTO `indikator` VALUES ('380', '130', '<p>Jumlah mitra\r\ndari institusi\r\nlain dalam\r\nkegiatan PkM\r\ndan tingkat\r\nkepuasan serta\r\nkebermanfaata\r\nn kegiatannya\r\nbagi mitra.&nbsp;<br></p>', '2023-05-10 14:30:41', '2023-05-10 14:30:41', null, '8', null, null);
INSERT INTO `indikator` VALUES ('381', '130', '<p>Siklus\r\nPenjaminan\r\nMutu (PPEPP)\r\nberjalan\r\ndengan efektif<br></p>', '2023-05-10 14:30:49', '2023-05-10 14:30:49', null, '8', null, null);
INSERT INTO `indikator` VALUES ('383', '131', '<p>Mata Kuliah\r\nInti/Khas Sistem\r\nInformasi&nbsp;<br></p>', '2023-05-10 14:40:17', '2023-05-10 14:40:17', null, '5', null, null);
INSERT INTO `indikator` VALUES ('384', '131', '<p>Mata kuliah\r\nDomain Spesifik\r\ndan Lingkungan\r\nSistem Informasi.&nbsp;<br></p>', '2023-05-10 14:40:24', '2023-05-10 14:40:24', null, '5', null, null);
INSERT INTO `indikator` VALUES ('385', '131', '<p>Mata kuliah terkait\r\nMetode atau\r\nAnalisis Kuantitatif\r\nyang Relevan\r\ndengan Bidang\r\nSistem Informasi.<br></p>', '2023-05-10 14:40:32', '2023-05-10 14:40:32', null, '5', null, null);
INSERT INTO `indikator` VALUES ('386', '131', '<p>Proyek utama\r\n(Capstone Project)\r\nyang Relevan\r\ndengan Bidang\r\nSistem Informasi.<br></p>', '2023-05-10 14:40:37', '2023-05-10 14:40:37', null, '5', null, null);
INSERT INTO `indikator` VALUES ('387', '131', '<p>&nbsp;</p>', '2023-05-10 14:41:11', '2023-05-10 14:41:11', null, '5', null, null);
INSERT INTO `indikator` VALUES ('388', '132', '<p>Mata Kuliah\r\nInti/Khas Teknologi\r\nInformasi<br></p>', '2023-05-10 14:44:52', '2023-05-10 14:44:52', null, '5', null, null);
INSERT INTO `indikator` VALUES ('389', '132', '<p>Mata kuliah Pilihan\r\nDomain Spesifik\r\ndan Lingkungan\r\nTeknologi\r\nInformasi&nbsp;<br></p>', '2023-05-10 14:45:02', '2023-05-10 14:45:02', null, '5', null, null);
INSERT INTO `indikator` VALUES ('390', '132', '<p>Mata kuliah terkait\r\nMatematika dan\r\nIlmu Dasar yang\r\nRelevan dengan\r\nBidang Teknologi\r\nInformasi.&nbsp;<br></p>', '2023-05-10 14:45:09', '2023-05-10 14:45:09', null, '5', null, null);
INSERT INTO `indikator` VALUES ('391', '132', '<p>Proyek utama\r\n(Capstone project)\r\nyang Relevan\r\ndengan Bidang\r\nTeknologi\r\nInformasi.<br></p>', '2023-05-10 14:45:17', '2023-05-10 14:45:17', null, '5', null, null);
INSERT INTO `indikator` VALUES ('392', '132', '<p>Pengembangan\r\nTeknologi\r\nInformasi Dalam\r\nRangka Pengabdian\r\nkepada Masyarakat<br></p>', '2023-05-10 14:45:24', '2023-05-10 14:45:24', null, '5', null, null);
INSERT INTO `indikator` VALUES ('393', '133', '<p>Mata Kuliah-mata\r\nkuliah Inti/Khas\r\nIlmu Komputer<br></p>', '2023-05-10 14:49:13', '2023-05-10 14:49:13', null, '5', null, null);
INSERT INTO `indikator` VALUES ('394', '133', '<p>Mata kuliah\r\nDomain Spesifik\r\ndan Lingkungan\r\nPengembangan\r\nPerangkat Lunak<br></p>', '2023-05-10 14:49:21', '2023-05-10 14:49:21', null, '5', null, null);
INSERT INTO `indikator` VALUES ('395', '133', '<p>Mata kuliah terkait\r\nMatematika yang\r\nrelevan dengan\r\nbidang ilmu\r\nkomputer<br></p>', '2023-05-10 14:49:33', '2023-05-10 14:49:33', null, '5', null, null);
INSERT INTO `indikator` VALUES ('396', '133', '<p>Proyek utama\r\n(Capstone project)\r\nyang Relevan\r\ndengan Bidang\r\nIlmu Komputer.<br></p>', '2023-05-10 14:49:38', '2023-05-10 14:49:38', null, '5', null, null);
INSERT INTO `indikator` VALUES ('397', '133', '<p>Pengembangan\r\nPerangkat Lunak&nbsp;Dalam Rangka\r\nPengabdian kepada\r\nMasyarakat.&nbsp;<br></p>', '2023-05-10 14:49:49', '2023-05-10 14:49:49', null, '5', null, null);
INSERT INTO `indikator` VALUES ('398', '134', '<p>Mata Kuliah\r\nInti/Khas Sistem\r\nKomputer.</p><p>UPPS menguraikan\r\nstruktur kurikulum yang\r\nmemuat mata kuliah inti\r\nSistem Komputer yang\r\nmencakup:\r\n(1) algoritma komputasi\r\ndan desain perangkat\r\nlunak.\r\n(2) desain digital,\r\nrangkaian dan elektronika,\r\ndan pengolahan sinyal. (3)\r\narsitektur dan organisasi\r\nkomputer, jaringan\r\nkomputer, manajemen\r\nsumber daya sistem dan\r\nkeamanan informasi,\r\n(4) sistem tertanam,\r\n(5) implementasi dan\r\npemeliharaan komponen\r\nperangkat lunak dan\r\nperangkat keras dari\r\nsistem komputasi modern\r\ndan peralatan yang\r\ndikendalikan komputer,\r\ndan\r\n(6) proyek utama (major\r\nprojects) yang merupakan\r\nintegrasi dan penerapan\r\npengetahuan dan\r\nketerampilan yang\r\ndiperoleh dari tugas-tugas\r\nmata kuliah sebelumnya.\r\n(7) Minimal 30 sks&nbsp;dan dilengkapi RPS yang\r\nmemuat CPMK yang sesuai\r\ndengan CPL\r\nSkor 4 jika UPPS\r\nmenguraikan struktur\r\nkurikulum yang memuat\r\nmata-kuliah inti Sistem\r\nKomputer yang mencakup\r\n7 aspek. <br></p>', '2023-05-10 14:54:13', '2023-05-10 14:54:13', null, '5', null, null);
INSERT INTO `indikator` VALUES ('399', '134', '<p>Mata Kuliah\r\nPraktikum atau\r\nBermuatan\r\nPraktikum&nbsp;</p><p>UPPS menguraikan\r\nstruktur kurikulum yang\r\nmemuat mata kuliah-mata\r\nkuliah praktikum atau\r\nbermuatan praktikum yang\r\nmencakup:\r\n(1) praktikum inti:\r\npraktikum rangkaian dan\r\nelektronika, praktikum\r\nlogika digital dan desain\r\nsistem, praktikum sistem\r\ntertanam.\r\n(2) praktikum semi-inti:\r\npraktikum jaringan dan\r\npraktikum desain\r\nperangkat lunak.\r\n(3) praktikum tambahan:\r\npraktikum desain\r\narsitektur komputer, dan\r\npraktikum pengolahan\r\nsinyal digital.\r\n(4) praktikum tambahan\r\nyang disarankan:&nbsp;praktikum sistem operasi,\r\npraktikum robotika, dll\r\n(5) Minimal 18 sks\r\ndan dilengkapi dengan\r\npenjelasan yang mencakup\r\ndeskripsi, konfigurasi, dan\r\npenyelenggaraan khas\r\nuntuk laboratorium,\r\ntermasuk tools dan paket\r\nperangkat lunak yang\r\ndigunakan di laboratorium.\r\nSkor 4 jika UPPS\r\nmenguraikan struktur\r\nkurikulum yang memuat\r\nmata kuliah-mata kuliah\r\npraktikum atau bermuatan\r\npraktikum yang mencakup\r\n5 aspek.<br></p>', '2023-05-10 14:54:34', '2023-05-10 14:54:34', null, '5', null, null);
INSERT INTO `indikator` VALUES ('400', '134', '<p>Mata Kuliah terkait\r\nMatematika yang\r\nRelevan dengan\r\nBidang Sistem\r\nKomputer.</p><p>UPPS menguraikan\r\nstruktur kurikulum yang\r\nmemuat mata kuliah\r\nterkait matematika yang\r\nmencakup:\r\n(1) matematika,\r\n(2) aljabar linier, analisis\r\nfungsi kontinu, probabilitas\r\n&amp; statistik\r\n(3) Minimal 4 sks\r\ndan dilengkapi RPS yang\r\nmemuat CPMK yang\r\nrelevan dengan CPL.&nbsp;Skor 4 jika UPPS\r\nmenguraikan struktur\r\nkurikulum yang memuat\r\nmata-kuliah terkait\r\nmatematika yang\r\nmencakup 3 aspek. <br></p>', '2023-05-10 14:54:51', '2023-05-10 14:54:51', null, '5', null, null);
INSERT INTO `indikator` VALUES ('401', '134', '<p>Proyek utama\r\n(Capstone Project)\r\nyang Relevan\r\ndengan Bidang\r\nSistem Komputer</p><p>Program Studi\r\nmenguraikan pelaksanaan\r\nproyek utama (Capstone\r\nProject) yang merupakan\r\nintegrasi dan penerapan\r\npengetahuan dan\r\nketerampilan yang\r\ndiperoleh dari tugas-tugas\r\nmata kuliah sebelumnya\r\nyang mencakup:\r\n(1) Panduan pelaksanaan\r\n(2) Daftar mata kuliah\r\nterkait proyek utama\r\n(3) Standar minimal\r\nkualitas rancangan sistem\r\nkomputasi dan komponen\r\nkomputasi dari hasil\r\nproyek.\r\nProyek ini bisa merupakan\r\nbagian dari kurikulum\r\nreguler maupun kurikulum\r\nMerdeka Belajar-Kampus\r\nMerdeka (MBKM)<br></p>', '2023-05-10 14:55:05', '2023-05-10 14:55:05', null, '5', null, null);
INSERT INTO `indikator` VALUES ('402', '134', '<p>Pengembangan\r\nPerangkat Keras\r\nDalam Rangka\r\nPengabdian kepada\r\nMasyarakat.</p><p>Program Studi\r\nmenguraikan upaya yang\r\ntelah dilakukan UPPS\r\ndalam rangka\r\npengembangan perangkat\r\nkeras yang digunakan di\r\nmasyarakat dan pemangku\r\nkepentingan pada suatu\r\ndomain (Misalnya:\r\nkesehatan, keuangan, dll.)\r\nyang mencakup aspek\r\n(1) Kebijakan berupa\r\npedoman pelaksanaan.\r\n(2) Pelaksanaan\r\n(3) Kesesuaian dengan\r\npeta jalan PKM dan/atau\r\npeta jalan penelitian\r\n(4) Sumber pendanaan\r\ndan efektivitas dan\r\nkeberlanjutan.<br></p>', '2023-05-10 14:55:19', '2023-05-10 14:55:19', null, '5', null, null);
INSERT INTO `indikator` VALUES ('403', '135', '<p>Mata Kuliah\r\nInti Rekayasa\r\nPerangkat\r\nLunak</p><p>UPPS menguraikan struktur\r\nkurikulum yang memuat daftar\r\nmata kuliah inti rekayasa\r\nPerangkat Lunak yang mencakup\r\nbidang kompetensi/\r\npengetahuan: (1) Pemodelan dan\r\nanalisis perangkat lunak,\r\n(2) Analisis dan spesifikasi\r\nkebutuhan (requirements),\r\n(3) Verifikasi dan validasi\r\nperangkat lunak,\r\n(4) Desain/ Perancangan\r\nPerangkat Lunak,\r\n(5) Kualitas Perangkat Lunak,\r\n(6) Proses Perangkat Lunak,\r\n(7) Keamanan Perangkat Lunak\r\n(a.l. Dasar-dasar keamanan,\r\nkeamanan jaringan dan\r\ncomputer, pengembangan\r\nperangkat lunak yang aman), dan\r\n(8) proyek utama (major projects)\r\nyang merupakan integrasi dan\r\npenerapan pengetahuan dan\r\nketerampilan yang diperoleh dari\r\ntugas-tugas mata kuliah&nbsp;sebelumnya.\r\n(9) Minimal 30 sks\r\ndan dilengkapi RPS yang memuat\r\nCPMK yang relevan dengan CPL<br></p>', '2023-05-10 14:58:46', '2023-05-10 14:58:46', null, '5', null, null);
INSERT INTO `indikator` VALUES ('404', '135', '<p>Mata Kuliah\r\nDasar-dasar\r\nKomputasi\r\ndan Praktek\r\nProfesional di\r\nBidang RPL.</p><p>Program Studi menguraikan\r\nstruktur kurikulum yang memuat\r\ndaftar mata kuliah Dasar-Dasar\r\nKomputasi dan Praktek\r\nProfesional di Bidang Rekayasa\r\nPerangkat Lunak yang mencakup\r\nbidang kompetensi/\r\npengetahuan:\r\n(1) Dasar-dasar Komputasi (min\r\n10 sks): 1.1 Dasar-dasar Ilmu\r\nKomputer (a.l. dasar-dasar\r\npemrograman, algoritma,\r\nstruktur data &amp; kompleksitas,\r\ndasar bahasa pemrograman,\r\norganisasi komputer &amp; sistem\r\noperasi, dasar-dasar basis data,\r\ndll.), 1.2 Teknologi konstruksi (a.l.\r\ndesain dan penggunaan API,\r\n‘reuse’ kode dan pustaka,\r\nmasalah runtime berorientasi\r\nobjek metode konstruksi untuk\r\nsoftware terdistribusi, dll. ), 1.3.\r\nTool-tool konstruksi (a.l.&nbsp;Lingkungan pengembangan,\r\nframeworks dan tools antarmuka\r\npengguna, tools pengujian unit).\r\n(2) Praktek Professional (min 2\r\nsks): 2.1 keterampilan Komunikasi\r\nKhusus RPL, 2.2 Profesionalisme .\r\n(3) Minimal 12 sks\r\ndan dilengkapi RPS yang memuat\r\nCPMK yang sesuai dengan CPL.&nbsp;<br></p>', '2023-05-10 14:59:07', '2023-05-10 14:59:07', null, '5', null, null);
INSERT INTO `indikator` VALUES ('405', '135', '<p>Mata kuliah\r\nDasar-dasar\r\nMatematika\r\ndan Teknik\r\nyang Relevan\r\ndengan\r\nBidang\r\nRekayasa\r\nPerangkat\r\nlunak.&nbsp;</p><p>Program Studi menguraikan\r\nstruktur kurikulum yang memuat\r\ndaftar mata kuliah dasar-dasar\r\nmatematika dan teknik yang\r\nmencakup bidang kompetensi/\r\npengetahuan:\r\n(1) Dasar-dasar matematika (a.l.\r\nmatematika diskrit, statistik dan\r\nprobabilitas diskrit, grammer,\r\notomata, teknik pembuktian\r\n(Proof techniques), dll),\r\n(2) Dasar rekayasa untuk\r\nperangkat lunak (a.l. teori\r\npengukuran, metode empiris dan\r\nteknik eksperimental, desain\r\nteknik, dll.,&nbsp;(3) Ekonomi teknik untuk\r\nperangkat lunak (a.l.\r\nPertimbangan nilai selama siklus\r\nhidup perangkat lunak,\r\nMengevaluasi solusi hemat biaya)\r\n(4) Minimal 12 sks\r\ndan dilengkapi RPS yang memuat\r\nCPMK yang relevan dengan CPL<br></p>', '2023-05-10 14:59:23', '2023-05-10 14:59:23', null, '5', null, null);
INSERT INTO `indikator` VALUES ('406', '135', '<p>Proyek Utama\r\n(Capstone\r\nProject) yang\r\nRelevan\r\ndengan\r\nBidang\r\nRekayasa\r\nPerangkat\r\nLunak.</p><p>Program Studi menguraikan\r\npelaksanaan proyek utama\r\n(Capstone projects) yang\r\nmerupakan integrasi dan\r\npenerapan pengetahuan dan\r\nketerampilan yang diperoleh dari\r\ntugas-tugas mata kuliah\r\nsebelumnya yang mencakup:\r\n(1) Panduan pelaksanaan\r\n(2) Mata kuliah-mata kuliah\r\nterkait proyek utama\r\n(3) Standar minimal kualitas\r\nProduk Perangkat Lunak dari\r\nhasil proyek.\r\nProyek ini bisa merupakan bagian\r\ndari kurikulum reguler maupun\r\nkurikulum Merdeka BelajarKampus Merdeka (MBKM)&nbsp;<br></p>', '2023-05-10 14:59:44', '2023-05-10 14:59:44', null, '5', null, null);
INSERT INTO `indikator` VALUES ('407', '135', '<p>Pengembanga\r\nn Perangkat\r\nLunak dalam\r\nrangka\r\nPengabdian\r\nkepada\r\nMasyarakat</p><p>Program Studi menguraikan\r\nupaya yang telah dilakukan dalam\r\nrangka pengembangan Produk\r\nPerangkat Lunak (Software\r\nProduct) yang digunakan di\r\nmasyarakat dan pemangku\r\nkepentingan pada suatu domain\r\n(misalnya: kesehatan, keuangan,\r\ndll.) yang mencakup aspek\r\n(1) Kebijakan berupa pedoman\r\npelaksanaan.\r\n(2) Pelaksanaan.\r\n(3) Kesesuaian dengan peta jalan\r\nPKM dan/atau peta jalan\r\npenelitian\r\n(4) Sumber pendanaan\r\ndan efektivitas dan keberlanjutan\r\nyang telah dilakukan.&nbsp;<br></p>', '2023-05-10 14:59:55', '2023-05-10 14:59:55', null, '5', null, null);
INSERT INTO `indikator` VALUES ('408', '136', '<p>Analisis\r\nCapaian Kinerja&nbsp;</p><p>Kelengkapan, keluasan,\r\nkedalaman, ketepatan, dan\r\nketajaman analisis untuk\r\nmengidentifikasi akar masalah\r\nyang didukung oleh\r\ndata/informasi yang andal dan\r\nmemadai serta konsisten\r\ndengan hasil analisis yang\r\ndisampaikan pada setiap\r\nkriteria<br></p>', '2023-05-11 02:04:14', '2023-05-11 02:04:14', null, '3', null, null);
INSERT INTO `indikator` VALUES ('409', '136', '<p>Analisis SWOT\r\natau Analisis\r\nLain yang\r\nRelevan</p><p>Kekuatan atau faktor\r\npendorong, kelemahan atau\r\nfaktor penghambat, peluang\r\ndan ancaman yang dihadapi\r\ndalam keterkaitannya dengan\r\nhasil analisis capaian kinerja.\r\nHasil identifikasi tersebut\r\ndianalisis untuk menentukan\r\nposisi UPPS dan program studi\r\nyang diakreditasi, serta\r\nmenjadi dasar untuk&nbsp;mendapatkan alternatif solusi\r\ndan menetapkan program\r\npengembangan.&nbsp;<br></p>', '2023-05-11 02:04:37', '2023-05-11 02:04:37', null, '3', null, null);
INSERT INTO `indikator` VALUES ('410', '136', '<p>Strategi\r\nPengembangan</p><p>Kemampuan UPPS dalam\r\nmenetapkan strategi dan\r\nprogram pengembangan\r\nberdasarkan prioritas sesuai&nbsp;dengan kapasitas, kebutuhan,\r\ndan VMT UPPS secara\r\nkeseluruhan, terutama\r\npengembangan program studi\r\nyang diakreditasi. &nbsp;<br></p>', '2023-05-11 02:04:59', '2023-05-11 02:04:59', null, '3', null, null);
INSERT INTO `indikator` VALUES ('411', '136', '<p>Program\r\nKeberlanjutan</p><p>Program pengembangan dan\r\npraktik baik yang dihasilkan\r\ndapat dijamin\r\nkeberlangsunganny. Jelaskan\r\npula jaminan ketersediaan\r\nsumberdaya untuk\r\nmendukung pelaksanaan\r\nprogram termasuk rencana&nbsp;penjaminan mutu yang\r\nberkelanjutan.\r\n&nbsp;<br></p>', '2023-05-11 02:05:21', '2023-05-11 02:05:21', null, '3', null, null);
INSERT INTO `indikator` VALUES ('412', '122', '<p>3.1.2.2 Persentase \r\nmahasiswa asing baru \r\nterhadap total mahasiswa \r\nbaru dalam lima tahun \r\nterakhir&nbsp;<br></p>', '2023-05-11 10:33:44', '2023-05-11 10:33:44', null, '0.21', null, null);
INSERT INTO `indikator` VALUES ('413', '122', '<p>3.1.2.3 Rasio total\r\nmahasiswa baru pada TS, \r\nterhadap total mahasiswa \r\ndalam lima tahun terakhir.<br></p>', '2023-05-11 10:34:42', '2023-05-11 10:34:42', null, '0.42', null, null);
INSERT INTO `indikator` VALUES ('414', '122', '<p>3.1.3 Hasil pengukuran \r\nkepuasan mahasiswa \r\nterhadap proses \r\npendidikan.<br></p>', '2023-05-11 10:36:06', '2023-05-11 10:36:06', null, '1.27', null, null);
INSERT INTO `indikator` VALUES ('415', '137', '<p>3.2</p><p> Upaya yang dilakukan \r\nUPPS untuk meningkatkan \r\nanimo calon mahasiswa\r\ndan bukti keberhasilannya, \r\ndengan memenuhi aspek \r\nberikut:\r\n</p><p>1) dilaksanakan setiap \r\ntahun,\r\n</p><p>2) dilakukan monitoring dan\r\nevaluasi terhadap hasil, </p><p>\r\n3) terdapat umpan balik,</p><p>\r\n4) dilakukan tindak lanjut<br></p>', '2023-05-11 10:38:28', '2023-05-11 10:38:28', null, '0.85', null, null);
INSERT INTO `indikator` VALUES ('416', '137', '<p>3.3 </p><p>Akses dan mutu\r\nlayanan bidang penalaran, \r\nminat bakat, kesehatan, \r\nbeasiswa, bimbingan dan \r\nkonseling, serta asrama\r\npada UPPS, dengan \r\nmemenuhi aspek berikut:\r\n</p><p>1) pelaksanaan,\r\n</p><p>2) dilakukan monitoring dan \r\nevaluasi terhadap hasil,</p><p> \r\n3) terdapat umpan balik,</p><p>\r\n4) dilakukan tindak lanjut.<br></p>', '2023-05-11 10:45:50', '2023-05-11 10:45:50', null, '0.85', null, null);
INSERT INTO `indikator` VALUES ('417', '137', '<p>3.4 </p><p>Audit internal terhadap \r\nsistem seleksi mahasiswa\r\ndan layanan mahasiswa \r\npada Unit Pengelola \r\nProgram Studi\r\nKriteria penilaian:</p><p>\r\n• Ada panduan \r\npenerimaan \r\nmahasiswa\r\n</p><p>• Ada bukti\r\npelaksanaan audit \r\ninternal sistem seleksi \r\nmahasiswa dan \r\nlayanan mahasiswa\r\n</p><p>• Ada bukti tindaklanjut \r\nuntuk perbaikan \r\nsistem seleksi \r\nmahasiswa dan&nbsp;layanan mahasiswa<br></p>', '2023-05-11 06:49:00', '2023-05-11 10:49:00', null, '0.42', null, null);
INSERT INTO `indikator` VALUES ('418', '138', '<p>4.1.1.1 Persentase dosen \r\ntetap UPPS dengan \r\njabatan minimal lektor \r\nkepala.<br></p>', '2023-05-11 10:53:11', '2023-05-11 10:53:11', null, '0.44', null, null);
INSERT INTO `indikator` VALUES ('419', '138', '<p>4.1.1.2 Persentase dosen \r\ntetap UPPS yang \r\nberpendidikan S-3/Sp-2<br></p>', '2023-05-11 10:53:52', '2023-05-11 10:53:52', null, '0.44', null, null);
INSERT INTO `indikator` VALUES ('420', '139', '<p>4.1.2.1 </p><p>Persentase dosen \r\ntetap yang memiliki \r\njabatan akademik minimal \r\nlektor kepala yang bidang \r\nkeahliannya sesuai \r\ndengan program studi.<br></p>', '2023-05-11 11:13:07', '2023-05-11 11:13:07', null, '0.44', null, null);
INSERT INTO `indikator` VALUES ('421', '139', '<p>4.1.2.2 Persentase dosen \r\ntetap yang berpendidikan \r\nS-3/Sp-2 sesuai bidang&nbsp;keahlian program studi.<br></p>', '2023-05-11 11:14:50', '2023-05-11 11:14:50', null, '0.89', null, null);
INSERT INTO `indikator` VALUES ('422', '139', '<p>4.1.2.3 Persentase dosen \r\ntetap yang memiliki \r\nSertifikat Pendidik/ \r\nSertifikat Dosen.<br></p>', '2023-05-11 11:15:29', '2023-05-11 11:15:29', null, '0.44', null, null);
INSERT INTO `indikator` VALUES ('423', '139', '<p>4.1.2.4 Persentase dosen \r\ntetap yang memiliki \r\nSertifikat \r\nKompetensi/Surat Tanda \r\nRegistrasi/Keahlian \r\nsesuai bidang ilmu.<br></p>', '2023-05-11 11:16:32', '2023-05-11 11:16:32', null, '0.44', null, null);
INSERT INTO `indikator` VALUES ('424', '139', '<p>4.1.2.5 Rasio mahasiswa \r\nterhadap dosen yang \r\nbidang keahliannya \r\nsesuai dengan bidang \r\nprogram studi (RMD).&nbsp;<br></p>', '2023-05-11 11:17:10', '2023-05-11 11:17:10', null, '0.89', null, null);
INSERT INTO `indikator` VALUES ('425', '141', '<p>4.1.3 Rata-rata beban \r\ndosen per semester, atau \r\nrata-rata FTE (Fulltime \r\nTeaching Equivalent)&nbsp;<br></p>', '2023-05-11 11:18:36', '2023-05-11 11:18:36', null, '0.44', null, null);
INSERT INTO `indikator` VALUES ('426', '142', '<p>4.1.4 Kegiatan dosen \r\ntetap yang bidang\r\nkeahliannya sesuai \r\ndengan program studi \r\ndalam seminar ilmiah/ \r\nlokakarya/ penataran/ \r\npameran yang tidak \r\nhanya melibatkan dosen \r\nPT sendiri.<br></p>', '2023-05-11 11:19:45', '2023-05-11 11:19:45', null, '0.89', null, null);
INSERT INTO `indikator` VALUES ('427', '143', '<p>4.2.1 Persentase jumlah \r\ndosen tidak tetap, \r\nterhadap jumlah seluruh \r\ndosen&nbsp;<br></p>', '2023-05-11 18:36:29', '2023-05-11 18:36:29', null, '0.22', null, null);
INSERT INTO `indikator` VALUES ('428', '143', '<p>4.2.2 Dosen tidak tetap \r\nyang memiliki Sertifikat \r\nKompetensi atau sertifikat \r\nsejenis dalam bidangnya.<br></p>', '2023-05-11 18:36:48', '2023-05-11 18:36:48', null, '0.22', null, null);
INSERT INTO `indikator` VALUES ('429', '144', '<p>4.3 Upaya \r\npengembangan dosen \r\noleh UPPS.&nbsp;<br></p>', '2023-05-11 18:38:49', '2023-05-11 18:38:49', null, '1.33', null, null);
INSERT INTO `indikator` VALUES ('430', '144', '<p>4.4 Kualifikasi dan \r\nkecukupan tenaga \r\nkependidikan pada UPPS \r\nberdasarkan jenis \r\npekerjaannya \r\n(administrasi, \r\npustakawan, teknisi, dll.)&nbsp;<br></p>', '2023-05-11 18:41:22', '2023-05-11 18:41:22', null, '0.89', null, null);
INSERT INTO `indikator` VALUES ('431', '144', '<p>4.5 Monitoring dan \r\nevaluasi kinerja dosen \r\nterhadap tridarma dan \r\ntenaga kependidikan \r\ndalam layanan pada \r\nprogram studi yang \r\nmencakup unsur-unsur \r\nsebagai berikut :\r\n</p><p>1. Pengembangan\r\nproses \r\npembelajaran \r\n(penyusunan \r\nkurikulum sampai \r\ndengan evaluasi \r\npembelajaran)&nbsp;</p><p>2. Pelaksanaan \r\nproses \r\npembelajaran\r\n</p><p>3. Memiliki agenda \r\npenelitian\r\n</p><p>4. Melaksanakan\r\npenelitian\r\n</p><p>5. Memiliki agenda \r\nPkM\r\n</p><p>6. Melaksanakan \r\nPkM\r\n</p><p>7. Ditindaklanjuti \r\nuntuk proses \r\nperbaikan \r\ntridarma\r\n<br></p>', '2023-05-11 18:44:54', '2023-05-11 18:44:54', null, '0.89', null, null);
INSERT INTO `indikator` VALUES ('432', '145', '<p>5.1.1 Persentase \r\nperolehan dana dari \r\nmahasiswa \r\ndibandingkan dengan \r\ntotal penerimaan dana \r\n(= PDMHS) di Unit \r\nPengelola Program \r\nStudi selama tiga tahun \r\nterakhir.\r\nDana yang diterima oleh \r\nfakultas dapat berasal \r\ndari:\r\n</p><p>a. Mahasiswa\r\n</p><p>b. Usaha sendiri\r\n</p><p>c. Pemerintah pusat \r\ndan daerah\r\n</p><p>d. Sumber lain<br></p>', '2023-05-11 18:46:53', '2023-05-11 18:46:53', null, '0.62', null, null);
INSERT INTO `indikator` VALUES ('433', '146', '<p>5.1.2.1 Penggunaan \r\ndana untuk operasional \r\n(Pendidikan, Penelitian \r\n&amp; PkM) di Unit \r\nPengelola Program \r\nStudi.<br></p>', '2023-05-11 18:48:32', '2023-05-11 18:48:32', null, '0.93', null, null);
INSERT INTO `indikator` VALUES ('434', '146', '<p>5.1.2.2 Penggunaan \r\ndana investasi \r\n(investasi prasarana, \r\ninvestasi sarana, \r\ninvestasi SDM, dll) di&nbsp;Unit Pengelola Program \r\nStudi.<br></p>', '2023-05-11 18:49:29', '2023-05-11 18:49:29', null, '0.31', null, null);
INSERT INTO `indikator` VALUES ('435', '146', '<p>5.1.2.3 Jumlah dana \r\npenelitian per dosen per \r\ntahun pada unit \r\npengelola program studi \r\nselama tiga tahun \r\nterakhir.&nbsp;<br></p>', '2023-05-11 18:50:07', '2023-05-11 18:50:07', null, '0.62', null, null);
INSERT INTO `indikator` VALUES ('436', '146', '<p>5.1.2.4 Jumlah dana \r\nPkM per dosen per \r\ntahun pada unit \r\npengelola program studi\r\nselama tiga tahun \r\nterakhir.<br></p>', '2023-05-11 18:51:48', '2023-05-11 18:51:48', null, '0.31', null, null);
INSERT INTO `indikator` VALUES ('437', '147', '<p>5.2.1.1 Bahan pustaka \r\nberupa buku teks.\r\nCatatan: minimal tiap \r\ncabang ilmu mempunyai \r\n3 judul buku teks&nbsp;<br></p>', '2023-05-11 18:53:31', '2023-05-11 18:53:31', null, '0.31', null, null);
INSERT INTO `indikator` VALUES ('438', '147', '<p>5.2.1.2 Jumlah jurnal \r\nnasional terakreditasi \r\nyang dimiliki \r\n(berlangganan) dalam \r\ntiga tahun terakhir.\r\nCatatan: Bahan pustaka \r\nberupa jurnal ilmiah\r\nterakreditasi Dikti, \r\ndalam bentuk cetak atau \r\nelektronik<br></p>', '2023-05-11 18:54:21', '2023-05-11 18:54:21', null, '0.31', null, null);
INSERT INTO `indikator` VALUES ('439', '147', '<p>5.2.1.3 Jumlah jurnal \r\ninternasional bereputasi\r\nyang dimiliki \r\n(berlangganan) dalam\r\ntiga tahun terakhir.\r\nCatatan: Bahan pustaka \r\nberupa jurnal ilmiah \r\ninternasional. Setiap \r\ncabang ilmu minimal 1 \r\njurnal<br></p>', '2023-05-11 18:55:31', '2023-05-11 18:55:31', null, '0.31', null, null);
INSERT INTO `indikator` VALUES ('440', '147', '<p>5.2.1.4 Jumlah prosiding \r\nyang dimiliki dalam tiga \r\ntahun terakhir.&nbsp;<br></p>', '2023-05-11 18:56:31', '2023-05-11 18:56:31', null, '0.31', null, null);
INSERT INTO `indikator` VALUES ('441', '147', '<p>5.2.2.1 Ketersediaan, \r\nkecukupan dan \r\nkepemilikan sarana\r\nutama di laboratorium\r\ndengan kriteria sbb:\r\n</p><p>(1) Memiliki 5 jenis \r\nlaboratorium </p><p>\r\n(2) Jenis peralatan \r\nlaboratorium memenuhi \r\nstandar minimal.</p><p><span style=\"font-size: 1rem;\">(3) Jumlah peralatan \r\nlaboratorium memenuhi \r\nstandar minimal\r\n</span></p><p><span style=\"font-size: 1rem;\">(4) Milik sendiri</span><br></p>', '2023-05-11 18:58:14', '2023-05-11 18:58:14', null, '1.86', null, null);
INSERT INTO `indikator` VALUES ('442', '147', '<p>5.2.2.2 Kelayakan, \r\nakses dan \r\npendayagunaan sarana&nbsp;laboratorium dengan \r\nkriteria sbb:\r\n</p><p>1. Kapasitas \r\nlaboratorium per \r\nmahasiswa minimal \r\n2 m2\r\n</p><p>2. Memiliki sistem \r\nperawatan \r\nlaboratorium yang \r\nterdokumentasi\r\n</p><p>3. Aksesibilitas yang \r\nbaik (memiliki \r\nfleksibilitas dalam \r\nmenggunakannya di \r\nluar kegiatan \r\npraktikum yang \r\nterjadwal) .\r\n</p><p>4. Penggunaan \r\nlaboratorium efisien\r\n(rata-rata waktu \r\npenggunaan\r\nminimal 30 jam per \r\nminggu)<br></p>', '2023-05-11 19:00:24', '2023-05-11 19:00:24', null, '1.86', null, null);
INSERT INTO `indikator` VALUES ('443', '148', '<p>5.3 Kecukupan dana \r\nuntuk menjamin\r\noperasional pencapaian\r\ntridarma dan investasi \r\npada UPPS.<br></p>', '2023-05-11 19:02:42', '2023-05-11 19:02:42', null, '1.86', null, null);
INSERT INTO `indikator` VALUES ('444', '148', '<p>5.4 Kecukupan, \r\naksesibilitas dan mutu \r\nsarana dan prasarana \r\nuntuk menjamin \r\npencapaian capaian \r\npembelajaran, \r\npenelitian, PkM, dan \r\nmeningkatkan suasana \r\nakademik pada program \r\nstudi.<br></p>', '2023-05-11 19:04:30', '2023-05-11 19:04:30', null, '2.48', null, null);
INSERT INTO `indikator` VALUES ('445', '148', '<p>5.5 Audit internal \r\nterhadap pengelolaan \r\nkeuangan pada Unit&nbsp;Pengelola Program\r\nStudi.<br></p>', '2023-05-11 19:06:20', '2023-05-11 19:06:20', null, '0.62', null, null);
INSERT INTO `indikator` VALUES ('446', '148', '<p>5.6 Audit internal \r\nterhadap \r\npengelolaan sarana \r\ndan prasarana pada\r\nUnit Pengelola \r\nProgram Studi<br></p>', '2023-05-11 19:06:44', '2023-05-11 19:06:44', null, '0.62', null, null);
INSERT INTO `indikator` VALUES ('447', '149', '<p>6.1.1 Struktur kurikulum, \r\nsubstansi praktikum, dan \r\npelaksanaan praktikum.\r\nCatatan:\r\nPeer group diharapkan \r\nmenentukan modul-modul \r\npraktikum yang harus \r\ndilakukan, syarat minimum \r\nmaupun yang lebih baik.\r\nJika praktikum dilaksanakan di \r\nluar PT, tetapi tersedia MoU, \r\nmaka dianggap memiliki \r\nprasarana dan sarana sendiri<br></p>', '2023-05-12 02:00:49', '2023-05-12 02:00:49', null, '0.99', null, null);
INSERT INTO `indikator` VALUES ('448', '150', '<p>6.2 Kegiatan tenaga ahli/pakar \r\nsebagai pembicara dalam \r\nseminar/pelatihan, \r\npembicara tamu, dsb, dari \r\nluar PT sendiri (tidak \r\ntermasuk dosen tidak tetap)\r\ndalam tiga tahun terakhir.\r\nCatatan: Tenaga ahli dari luar \r\nperguruan tinggi dengan \r\ntujuan untuk pengayaan \r\npengetahuan dan bukan untuk \r\nmengisi kekurangan tenaga \r\npengajar, tidak bekerja secara \r\nrutin.<br></p>', '2023-05-12 02:07:06', '2023-05-12 02:07:06', null, '0.20', null, null);
INSERT INTO `indikator` VALUES ('449', '151', '<p>6.3.1 Rata-rata mahasiswa \r\nper dosen pembimbing tugas \r\nakhir/skripsi(=RMTA)<br></p>', '2023-05-12 02:08:54', '2023-05-12 02:08:54', null, '0.40', null, null);
INSERT INTO `indikator` VALUES ('450', '151', '<p>6.3.2 Rata-rata jumlah \r\npertemuan/pembimbingan \r\nselama penyelesaian \r\nTA/skripsi (=RBTA)<br></p>', '2023-05-12 02:09:54', '2023-05-12 02:09:54', null, '0.20', null, null);
INSERT INTO `indikator` VALUES ('451', '151', '<p>6.3.3 Kualifikasi akademik\r\ndosen pembimbing tugas \r\nakhir/skripsi<br></p>', '2023-05-12 02:10:49', '2023-05-12 02:10:49', null, '0.20', null, null);
INSERT INTO `indikator` VALUES ('452', '151', '<p>6.3.4 Rata-rata waktu \r\npenyelesaian penulisan tugas \r\nakhir/skripsi (=RPTA)<br></p>', '2023-05-12 02:17:30', '2023-05-12 02:17:30', null, '0.20', null, null);
INSERT INTO `indikator` VALUES ('453', '152', '<p>6.4 Keunggulan program studi \r\nmendukung learning\r\noutcome/capaian&nbsp;pembelajaran dan roadmap\r\npenelitian dan pengabdian \r\nkepada masyarakat secara \r\nsignifikan, baik dalam teori, \r\npraktikum, dan praktik. <br></p>', '2023-05-12 02:20:15', '2023-05-12 02:20:15', null, '0.79', null, null);
INSERT INTO `indikator` VALUES ('454', '152', '<p>6.5 Keterlibatan pemangku \r\nkepentingan dalam proses \r\nevaluasi dan pemutakhiran \r\nkurikulum pada program studi.<br></p>', '2023-05-11 22:52:24', '2023-05-12 02:52:24', null, '0.40', null, null);
INSERT INTO `indikator` VALUES ('455', '152', '<p>6.6 Kesesuaian capaian \r\npembelajaran dengan profil \r\nlulusan dan jenjang \r\nKKNI/SKKNI yang sesuai\r\npada program studi.&nbsp;<br></p>', '2023-05-12 02:52:11', '2023-05-12 02:52:11', null, '0.59', null, null);
INSERT INTO `indikator` VALUES ('456', '152', '<p>6.7 Ketepatan struktur \r\nkurikulum dalam pembentukan\r\ncapaian pembelajaran pada \r\nprogram studi. Catatan: \r\ndigambarkan dalam peta \r\nkompetensi.<br></p>', '2023-05-12 02:53:58', '2023-05-12 02:53:58', null, '0.59', null, null);
INSERT INTO `indikator` VALUES ('457', '152', '<p>6.8 Karakteristik proses \r\npembelajaran terdiri atas sifat \r\ninteraktif, holistik, integratif, \r\nsaintifik, kontekstual, tematik, \r\nefektif, kolaboratif, dan \r\nberpusat pada mahasiswa\r\npada program studi.<br></p>', '2023-05-12 02:55:15', '2023-05-12 02:55:15', null, '0.59', null, null);
INSERT INTO `indikator` VALUES ('458', '152', '<p>6.9 Mutu Rencana \r\nPembelajaran Semester \r\n(RPS) dan dukungan \r\ndokumen dengan kedalaman \r\ndan keluasan sesuai dengan \r\ncapaian pembelajaran lulusan\r\npada program studi.\r\n</p><p>Dokumen RPS mencakup:\r\n</p><p>1. Target capaian pembelajaran, </p><p>\r\n2. Bahan kajian, </p><p>\r\n3. Metode pembelajaran </p><p>\r\n4. Waktu dan \r\n tahapan asesmen\r\n</p><p>5. Hasil capaian \r\npembelajaran\r\n</p><p>6. Ditinjau dan disesuaikan \r\nsecara berkala\r\n</p><p>7. Dapat diakses oleh \r\nmahasiswa<br></p>', '2023-05-12 02:56:56', '2023-05-12 02:56:56', null, '0.59', null, null);
INSERT INTO `indikator` VALUES ('459', '152', '<p>6.10 Mutu pelaksanaan\r\npembelajaran meliputi proses \r\ndan hasil belajar mahasiswa \r\nuntuk mengukur ketercapaian \r\ncapaian pembelajaran \r\nberdasarkan prinsip penilaian \r\nyang mencakup:\r\n</p><p>1) edukatif, </p><p>\r\n2) otentik, </p><p>\r\n3) objektif, </p><p>\r\n4) akuntabel, dan </p><p>\r\n5) transparan,\r\nyang dilakukan secara \r\nterintegrasi pada program \r\nstudi.<br></p>', '2023-05-12 02:58:34', '2023-05-12 02:58:34', null, '0.99', null, null);
INSERT INTO `indikator` VALUES ('460', '152', '<p>6.11 Monitoring dan evaluasi \r\npelaksanaan pembelajaran \r\npada program studi mencakup </p><p>\r\n1. Karakteristik,</p><p> \r\n2. Perencanaan,\r\n</p><p>3. Pelaksanaan proses\r\npembelajaran </p><p>\r\n4. Beban belajar mahasiswa</p><p> \r\n5. Dilaksanakan secara \r\nkonsisten\r\n</p><p>6. Ditindaklanjuti\r\nuntuk memperoleh capaian \r\npembelajaran lulusan pada \r\nprogram studi.<br></p>', '2023-05-12 03:00:29', '2023-05-12 03:00:29', null, '0.59', null, null);
INSERT INTO `indikator` VALUES ('461', '152', '<p>6.12 Tindak lanjut dari hasil \r\nmonitoring dan evaluasi \r\nterhadap pelaksanaan proses \r\npembelajaran pada program \r\nstudi.<br></p>', '2023-05-12 03:04:59', '2023-05-12 03:04:59', null, '0.99', null, null);
INSERT INTO `indikator` VALUES ('462', '152', '<p>6.13 Keterlaksanaan dan \r\nkeberkalaan program dan \r\nkegiatan di luar kegiatan \r\npembelajaran terstruktur untuk \r\nmeningkatkan suasana \r\nakademik pada program studi.\r\nContoh: kuliah umum/studium \r\ngenerale, seminar ilmiah,\r\nbedah buku.&nbsp;<br></p>', '2023-05-12 03:07:25', '2023-05-12 03:07:25', null, '0.59', null, null);
INSERT INTO `indikator` VALUES ('463', '153', '<p>7.1 Kegiatan penelitian oleh dosen \r\ntetap di Program Studi dalam tiga\r\ntahun terakhir.\r\nKriteria penilaian:\r\nPenghitungan nilai penelitian yang \r\nsesuai dengan roadmap visi \r\nkeilmuan dan lingkup penelitian.&nbsp;<br></p>', '2023-05-12 03:12:24', '2023-05-12 03:12:24', null, '1.37', null, null);
INSERT INTO `indikator` VALUES ('464', '154', '<p>7.2 Relevansi penelitian pada\r\nprogram studi mencakup unsurunsur sebagai berikut: </p><p>\r\n1) memiliki roadmap penelitian\r\nyang mengacu pada visi keilmuan \r\nprogram studi,</p><p>\r\n2) pelaksanaan penelitian sesuai \r\ndengan roadmap penelitian,\r\n</p><p>3) evaluasi kesesuaian penelitian \r\ndengan roadmap, dan </p><p>\r\n4) tindak lanjut hasil evaluasi \r\nuntuk perbaikan relevansi \r\npenelitian dan pengembangan \r\nkeilmuan.\r\n</p><p>5) Integrasi penelitian pada mata \r\nkuliah.<br></p>', '2023-05-12 03:15:31', '2023-05-12 03:15:31', null, '2.05', null, null);
INSERT INTO `indikator` VALUES ('465', '154', '<p>7.3 Monitoring dan evaluasi terhadap \r\npelaksanaan penelitian dosen dan \r\nmahasiswa pada program studi&nbsp;yang mencakup \r\nunsur-unsur :\r\n</p><p>1) memiliki roadmap penelitian\r\nuntuk dosen dan mahasiswa, </p><p>\r\n2) Dilaksanakan secara konsisten\r\n</p><p>3) evaluasi kesesuaian penelitian\r\ndengan roadmap, dan </p><p>\r\n4) tindak lanjut hasil monitoring \r\ndan evaluasi untuk perbaikan \r\nrelevansi penelitian dan \r\npengembangan keilmuan<br></p>', '2023-05-11 23:18:42', '2023-05-12 03:18:42', null, '1.03', null, null);
INSERT INTO `indikator` VALUES ('466', '155', '<p>8.1 Kegiatan pengabdian kepada \r\nmasyarakat (PkM) oleh dosen tetap di\r\nProgram Studi dalam tiga tahun terakhir \r\n(buat tabel untuk agenda PkM dosen \r\ntetap program studi).\r\nKriteria penilaian:\r\nPenghitungan nilai pengabdian kepada \r\nmasyarakat (PkM) yang sesuai dengan \r\nroadmap visi keilmuan.<br></p>', '2023-05-12 03:19:27', '2023-05-12 03:19:27', null, '1.78', null, null);
INSERT INTO `indikator` VALUES ('467', '156', '<p>8.2 Relevansi PkM pada program studi\r\nmencakup unsur-unsur sebagai \r\nberikut: </p><p>\r\n1) memiliki roadmap yang mengacu \r\npada visi keilmuan PkM untuk dosen \r\ndan mahasiswa.</p><p>2) pelaksanaan PkM sesuai dengan \r\nroadmap PkM.\r\n</p><p>3) evaluasi kesesuaian PkM dosen \r\ndan mahasiswa dengan roadmap, dan\r\n</p><p>4) tindak lanjut hasil evaluasi untuk \r\nperbaikan relevansi PkM dan \r\npengembangan keilmuan.\r\n</p><p>5) Pemanfaatan hasil Pengabdian \r\nkepada Masyarakat untuk pengayaan \r\npembelajaran.<br></p>', '2023-05-12 03:21:28', '2023-05-12 03:21:28', null, '1.78', null, null);
INSERT INTO `indikator` VALUES ('468', '156', '<p>8.3 Monitoring dan evaluasi terhadap \r\npelaksanaan pengabdian kepada \r\nmasyarakat (PkM) dosen dan \r\nmahasiswa pada program studi yang \r\nmencakup unsur-unsur:\r\n</p><p>1) memiliki roadmap PkM untuk dosen \r\ndan mahasiswa,\r\n</p><p>2) Dilaksanakan secara konsisten\r\n</p><p>3) evaluasi kesesuaian PkM dosen \r\ndan mahasiswa dengan roadmap, dan </p><p>\r\n4) tindak lanjut hasil monitoring dan \r\nevaluasi untuk perbaikan relevansi \r\nPkM dan pengembangan keilmuan<br></p>', '2023-05-12 03:23:24', '2023-05-12 03:23:24', null, '0.89', null, null);
INSERT INTO `indikator` VALUES ('469', '157', '<p>9.1.1 Keberhasilan Studi pada \r\nProgram Sarjana Farmasi&nbsp;<br></p>', '2023-05-12 03:25:41', '2023-05-12 03:25:41', null, '5.85', null, null);
INSERT INTO `indikator` VALUES ('470', '157', '<p>9.1.2 IPK Lulusan pada \r\nProgram Studi9.1.2 IPK Lulusan pada \r\nProgram Studi<br></p>', '2023-05-12 03:27:20', '2023-05-12 03:27:20', null, '2.34', null, null);
INSERT INTO `indikator` VALUES ('471', '157', '<p>9.1.3 Jumlah Lulusan\r\nPersentase kelulusan tepat \r\nwaktu (KTW)&nbsp;</p><p>Huruf-huruf (d) dan (f) pada \r\nrumus dapat dilihat pada tabel\r\nbutir 9.1.2.2.1&nbsp;<br></p>', '2023-05-11 23:29:14', '2023-05-12 03:29:14', null, '2.34', null, null);
INSERT INTO `indikator` VALUES ('472', '157', '<p>9.1.4.1 Masa tunggu lulusan \r\nuntuk memperoleh pekerjaan \r\nyang pertama<br></p>', '2023-05-12 03:29:32', '2023-05-12 03:29:32', null, '1.17', null, null);
INSERT INTO `indikator` VALUES ('473', '157', '<p>9.1.4.2 Pendapat pengguna \r\n(employer) lulusan \r\nterhadap kualitas alumni.\r\nAda 7 jenis kemampuan.<br></p>', '2023-05-12 03:30:22', '2023-05-12 03:30:22', null, '1.17', null, null);
INSERT INTO `indikator` VALUES ('474', '158', '<p>9.2.1 Jumlah artikel ilmiah yang \r\ndisajikan/ dipublikasikan\r\noleh dosen tetap yang \r\nbidang keahliannya sama \r\ndengan PS, selama 3 \r\ntahun.&nbsp;na, nb, nc dapat dilihat pada \r\nTabel Butir 9.2.1<br></p>', '2023-05-11 23:33:41', '2023-05-12 03:33:41', null, '4.68', null, null);
INSERT INTO `indikator` VALUES ('475', '158', '<p>9.2.2 Penelitian/Karya dosen \r\ndan atau mahasiswa \r\nprogram studi yang telah \r\nmemperoleh Hak \r\nKekayaan Intelektual\r\n(Paten, Paten sederhana, \r\nHak cipta, Merek dagang, \r\nRahasia dagang, Desain \r\nproduk), Teknologi tepat \r\nGuna, dan&nbsp;Model/desain/rekayasa \r\natau karya yang mendapat \r\npengakuan/penghargaan \r\ndari lembaga \r\nnasional/internasional \r\nselama tiga tahun terakhir \r\npada program studi.\r\n<br></p>', '2023-05-12 03:34:28', '2023-05-12 03:34:28', null, '5.85', null, null);
INSERT INTO `indikator` VALUES ('476', '159', '<p>9.3 Pengabdian kepada \r\nMasyarakat yang dilakukan \r\noleh dosen dan atau \r\nmahasiswa program studi \r\nyang telah memperoleh Hak \r\nKekayaan Intelektual \r\n(Paten, Paten sederhana, \r\nHak cipta, Merek dagang, \r\nRahasia dagang, Desain \r\nproduk), Teknologi tepat \r\nGuna, dan \r\nModel/desain/rekayasa atau \r\nkarya yang mendapat \r\npengakuan/penghargaan \r\ndari lembaga \r\nnasional/internasional \r\nselama tiga tahun terakhir \r\npada program studi&nbsp;<br></p>', '2023-05-12 03:38:16', '2023-05-12 03:38:16', null, '3.51', null, null);
INSERT INTO `indikator` VALUES ('477', '160', '<p>9.4.1 Penghargaan/rekognisi\r\nuntuk Dosen Tetap \r\nProgram Studi\r\nPrestasi dalam mendapatkan \r\npenghargaan hibah, pendanaan \r\nprogram dan kegiatan akademik \r\ndari tingkat nasional dan \r\ninternasional; besaran dan \r\nproporsi dana penelitian dari \r\nsumber institusi sendiri dan luar \r\ninstitusi. </p><p>\r\nCatatan: selama tiga tahun \r\nterakhir<br></p>', '2023-05-12 07:01:18', '2023-05-12 07:01:18', null, '2.34', null, null);
INSERT INTO `indikator` VALUES ('478', '160', '<p>9.4.2 Pencapaian \r\nprestasi/reputasi \r\nmahasiswa dalam tiga \r\ntahun terakhir dibidang \r\nakademik dan nonakademik (misalnya \r\nprestasi dalam penelitian, \r\nlomba karya ilmiah, \r\nolahraga dan seni).<br></p>', '2023-05-12 07:02:22', '2023-05-12 07:02:22', null, '3.51', null, null);
INSERT INTO `indikator` VALUES ('479', '161', '<p>9.5 Pelaksanaan pembelajaran \r\ndiikuti dengan monev, \r\nfeedback, dan tindak lanjut \r\nuntuk meningkatkan \r\ncapaian pembelajaran \r\nlulusan dalam rangka&nbsp;mendukung kompetensi \r\nluaran dan capaian \r\npembelajaran pada \r\nprogram studi<br></p>', '2023-05-12 07:04:39', '2023-05-12 07:04:39', null, '3.51', null, null);
INSERT INTO `indikator` VALUES ('480', '161', '<p>9.6 Pelaksanaan penelitian\r\ndiikuti dengan monev, \r\nfeedback, dan tindak lanjut \r\nuntuk meningkatkan jumlah \r\nkarya ilmiah, sitasi, Hak \r\nKekayaan Intelektual yang\r\nditetapkan oleh \r\nKemkumham (Paten, Hak \r\nCipta), Teknologi Tepat \r\nGuna, dan Buku ber-ISBN\r\npada program studi.<br></p>', '2023-05-12 07:08:22', '2023-05-12 07:08:22', null, '2.34', null, null);
INSERT INTO `indikator` VALUES ('481', '161', '<p>9.7 Pelaksanaan PkM \r\nmerupakan tindak lanjut \r\nhasil dari penelitian diikuti \r\ndengan monev, feedback, \r\ndan tindak lanjut untuk\r\nmeningkatkan jumlah karya \r\nilmiah, Hak Kekayaan \r\nIntelektual yang ditetapkan \r\noleh Kemkumham (Paten, \r\nHak Cipta), Produk, \r\nTeknologi Tepat Guna, dan\r\nBuku ber-ISBN pada \r\nprogram studi.<br></p>', '2023-05-12 07:08:35', '2023-05-12 07:08:35', null, '1.17', null, null);
INSERT INTO `indikator` VALUES ('482', '162', '<p>10.1 Analisis SWOT Unit \r\nPengelola Program Studi \r\ndan Program Studi.<br></p>', '2023-05-12 07:12:30', '2023-05-12 07:12:30', null, '2.34', null, null);
INSERT INTO `indikator` VALUES ('483', '162', '<p>10.2 Strategi penyelesaian \r\nmasalah dan mengatasi \r\nkelemahan yang dihadapi.&nbsp;<br></p>', '2023-05-12 07:19:25', '2023-05-12 07:19:25', null, '1.17', null, null);
INSERT INTO `indikator` VALUES ('484', '162', '<p>10.3 Program Pengembangan \r\nyang dilakukan Unit \r\nPengelola Program Studi \r\ndan Program Studi.&nbsp;<br></p>', '2023-05-12 07:19:54', '2023-05-12 07:19:54', null, '1.17', null, null);
INSERT INTO `indikator` VALUES ('485', '124', '<p>3.7&nbsp;Siklus Penjaminan Mutu (PPEPP) berjalan dengan efektif</p><p>Siklus Penjaminan Mutu (PPEPP) berjalan dengan efektif apabila semua tahapan PPEPP dijalankan dengan baik.</p>', '2023-05-16 02:59:17', '2023-05-16 06:59:17', null, '4', null, null);
INSERT INTO `indikator` VALUES ('486', '128', '<p>7.5&nbsp;Siklus Penjaminan Mutu (PPEPP) berjalan dengan efektif</p><p>Siklus Penjaminan Mutu (PPEPP) berjalan dengan efektif apabila semua tahapan PPEPP dijalankan dengan baik.</p>', '2023-05-16 04:15:58', '2023-05-16 08:15:57', null, '4', null, null);
INSERT INTO `indikator` VALUES ('487', '129', '<p>Siklus Penjaminan Mutu (PPEPP) berjalan dengan efektif<br></p>', '2023-05-16 04:22:36', '2023-05-16 08:22:36', null, '4', null, null);
INSERT INTO `indikator_penilaian` VALUES ('1', '1', '<p>Unit Pengelola Program Studi (UPPS) mampu:</p><p>1) mengidentifikasi kondisi lingkungan dan industri yang relevan secara komprehensif dan strategis,</p><p>2) menetapkan posisi relatif program studi terhadap lingkungannya,</p><p>3) menggunakan hasil identifikasi dan posisi yang ditetapkan untuk melakukan analisis (SWOT/metoda analisis lain yang relevan) untuk pengembangan program studi, dan</p><p>4) merumuskan strategi pengembangan program studi yang berkesesuaian untuk menghasilkan program-program pengembangan alternatif yang tepat.</p>', '4', '0', null, '2023-03-09 09:41:41', '2023-03-09 09:41:41', null);
INSERT INTO `indikator_penilaian` VALUES ('2', '1', '<p>Unit Pengelola Program Studi (UPPS) mampu:</p><p>1) mengidentifikasi kondisi lingkungan dan industri yang relevan secara komprehensif,</p><p>2) menetapkan posisi relatif program studi terhadap lingkungannya, dan&nbsp;</p><p>3) menggunakan hasil identifikasi dan posisi yang ditetapkan untuk melakukan analisis (SWOT/metoda analisis lain yang relevan) untuk pengembangan program studi.</p>', '3', '0', null, '2023-03-09 09:41:49', '2023-03-09 09:41:49', null);
INSERT INTO `indikator_penilaian` VALUES ('3', '1', '<p>Unit Pengelola Program Studi (UPPS) mampu:</p><p>1) mengidentifikasi kondisi lingkungan dan industri yang relevan, dan</p><p>2) menetapkan posisi relatif program studi terhadap lingkungannya.</p>', '2', '0', null, '2023-03-09 09:41:59', '2023-03-09 09:41:59', null);
INSERT INTO `indikator_penilaian` VALUES ('4', '1', '<p>Unit Pengelola Program Studi (UPPS) kurang mampu:</p><p>1) mengidentifikasi kondisi lingkungan dan industri yang relevan, dan</p><p>2) menetapkan posisi relatif program studi terhadap lingkungannya.</p>', '1', '0', null, '2023-03-09 09:42:08', '2023-03-09 09:42:08', null);
INSERT INTO `indikator_penilaian` VALUES ('5', '1', '<p>Unit Pengelola Program Studi (UPPS) tidak mampu:</p><p>1) mengidentifikasi kondisi lingkungan dan industri yang relevan, dan</p><p>2) menetapkan posisi relatif program studi terhadap lingkungannya.</p>', '0', '0', null, '2023-03-09 09:42:16', '2023-03-09 09:42:16', null);
INSERT INTO `indikator_penilaian` VALUES ('6', '2', '<p>Profil UPPS:&nbsp;</p><p>1) menunjukkan keserbacakupan informasi yang jelas dan konsisten dengan data dan informasi yang disampaikan pada masing-masing kriteria,</p><p>2) menggambarkan keselarasan dengan substansi keilmuan program studi.&nbsp;</p><p>3) menunjukkan iklim yang kondusif untuk pengembangan keilmuan program studi.</p><p>4) menunjukkan reputasi sebagai rujukan di bidang keilmuannya.</p>', '4', '0', null, '2023-03-09 09:42:41', '2023-03-09 09:42:41', null);
INSERT INTO `indikator_penilaian` VALUES ('7', '2', '<p>Profil UPPS:</p><p>1) menunjukkan keserbacakupan informasi yang jelas dan konsisten dengan data dan informasi yang disampaikan pada masing-masing kriteria,</p><p>2) menggambarkan keselarasan dengan substansi keilmuan program studi.&nbsp;</p><p>3) menunjukkan iklim yang kondusif untuk pengembangan keilmuan program studi.</p>', '3', '0', null, '2023-03-09 09:42:48', '2023-03-09 09:42:48', null);
INSERT INTO `indikator_penilaian` VALUES ('8', '2', '<p>Profil UPPS:</p><p>1) menunjukkan keserbacakupan informasi yang jelas dengan data dan informasi yang disampaikan pada masing-masing kriteria,</p><p>2) menggambarkan keselarasan dengan substansi keilmuan program studi.&nbsp;</p>', '2', '0', null, '2023-03-09 09:43:00', '2023-03-09 09:43:00', null);
INSERT INTO `indikator_penilaian` VALUES ('9', '2', '<p>Profil UPPS:</p><p>1) kurang menunjukkan keserbacakupan informasi yang jelas dengan data dan informasi yang disampaikan pada masing-masing kriteria,</p><p>2) kurang menggambarkan keselarasan dengan substansi keilmuan program studi.&nbsp;</p>', '1', '0', null, '2023-03-09 09:43:07', '2023-03-09 09:43:07', null);
INSERT INTO `indikator_penilaian` VALUES ('10', '2', '<p>Profil UPPS tidak menunjukkan keserbacakupan informasi yang jelas dengan data dan informasi yang disampaikan pada masing-masing kriteria.&nbsp;<br></p>', '0', '0', null, '2023-03-09 09:43:14', '2023-03-09 09:43:14', null);
INSERT INTO `indikator_penilaian` VALUES ('11', '3', '<p>UPPS memiliki:</p><p>1) visi yang mencerminkan visi perguruan tinggi dan memayungi visi keilmuan terkait keunikan program studi serta didukung data konsistensi implementasinya,</p><p>2) misi, tujuan, dan strategi yang searah dan bersinerji dengan misi, tujuan, dan strategi perguruan tinggi serta mendukung pengembangan program studi dengan data konsistensi implementasinya.</p>', '4', '0', null, '2023-03-09 09:43:40', '2023-03-09 09:43:40', null);
INSERT INTO `indikator_penilaian` VALUES ('12', '3', '<p>UPPS memiliki:</p><p>1) visi yang mencerminkan visi perguruan tinggi dan memayungi visi keilmuan terkait keunikan program studi,</p><p>2) misi, tujuan, dan strategi yang searah dan bersinerji dengan misi, tujuan, dan strategi perguruan tinggi serta mendukung pengembangan program studi.</p>', '3', '0', null, '2023-03-09 09:43:46', '2023-03-09 09:43:46', null);
INSERT INTO `indikator_penilaian` VALUES ('13', '3', '<p>UPPS memiliki:&nbsp;</p><p>1) visi yang mencerminkan visi perguruan tinggi dan memayungi visi keilmuan terkait program studi,</p><p>2) misi, tujuan, dan strategi yang searah dengan misi, tujuan, dan strategi perguruan tinggi serta mendukung pengembangan program studi.</p>', '2', '0', null, '2023-03-09 09:43:53', '2023-03-09 09:43:53', null);
INSERT INTO `indikator_penilaian` VALUES ('14', '3', '<p>UPPS memiliki:</p><p>1) visi yang mencerminkan visi perguruan tinggi namun tidak memayungi visi keilmuan terkait program studi,</p><p>2) misi, tujuan, dan strategi kurang searah dengan misi, tujuan sasaran, dan strategi perguruan tinggi serta kurang mendukung pengembangan program studi.</p>', '1', '0', null, '2023-03-09 09:44:02', '2023-03-09 09:44:02', null);
INSERT INTO `indikator_penilaian` VALUES ('15', '3', '<p>UPPS memiliki misi, tujuan, dan strategi yang tidak terkait dengan strategi perguruan tinggi dan pengembangan program studi.<br></p>', '0', '0', null, '2023-03-09 09:44:09', '2023-03-09 09:44:09', null);
INSERT INTO `indikator_penilaian` VALUES ('16', '4', '<p>Ada mekanisme dalam penyusunan dan penetapan visi, misi, tujuan dan strategi yang terdokumentasi serta ada keterlibatan semua pemangku kepentingan internal (dosen, mahasiswa dan tenaga kependidikan) dan eksternal (lulusan, pengguna lulusan dan pakar/mitra/organisasi profesi/pemerintah).<br></p>', '4', '0', null, '2023-03-09 09:44:30', '2023-03-09 09:44:30', null);
INSERT INTO `indikator_penilaian` VALUES ('17', '4', '<p>Ada mekanisme dalam penyusunan dan penetapan visi, misi, tujuan dan strategi yang terdokumentasi serta ada keterlibatan pemangku kepentingan internal (dosen, mahasiswa dan tenaga kependidikan) dan pemangku kepentingan eksternal (lulusan dan pengguna lulusan).&nbsp;<br></p>', '3', '0', null, '2023-03-09 09:44:37', '2023-03-09 09:44:37', null);
INSERT INTO `indikator_penilaian` VALUES ('18', '4', '<p>Ada mekanisme dalam penyusunan dan penetapan visi, misi, tujuan dan strategi yang terdokumentasi serta ada keterlibatan pemangku kepentingan internal (dosen dan mahasiswa) dan pemangku kepentingan eksternal (lulusan).<br></p>', '2', '0', null, '2023-03-09 09:44:46', '2023-03-09 09:44:46', null);
INSERT INTO `indikator_penilaian` VALUES ('19', '4', '<p>Ada mekanisme dalam penyusunan dan penetapan visi, misi, tujuan dan strategi yang terdokumentasi namun tidak melibatkan pemangku kepentingan.<br></p>', '1', '0', null, '2023-03-09 09:44:53', '2023-03-09 09:44:53', null);
INSERT INTO `indikator_penilaian` VALUES ('20', '4', '<p>Tidak ada mekanisme dalam penyusunan dan penetapan visi, misi, tujuan dan strategi.<br></p>', '0', '0', null, '2023-03-09 09:44:59', '2023-03-09 09:44:59', null);
INSERT INTO `indikator_penilaian` VALUES ('21', '5', '<p>Strategi efektif untuk mencapai tujuan dan disusun berdasarkan analisis yang sistematis dengan menggunakan metoda yang relevan dan terdokumentasi serta pada pelaksanaannya dilakukan pemantauan dan evaluasi dan ditindaklanjuti.<br></p>', '4', '0', null, '2023-03-09 09:45:14', '2023-03-09 09:45:14', null);
INSERT INTO `indikator_penilaian` VALUES ('22', '5', '<p>Strategi efektif untuk mencapai tujuan dan disusun berdasarkan analisis yang sistematis dengan menggunakan metoda yang relevan dan terdokumentasi serta pada pelaksanaannya dilakukan pemantauan dan evaluasi.<br></p>', '3', '0', null, '2023-03-09 09:45:21', '2023-03-09 09:45:21', null);
INSERT INTO `indikator_penilaian` VALUES ('23', '5', '<p>Strategi untuk mencapai tujuan dan disusun berdasarkan analisis yang sistematis dengan menggunakan metoda yang relevan serta terdokumentasi namun belum terbukti efektifitasnya.<br></p>', '2', '0', null, '2023-03-09 09:45:28', '2023-03-09 09:45:28', null);
INSERT INTO `indikator_penilaian` VALUES ('24', '5', '<p>Strategi untuk mencapai tujuan disusun berdasarkan analisis yang kurang sistematis serta tidak menggunakan metoda yang relevan.<br></p>', '1', '0', null, '2023-03-09 09:45:34', '2023-03-09 09:45:34', null);
