INSERT INTO `indikator_penilaian` VALUES ('401', '83', '<p>UPPS telah melakukan analisis capaian kinerja yang:&nbsp;</p><p>1) analisisnya didukung oleh data/informasi yang relevan (merujuk pada pencapaian standar mutu perguruan tinggi) dan berkualitas (andal dan memadai) yang didukung oleh keberadaan pangkalan data institusi yang terintegrasi.</p><p>2) konsisten dengan seluruh kriteria yang diuraikan sebelumnya,&nbsp;</p><p>3) analisisnya dilakukan secara komprehensif, tepat, dan tajam untuk mengidentifikasi akar masalah di&nbsp; UPPS.</p><p>4) hasilnya dipublikasikan kepada para pemangku kepentingan internal dan eksternal serta mudah diakses.</p>', '4', '0', null, '2023-03-13 08:21:14', '2023-03-13 08:21:14', null);
INSERT INTO `indikator_penilaian` VALUES ('402', '83', '<p>UPPS telah melakukan analisis capaian kinerja yang:&nbsp;</p><p>1) analisisnya didukung oleh data/informasi yang relevan (merujuk pada pencapaian standar mutu perguruan tinggi) dan berkualitas (andal dan memadai) yang didukung oleh keberadaan pangkalan data institusi yang belum terintegrasi.</p><p>2) konsisten dengan sebagian besar (7 s.d. 8) kriteria yang diuraikan sebelumnya,&nbsp;</p><p>3) analisisnya dilakukan secara komprehensif dan tepat untuk mengidentifikasi akar masalah di UPPS.</p><p>4) hasilnya dipublikasikan kepada para pemangku kepentingan internal serta mudah diakses.</p>', '3', '0', null, '2023-03-13 08:21:27', '2023-03-13 08:21:27', null);
INSERT INTO `indikator_penilaian` VALUES ('403', '83', '<p>UPPS telah melakukan analisis capaian kinerja yang:&nbsp;</p><p>1) analisisnya didukung oleh data/informasi yang relevan (merujuk pada pencapaian standar mutu perguruan tinggi) dan berkualitas (andal dan memadai).</p><p>2) konsisten dengan sebagian (5 s.d. 6) kriteria yang diuraikan sebelumnya,&nbsp;</p><p>3) analisisnya dilakukan secara komprehensif untuk mengidentifikasi akar masalah di UPPS.</p><p>4) hasilnya dipublikasikan kepada para pemangku kepentingan internal.</p>', '2', '0', null, '2023-03-13 08:21:44', '2023-03-13 08:21:44', null);
INSERT INTO `indikator_penilaian` VALUES ('404', '83', '<p>UPPS telah melakukan analisis capaian kinerja yang:&nbsp;</p><p>1) analisisnya tidak sepenuhnya didukung oleh data/informasi yang relevan (merujuk pada pencapaian standar mutu perguruan tinggi) dan berkualitas (andal dan memadai).</p><p>2) konsisten dengan sebagian kecil (kurang dari 5) kriteria yang diuraikan sebelumnya,&nbsp;</p><p>3) analisisnya dilakukan tidak secara komprehensif untuk mengidentifikasi akar masalah di UPPS.</p><p>4) hasilnya tidak dipublikasikan.</p>', '1', '0', null, '2023-03-13 08:21:56', '2023-03-13 08:21:56', null);
INSERT INTO `indikator_penilaian` VALUES ('405', '83', '<p>UPPS tidak melakukan analisis capaian kinerja.<br></p>', '0', '0', null, '2023-03-13 08:22:09', '2023-03-13 08:22:09', null);
INSERT INTO `indikator_penilaian` VALUES ('406', '84', '<p>UPPS melakukan analisis SWOT atau analisis lain yang relevan, serta memenuhi aspek-aspek sebagai berikut:</p><p>1) melakukan identifikasi kekuatan atau faktor pendorong, kelemahan atau faktor penghambat, peluang dan ancaman yang dihadapi UPPS dilakukan secara tepat,</p><p>2) memiliki keterkaitan dengan hasil analisis capaian kinerja,</p><p>3) merumuskan strategi pengembangan UPPS yang berkesesuaian, dan</p><p>4) menghasilkan program-program pengembangan alternatif yang tepat.</p>', '4', '0', null, '2023-03-13 08:23:02', '2023-03-13 08:23:02', null);
INSERT INTO `indikator_penilaian` VALUES ('407', '84', '<p>UPPS melakukan analisis SWOT atau analisis lain yang relevan, serta memenuhi aspek-aspek sebagai berikut:</p><p>1) melakukan identifikasi kekuatan atau faktor pendorong, kelemahan atau faktor penghambat, peluang dan ancaman yang dihadapi UPPS dilakukan secara tepat,</p><p>2) memiliki keterkaitan dengan hasil analisis capaian kinerja, dan</p><p>3) merumuskan strategi pengembangan UPPS yang berkesesuaian.</p>', '3', '0', null, '2023-03-13 08:23:15', '2023-03-13 08:23:15', null);
INSERT INTO `indikator_penilaian` VALUES ('408', '84', '<p>UPPS melakukan analisis SWOT atau analisis lain yang relevan, serta memenuhi aspek-aspek sebagai berikut:</p><p>1) melakukan identifikasi kekuatan atau faktor pendorong, kelemahan atau faktor penghambat, peluang dan ancaman yang dihadapi UPPS dilakukan secara tepat, dan&nbsp;</p><p>2) memiliki keterkaitan dengan hasil analisis capaian kinerja.</p>', '2', '0', null, '2023-03-13 08:23:30', '2023-03-13 08:23:30', null);
INSERT INTO `indikator_penilaian` VALUES ('409', '84', '<p>UPPS melakukan analisis SWOT atau analisis lain yang memenuhi aspek-aspek sebagai berikut:</p><p>1) melakukan identifikasi kekuatan atau faktor pendorong, kelemahan atau faktor penghambat, peluang dan ancaman yang dihadapi UPPS, dan</p><p>2) memiliki keterkaitan dengan hasil analisis capaian kinerja, namun tidak terstruktur dan tidak sistematis.</p>', '1', '0', null, '2023-03-13 08:23:42', '2023-03-13 08:23:42', null);
INSERT INTO `indikator_penilaian` VALUES ('410', '84', '<p>UPPS tidak melakukan analisis untuk mengembangkan strategi.<br></p>', '0', '0', null, '2023-03-13 08:23:56', '2023-03-13 08:23:56', null);
INSERT INTO `indikator_penilaian` VALUES ('411', '85', '<p>UPPS menetapkan prioritas program pengembangan berdasarkan hasil analisis SWOT atau analisis lainnya yang mempertimbangkan secara komprehensif:</p><p>1) kapasitas UPPS,</p><p>2) kebutuhan UPPS dan PS di masa depan,</p><p>3) rencana strategis UPPS yang berlaku,</p><p>4) aspirasi dari pemangku kepentingan internal dan eksternal, dan</p><p>5) program yang menjamin keberlanjutan.</p>', '4', '0', null, '2023-03-13 08:24:41', '2023-03-13 08:24:41', null);
INSERT INTO `indikator_penilaian` VALUES ('412', '85', '<p>UPPS menetapkan prioritas program pengembangan berdasarkan hasil analisis SWOT atau analisis lainnya yang mempertimbangkan secara komprehensif:</p><p>1) kapasitas UPPS,</p><p>2) kebutuhan UPPS dan PS di masa depan,</p><p>3) rencana strategis UPPS yang berlaku, dan</p><p>4) aspirasi dari pemangku kepentingan internal.</p>', '3', '0', null, '2023-03-13 08:25:00', '2023-03-13 08:25:00', null);
INSERT INTO `indikator_penilaian` VALUES ('413', '85', '<p>UPPS menetapkan prioritas program pengembangan berdasarkan hasil analisis SWOT atau analisis lainnya yang mempertimbangkan secara komprehensif:</p><p>1) kapasitas UPPS,</p><p>2) kebutuhan UPPS dan PS di masa depan, dan</p><p>3) rencana strategis UPPS yang berlaku.</p>', '2', '0', null, '2023-03-13 08:25:15', '2023-03-13 08:25:15', null);
