INSERT INTO `indikator_penilaian` VALUES ('443', '87', '<p>Unit Pengelola Program Studi (UPPS) mampu:</p><p>1) mengidentifikasi kondisi lingkungan dan industri yang relevan secara komprehensif dan strategis,</p><p>2) menetapkan posisi relatif program studi terhadap lingkungannya,</p><p>3) menggunakan hasil identifikasi dan posisi yang ditetapkan untuk melakukan analisis (SWOT/metoda analisis lain yang relevan) untuk pengembangan program studi, dan</p><p>4) merumuskan strategi pengembangan program studi yang berkesesuaian untuk menghasilkan program-program pengembangan alternatif yang tepat.</p>', '4', '0', null, '2023-04-06 09:14:55', '2023-04-06 09:14:55', null);
INSERT INTO `indikator_penilaian` VALUES ('444', '87', '<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"625\" style=\"width: 469pt;\"><tbody><tr height=\"155\" style=\"mso-height-source:userset;height:116.7pt\">\r\n  <td height=\"155\" class=\"xl64\" width=\"625\" style=\"height:116.7pt;width:469pt\">Unit\r\n  Pengelola Program Studi (UPPS) mampu:<br>\r\n    1) mengidentifikasi kondisi lingkungan dan industri yang relevan secara\r\n  komprehensif,<br>\r\n    2) menetapkan posisi relatif program studi terhadap lingkungannya, dan\r\n  <br>\r\n    3) menggunakan hasil identifikasi dan posisi yang ditetapkan untuk\r\n  melakukan analisis (SWOT/metoda analisis lain yang relevan) untuk\r\n  pengembangan program studi.</td></tr></tbody></table>', '3', '0', null, '2023-04-06 09:15:49', '2023-04-06 09:15:49', null);
