INSERT INTO `indikator_penilaian` VALUES ('448', '89', '<p>Profil UPPS:&nbsp;</p><p>1) menunjukkan keserbacakupan informasi yang jelas dan konsisten dengan data dan informasi yang disampaikan pada masing-masing kriteria,</p><p>2) menggambarkan keselarasan dengan substansi keilmuan program studi.&nbsp;</p><p>3) menunjukkan iklim yang kondusif untuk pengembangan keilmuan program studi.</p><p>4) menunjukkan reputasi sebagai rujukan di bidang keilmuannya.</p>', '4', '0', null, '2023-04-06 09:21:33', '2023-04-06 09:21:33', null);
INSERT INTO `indikator_penilaian` VALUES ('449', '89', '<p>Profil UPPS:</p><p>1) menunjukkan keserbacakupan informasi yang jelas dan konsisten dengan data dan informasi yang disampaikan pada masing-masing kriteria,</p><p>2) menggambarkan keselarasan dengan substansi keilmuan program studi.&nbsp;</p><p>3) menunjukkan iklim yang kondusif untuk pengembangan keilmuan program studi.</p>', '3', '0', null, '2023-04-06 09:21:54', '2023-04-06 09:21:54', null);
