INSERT INTO `indikator_penilaian` VALUES ('453', '90', '<p>UPPS memiliki:</p><p>1) visi yang mencerminkan visi perguruan tinggi dan memayungi visi keilmuan</p><p>terkait keunikan program studi serta didukung data implementasi yang konsisten,</p><p>2) misi, tujuan, dan strategi yang searah dan bersinerji dengan misi,tujuan, dan strategi perguruan tinggi serta mendukung pengembangan program studi dengan data implementasi yang konsisten.</p>', '4', '0', null, '2023-04-06 09:26:20', '2023-04-06 09:26:20', null);
INSERT INTO `indikator_penilaian` VALUES ('454', '90', '<p>UPPS memiliki:</p><p>1) visi yang mencerminkan visi perguruan tinggi dan memayungi visi keilmuan terkait keunikan program studi,</p><p>2) misi, tujuan, dan strategi yang searah dan bersinerji dengan misi, tujuan, dan strategi perguruan tinggi serta mendukung pengembangan program studi.</p>', '3', '0', null, '2023-04-06 09:26:31', '2023-04-06 09:26:31', null);
INSERT INTO `indikator_penilaian` VALUES ('455', '90', '<p>UPPS memiliki:</p><p>1) visi yang mencerminkan visi perguruan tinggi dan memayungi visi keilmuan terkait program studi,</p><p>2) misi, tujuan, dan strategi yang searah dengan misi, tujuan, dan strategi perguruan tinggi serta mendukung pengembangan program studi.</p>', '2', '0', null, '2023-04-06 09:27:01', '2023-04-06 09:27:01', null);
INSERT INTO `indikator_penilaian` VALUES ('456', '90', '<p>UPPS memiliki:</p><p>1) visi yang mencerminkan visi perguruan tinggi namun tidak memayungi visi keilmuan terkait program studi,</p><p>2) misi, tujuan, dan strategi kurang searah dengan misi, tujuan sasaran, dan strategi perguruan tinggi serta kurang mendukung pengembangan program studi.</p>', '1', '0', null, '2023-04-06 09:27:17', '2023-04-06 09:27:17', null);
INSERT INTO `indikator_penilaian` VALUES ('457', '90', '<p>UPPS memiliki misi, tujuan, dan strategi yang tidak terkait dengan strategi perguruan tinggi dan pengembangan program studi.<br></p>', '0', '0', null, '2023-04-06 09:27:29', '2023-04-06 09:27:29', null);
INSERT INTO `indikator_penilaian` VALUES ('458', '91', '<p>Ada mekanisme dalam penyusunan dan penetapan visi, misi, tujuan dan strategi yang terdokumentasi serta ada keterlibatan semua pemangku kepentingan internal (dosen, mahasiswa dan tenaga kependidikan) dan eksternal (lulusan, pengguna lulusan dan pakar/mitra/organisasi profesi/pemerintah).<br></p>', '4', '0', null, '2023-04-06 09:31:53', '2023-04-06 09:31:53', null);
