INSERT INTO `indikator_penilaian` VALUES ('871', '178', '<p>UPPS melakukan analisis SWOT memenuhi aspek-aspek sebagai berikut:&nbsp;</p><p>1) melakukan identifikasikekuatan atau faktor pendorong, kelemahan atau faktor penghambat,peluang dan ancaman yang dihadapi UPPS dilakukan secara tepat,</p><p>2) memiliki keterkaitan dengan hasil analisis capaian kinerja,</p><p>3) merumuskan strategi pengembangan UPPS yang berkesesuaian, dan</p><p>4) menghasilkan program- program pengembangan alternatif yang tepat.</p>', '4', '0', null, '2023-04-10 07:16:45', '2023-04-10 07:16:45', null);
INSERT INTO `indikator_penilaian` VALUES ('872', '178', '<p>UPPS melakukan analisis SWOT atau analisis lain yang relevan, serta memenuhi aspek-aspek sebagai berikut:</p><p>1) melakukan identifikasi kekuatan atau faktor pendorong, kelemahan atau faktor penghambat, peluang dan ancaman yang dihadapi UPPS dilakukan secara tepat,</p><p>2) memiliki keterkaitan dengan hasil analisis capaian kinerja, dan</p><p>3) merumuskan strategi pengembangan UPPS yang berkesesuaian.</p>', '3', '0', null, '2023-04-10 07:16:54', '2023-04-10 07:16:54', null);
INSERT INTO `indikator_penilaian` VALUES ('873', '178', '<p>UPPS melakukan analisis SWOT atau analisis lain yang relevan, serta memenuhi aspek-aspek sebagai berikut:</p><p>1) melakukan identifikasi kekuatan atau faktor pendorong, kelemahan atau faktor penghambat, peluang dan ancaman yang dihadapi UPPS dilakukan secara tepat,</p><p>2) memiliki keterkaitan dengan hasil analisis capaian kinerja</p>', '2', '0', null, '2023-04-10 07:17:03', '2023-04-10 07:17:03', null);
INSERT INTO `indikator_penilaian` VALUES ('874', '178', '<p>UPPS melakukan analisisSWOT atau analisis lain yang memenuhi aspek- aspek sebagai berikut:</p><p>1) melakukan identifikasi kekuatan atau faktor pendorong, kelemahan atau faktor penghambat, peluang dan ancaman yang dihadapi UPPS, dan</p><p>2) memiliki keterkaitan dengan hasil analisis capaian kinerja, namun tidak terstruktur dan tidak sistematis</p>', '1', '0', null, '2023-04-10 07:17:11', '2023-04-10 07:17:11', null);
INSERT INTO `indikator_penilaian` VALUES ('875', '178', '<p>UPPS tidak melakukananalisis untuk mengembangkan strategi.<br></p>', '0', '0', null, '2023-04-10 07:17:24', '2023-04-10 07:17:24', null);
INSERT INTO `indikator_penilaian` VALUES ('876', '179', '<p>UPPS menetapkan tujuan strategis pengembangan berdasarkan hasil analisis SWOT yang mempertimbangkan:</p><p>1)<span style=\"white-space:pre\">	</span>rencana aksi pimpinan dan kemampuan sumber daya UPPS,</p><p>2)<span style=\"white-space:pre\">	</span>kebutuhan jangka pendek dan jangka menengah UPPS,</p><p>3)<span style=\"white-space:pre\">	</span>tujuan dan rencana strategis UPPS yang berlaku,</p><p>4)<span style=\"white-space:pre\">	</span>aspirasi dari pemangku kepentingan internal dan eksternal, serta</p><p>5)<span style=\"white-space:pre\">	</span>program yang menjamin keberlanjutan.</p>', '4', '0', null, '2023-04-10 07:18:32', '2023-04-10 07:18:32', null);
