INSERT INTO `indikator_penilaian` VALUES ('936', '181', '<p>Unit Pengelola\r\nProgram Studi\r\n(UPPS) mampu:\r\n1)\r\nmengidentifikasi\r\nkondisi\r\nlingkungan dan\r\nindustri yang\r\nrelevan secara\r\nkomprehensif\r\ndan strategis,\r\n2) menetapkan\r\nposisi relatif\r\nprogram studi\r\nterhadap\r\nlingkungannya,\r\n3) menggunakan \r\nhasil identifikasi\r\ndan posisi yang\r\nditetapkan untuk&nbsp;melakukan\r\nanalisis\r\n(SWOT/metoda\r\nanalisis lain yang\r\nrelevan) untuk\r\npengembangan\r\nprogram studi,\r\ndan\r\n4) merumuskan\r\nstrategi\r\npengembangan\r\nprogram studi\r\nyang\r\nberkesesuaian\r\nuntuk\r\nmenghasilkan\r\nprogramprogram\r\npengembangan\r\nalternatif yang\r\ntepat<br></p>', '4', '0', null, '2023-04-12 09:32:27', '2023-04-12 09:32:27', null);
INSERT INTO `indikator_penilaian` VALUES ('937', '181', '<p>Unit Pengelola\r\nProgram Studi\r\n(UPPS) mampu:\r\n1)\r\nmengidentifikasi\r\nkondisi\r\nlingkungan dan\r\nindustri yang\r\nrelevan secara\r\nkomprehensif,\r\n2) menetapkan\r\nposisi relatif\r\nprogram studi\r\nterhadap\r\nlingkungannya,\r\ndan\r\n3) menggunakan \r\nhasil identifikasi\r\ndan posisi yang\r\nditetapkan untuk&nbsp;melakukan\r\nanalisis\r\n(SWOT/metoda\r\nanalisis lain yang\r\nrelevan) untuk\r\npengembangan\r\nprogram studi.\r\n<br></p>', '3', '0', null, '2023-04-12 09:32:50', '2023-04-12 09:32:50', null);
INSERT INTO `indikator_penilaian` VALUES ('938', '181', '<p>Unit Pengelola\r\nProgram Studi\r\n(UPPS) mampu:\r\n1)\r\nmengidentifikasi\r\nkondisi lingkungan\r\ndan industri yang\r\nrelevan, dan\r\n2) menetapkan\r\nposisi relatif\r\nprogram studi\r\nterhadap\r\nlingkungannya.&nbsp;<br></p>', '2', '0', null, '2023-04-12 09:33:01', '2023-04-12 09:33:01', null);
INSERT INTO `indikator_penilaian` VALUES ('939', '181', '<p>Unit Pengelola\r\nProgram Studi\r\n(UPPS) kurang\r\nmampu:\r\n1)\r\nmengidentifikasi\r\nkondisi\r\nlingkungan dan\r\nindustri yang\r\nrelevan, dan\r\n2) menetapkan\r\nposisi relatif\r\nprogram studi\r\nterhadap\r\nlingkungannya.<br></p>', '1', '0', null, '2023-04-12 09:33:13', '2023-04-12 09:33:13', null);
INSERT INTO `indikator_penilaian` VALUES ('940', '181', '<p>Unit Pengelola\r\nProgram Studi\r\n(UPPS) tidak\r\nmampu:\r\n1)\r\nmengidentifikasi\r\nkondisi\r\nlingkungan dan\r\nindustri yang\r\nrelevan, dan\r\n2) menetapkan\r\nposisi relatif\r\nprogram studi\r\nterhadap\r\nlingkungannya<br></p>', '0', '0', null, '2023-04-12 09:33:23', '2023-04-12 09:33:23', null);
INSERT INTO `indikator_penilaian` VALUES ('941', '182', '<p>Profil UPPS:\r\n1) menunjukkan\r\nkeserbacakupan\r\ninformasi yang\r\njelas dan\r\nkonsisten dengan\r\ndata dan\r\ninformasi yang\r\ndisampaikan\r\npada masingmasing kriteria,\r\n2)&nbsp;menggambarkan\r\nkeselarasan\r\ndengan substansi\r\nkeilmuan\r\nprogram studi.\r\n3) menunjukkan\r\niklim yang\r\nkondusif untuk\r\npengembangan \r\nkeilmuanprogram\r\nstudi.\r\n4) \r\nmenunjukkan \r\nreputasi\r\nsebagai\r\nrujukan di\r\nbidang\r\nkeilmuannya<br></p>', '4', '0', null, '2023-04-12 09:36:02', '2023-04-12 09:36:02', null);
