INSERT INTO `indikator_penilaian` VALUES ('951', '113', '<p><span style=\"color: rgb(33, 37, 41);\">NDTPS = Jumlah dosen tetap yang ditugaskan sebagai pengampu mata kuliah dengan bidang keahlian yang sesuai dengan kompetensi inti program studi yang diakreditasi.</span><br></p>', '99', '0', null, '2023-04-12 22:22:29', '2023-04-13 02:22:29', null);
INSERT INTO `indikator_penilaian` VALUES ('952', '186', '<p>UPPS memiliki :&nbsp;</p><p>1) visi yang&nbsp; mencerminkan visi&nbsp; perguruan tinggi dan memayungi visi&nbsp; keilmuan terkait&nbsp; keunikan program studi serta didukung&nbsp; data implementasi yang konsisten,</p><p>2) misi, tujuan, dan strategi yang searah&nbsp; dan bersinergi dengan&nbsp; misi, tujuan, dan&nbsp; strategi perguruan&nbsp; tinggi serta mendukung pengembangan&nbsp; program studi dengan data&nbsp; implementasi yang konsisten.</p>', '4', '0', null, '2023-04-18 04:06:48', '2023-04-18 04:06:48', null);
INSERT INTO `indikator_penilaian` VALUES ('953', '186', '<p>UPPS memiliki:</p><p>1) visi yang&nbsp; mencerminkan visi&nbsp; perguruan tinggi dan&nbsp; memayungi visi&nbsp; keilmuan terkait&nbsp; keunikan program&nbsp; studi,</p><p>2) misi, tujuan, dan strategi yang searah dan bersinergi dengan misi, tujuan, dan strategi perguruan tinggi serta mendukung pengembangan program studi.</p>', '3', '0', null, '2023-04-18 04:06:56', '2023-04-18 04:06:56', null);
INSERT INTO `indikator_penilaian` VALUES ('954', '186', '<p>UPPS memiliki:</p><p>1) visi yang mencerminkan visi perguruan tinggi dan memayungi visi keilmuan terkait program studi,</p><p>2) misi, tujuan, dan strategi yang searah dengan misi, tujuan, dan strategi perguruan tinggi serta mendukung pengembangan program studi.</p>', '2', '0', null, '2023-04-18 04:07:03', '2023-04-18 04:07:03', null);
