INSERT INTO `indikator_penilaian` VALUES ('1374', '264', '<p>UPPS melakukan analisis SWOT memenuhi aspek-aspek sebagai berikut:&nbsp;</p><p>1) melakukan identifikasikekuatan atau faktor pendorong, kelemahan atau faktor penghambat,peluang dan ancaman yang dihadapi UPPS dilakukan secara tepat,</p><p>2) memiliki keterkaitan dengan hasil analisis capaian kinerja,</p><p>3) merumuskan strategi pengembangan UPPS yang berkesesuaian, dan</p><p>4) menghasilkan program- program pengembangan alternatif yang tepat.</p>', '4', '0', null, '2023-04-18 07:17:52', '2023-04-18 07:17:52', null);
