INSERT INTO `indikator_penilaian` VALUES ('1384', '266', '<p>UPPS menetapkan strategi dan prioritas program pengembangan berdasarkan hasil analisis SWOT atau analisis lainnya yang mempertimbangkan secara komprehensif:</p><p>1) kapasitas UPPS, yang terdiri dari:&nbsp;</p><p>a. alokasi sumber daya,</p><p>b. kemampuan melaksanakan program pengembangan,</p><p>c. rencana penjaminan mutu yang berkelanjutan,&nbsp;</p><p>d. keberadaan dukungan pemangku kepentingan eksternal.</p><p>2) kebutuhan UPPS dan PS di masa depan,</p><p>3) rencana strategis UPPS yang berlaku,</p><p>4) aspirasi dari pemangku kepentingan internal dan eksternal, serta</p><p>5) program yangmenjamin keberlanjutan.</p>', '4', '0', null, '2023-04-18 07:20:51', '2023-04-18 07:20:51', null);
