INSERT INTO `indikator_penilaian` VALUES ('1847', '408', '<p>UPPS telah\r\nmelakukan\r\nanalisis capaian\r\nkinerja yang:\r\n1) analisisnya\r\ndidukung oleh\r\ndata/informasi\r\nyang relevan\r\n(merujuk pada\r\npencapaian\r\nstandar mutu\r\nperguruan\r\ntinggi) dan\r\nberkualitas\r\n(andal dan\r\nmemadai) yang\r\ndidukung oleh\r\nkeberadaan\r\npangkalan data\r\ninstitusi yang\r\nterintegrasi.\r\n2) konsisten\r\ndengan seluruh\r\nkriteria yang&nbsp;diuraikan\r\nsebelumnya,\r\n3) analisisnya\r\ndilakukan\r\nsecara\r\nkomprehensif,\r\ntepat, dan\r\ntajam untuk\r\nmengidentifikas\r\ni akar masalah\r\ndi UPPS.\r\n4) hasilnya\r\ndipublikasikan\r\nkepada para\r\npemangku\r\nkepentingan\r\ninternal dan\r\neksternal serta\r\nmudah diakses.<br></p>', '4', '0', null, '2023-05-11 02:06:16', '2023-05-11 02:06:16', null);
INSERT INTO `indikator_penilaian` VALUES ('1848', '408', '<p>UPPS telah\r\nmelakukan\r\nanalisis capaian\r\nkinerja yang:\r\n1) analisisnya\r\ndidukung oleh\r\ndata/informasi\r\nyang relevan\r\n(merujuk pada\r\npencapaian\r\nstandar mutu\r\nperguruan\r\ntinggi) dan\r\nberkualitas\r\n(andal dan\r\nmemadai) yang\r\ndidukung oleh\r\nkeberadaan\r\npangkalan data\r\ninstitusi yang\r\nbelum\r\nterintegrasi.\r\n2) konsisten\r\ndengan&nbsp;sebagian besar\r\n(7 s.d. 8)\r\nkriteria yang\r\ndiuraikan\r\nsebelumnya,\r\n3) analisisnya\r\ndilakukan\r\nsecara\r\nkomprehensif\r\ndan tepat\r\nuntuk\r\nmengidentifikas\r\ni akar masalah\r\ndi UPPS.\r\n4) hasilnya\r\ndipublikasikan\r\nkepada para\r\npemangku\r\nkepentingan\r\ninternal serta\r\nmudah diakses<br></p>', '3', '0', null, '2023-05-11 02:06:31', '2023-05-11 02:06:31', null);
INSERT INTO `indikator_penilaian` VALUES ('1849', '408', '<p>UPPS telah\r\nmelakukan\r\nanalisis capaian\r\nkinerja yang:\r\n1) analisisnya\r\ndidukung oleh\r\ndata/informasi\r\nyang relevan\r\n(merujuk pada\r\npencapaian\r\nstandar mutu\r\nperguruan\r\ntinggi) dan\r\nberkualitas\r\n(andal dan\r\nmemadai).\r\n2) konsisten\r\ndengan\r\nsebagian (5 s.d.\r\n6) kriteria yang\r\ndiuraikan\r\nsebelumnya,\r\n3) analisisnya\r\ndilakukan&nbsp;secara\r\nkomprehensif\r\nuntuk\r\nmengidentifikas\r\ni akar masalah\r\ndi UPPS.\r\n4) hasilnya\r\ndipublikasikan\r\nkepada para\r\npemangku\r\nkepentingan\r\ninternal.\r\n<br></p>', '2', '0', null, '2023-05-11 02:06:48', '2023-05-11 02:06:48', null);
INSERT INTO `indikator_penilaian` VALUES ('1850', '408', '<p>UPPS telah\r\nmelakukan\r\nanalisis capaian\r\nkinerja yang:\r\n1) analisisnya\r\ntidak\r\nsepenuhnya\r\ndidukung oleh\r\ndata/informasi\r\nyang relevan\r\n(merujuk pada\r\npencapaian\r\nstandar mutu\r\nperguruan\r\ntinggi) dan\r\nberkualitas\r\n(andal dan\r\nmemadai).\r\n2) konsisten\r\ndengan\r\nsebagian kecil\r\n(kurang dari 5)\r\nkriteria yang&nbsp;diuraikan\r\nsebelumnya,\r\n3) analisisnya\r\ndilakukan tidak\r\nsecara\r\nkomprehensif\r\nuntuk\r\nmengidentifikas\r\ni akar masalah\r\ndi UPPS.\r\n4) hasilnya\r\ntidak\r\ndipublikasikan.&nbsp;<br></p>', '1', '0', null, '2023-05-11 02:07:05', '2023-05-11 02:07:05', null);
INSERT INTO `indikator_penilaian` VALUES ('1851', '408', '<p>UPPS tidak\r\nmelakukan\r\nanalisis capaian\r\nkinerja.<br></p>', '0', '0', null, '2023-05-11 02:07:12', '2023-05-11 02:07:12', null);
INSERT INTO `indikator_penilaian` VALUES ('1852', '409', '<p>UPPS\r\nmelakukan\r\nanalisis SWOT\r\natau analisis\r\nlain yang\r\nrelevan, serta\r\nmemenuhi\r\naspek-aspek\r\nsebagai berikut:\r\n1) melakukan\r\nidentifikasi&nbsp;kekuatan atau\r\nfaktor\r\npendorong,\r\nkelemahan\r\natau faktor\r\npenghambat,\r\npeluang dan\r\nancaman yang\r\ndihadapi UPPS\r\ndilakukan\r\nsecara tepat,\r\n2) memiliki\r\nketerkaitan\r\ndengan hasil\r\nanalisis capaian\r\nkinerja,\r\n3) merumuskan\r\nstrategi\r\npengembangan\r\nUPPS yang\r\nberkesesuaian,\r\ndan\r\n4)\r\nmenghasilkan\r\nprogramprogram\r\npengembangan\r\nalternatif yang\r\ntepat.\r\n<br></p>', '4', '0', null, '2023-05-11 02:07:36', '2023-05-11 02:07:36', null);
INSERT INTO `indikator_penilaian` VALUES ('1853', '409', '<p>UPPS\r\nmelakukan\r\nanalisis SWOT\r\natau analisis\r\nlain yang\r\nrelevan, serta\r\nmemenuhi\r\naspek-aspek\r\nsebagai berikut:\r\n1) melakukan\r\nidentifikasi&nbsp;kekuatan atau\r\nfaktor\r\npendorong,\r\nkelemahan\r\natau faktor\r\npenghambat,\r\npeluang dan\r\nancaman yang\r\ndihadapi UPPS\r\ndilakukan\r\nsecara tepat,\r\n2) memiliki\r\nketerkaitan\r\ndengan hasil\r\nanalisis capaian\r\nkinerja, dan\r\n3) merumuskan\r\nstrategi\r\npengembangan\r\nUPPS yang\r\nberkesesuaian. &nbsp;<br></p>', '3', '0', null, '2023-05-11 02:07:48', '2023-05-11 02:07:48', null);
INSERT INTO `indikator_penilaian` VALUES ('1854', '409', '<p>UPPS\r\nmelakukan\r\nanalisis SWOT\r\natau analisis\r\nlain yang\r\nrelevan, serta\r\nmemenuhi\r\naspek-aspek\r\nsebagai berikut:\r\n1) melakukan\r\nidentifikasi&nbsp;kekuatan atau\r\nfaktor\r\npendorong,\r\nkelemahan\r\natau faktor\r\npenghambat,\r\npeluang dan\r\nancaman yang\r\ndihadapi UPPS\r\ndilakukan\r\nsecara tepat,\r\ndan\r\n2) memiliki\r\nketerkaitan\r\ndengan hasil\r\nanalisis capaian\r\nkinerja.<br></p>', '2', '0', null, '2023-05-11 02:08:02', '2023-05-11 02:08:02', null);
INSERT INTO `indikator_penilaian` VALUES ('1855', '409', '<p>UPPS\r\nmelakukan\r\nanalisis SWOT\r\natau analisis\r\nlain yang\r\nmemenuhi\r\naspek-aspek\r\nsebagai berikut:\r\n1) melakukan\r\nidentifikasi\r\nkekuatan atau&nbsp;faktor\r\npendorong,\r\nkelemahan\r\natau faktor\r\npenghambat,\r\npeluang dan\r\nancaman yang\r\ndihadapi UPPS,\r\ndan\r\n2) memiliki\r\nketerkaitan\r\ndengan hasil\r\nanalisis capaian\r\nkinerja, namun\r\ntidak\r\nterstruktur dan\r\ntidak\r\nsistematis.&nbsp;<br></p>', '1', '0', null, '2023-05-11 02:08:15', '2023-05-11 02:08:15', null);
